(1, 0, 'banner logo', 'banner-logo', '', '<div class="title-info"><img alt="logo small" src="templates/scheellarsen/img/logoSmall.png" /><span class="Apple-style-span" style="font-family: ''Jeffriana JF''; font-size: 24pt;">S<span style="font-size: 18pt;">cheel-</span>L<span style="font-size: 18pt;">arsen.dk</span></span><br /><span class="Apple-style-span" style="font-size: 32px;"><span size="3" style="font-size: small;"><span class="Apple-style-span" style="font-size: 11px;"><br /></span></span></span></div>', '', 1, 0, 0, 2, '2011-08-18 10:57:12', 62, '', '2012-03-20 14:29:16', 62, 0, '0000-00-00 00:00:00', '2011-08-18 10:57:12', '0000-00-00 00:00:00', '', '', '', 75, 0, 4, '', '', 1, 0, '', 0, '*', ''),
(2, 0, 'banner contact text', 'banner-contact-text', '', '<div id="txt-info1" class="address-info">\r\n<p style="text-align: left;"><span style="font-family: ''book antiqua'', palatino; font-size: 12pt;">Krukker &amp; Havemøbler ApS</span></p>\r\n<p><span style="color: #808080;">Hesselrødvej 26, Karlebo<br />2980 Kokkedal<br />Mobil: 41628001</span><br /><span style="color: #808080;">Email: <a href="mailto:info@scheel-larsen.dk"><span style="color: #808080;">info@scheel-larsen.dk</span></a></span><br /><span style="color: #808080;">CVR 30711912</span></p>\r\n</div>', '', 1, 0, 0, 2, '2011-08-18 10:58:39', 62, '', '2014-02-20 14:00:49', 62, 0, '0000-00-00 00:00:00', '2011-08-18 10:58:39', '0000-00-00 00:00:00', '', '', '', 23, 0, 5, '', '', 1, 0, '', 0, '*', ''),
(3, 0, 'banner find os  link', 'banner-find-os-link', '', '<p><a class="btn_find" href="index.php?option=com_contact&amp;view=contact&amp;id=1&amp;Itemid=5">Find os her !</a></p>\r\n<div class="scroll-pane">&nbsp;</div>', '', 1, 0, 0, 2, '2011-08-18 10:59:19', 62, '', '2011-08-26 05:55:01', 62, 0, '0000-00-00 00:00:00', '2011-08-18 10:59:19', '0000-00-00 00:00:00', '', '', '', 28, 0, 2, '', '', 1, 10, '', 1, '*', ''),
(4, 0, 'welcome content', 'welcome-content', '', '<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #333300; font-size: 8pt;"><span style="font-family: Calibri,sans-serif;"><span style="font-family: book antiqua,palatino;"><span style="color: #333300;"><span style="text-align: center; font-family: book antiqua,palatino;" class="mceVisualAid mceVisualGuides"><span style="color: #000000; font-size: 8pt;"><span style="color: #99cc00; font-family: arial black,avant garde; font-size: 10pt;"><strong>KOM OG BESØG VORES 5000 KVM STORE UDENDØRSUDSTILLING MED&nbsp; FLERE HUNDREDE KRUKKER &amp; KÆMPE HAVEMØBELUDSTILLING <span style="font-size: 12pt;"><strong><span style="font-family: Times; color: #ff99cc;"></span></strong></span></strong></span></span></span></span></span></span></span></p>\r\n<p style="text-align: center;"><span style="color: #333300; font-size: 8pt;"><span style="font-family: Calibri,sans-serif;"><span style="font-family: book antiqua,palatino;"><span style="color: #333300;"><span style="text-align: center; font-family: book antiqua,palatino;" class="mceVisualAid mceVisualGuides"><span style="color: #000000; font-size: 8pt;"><span style="color: #99cc00; font-family: arial black,avant garde; font-size: 10pt;"><strong><span style="font-size: 10pt;"><strong><span style="font-family: Times; color: #ff99cc;">Ta'' børnene med - vi har Får/lam, Geder/kid, Høns, Carl, Gustav, Hunde og Katte..!<br /></span></strong></span></strong></span></span></span></span></span></span></span></p>\r\n<p style="text-align: center;"><span style="color: #333300; font-size: 8pt;"><span style="font-family: Calibri,sans-serif;"><span style="font-family: book antiqua,palatino;"><span style="color: #333300;"><span style="text-align: center; font-family: book antiqua,palatino;" class="mceVisualAid mceVisualGuides"><span style="color: #000000; font-size: 8pt;"><span style="color: #99cc00; font-family: arial black,avant garde; font-size: 10pt;"><strong><span style="font-size: 8pt;"><span style="color: #000000;"></span></span><br /></strong></span><span style="color: #333300;"><span style="text-align: center;" class="mceVisualAid mceVisualGuides"><span style="color: #333300; font-size: 8pt;"><span style="font-family: Calibri,sans-serif;"><span style="color: #333300; font-family: book antiqua,palatino;"><span style="text-align: center;" class="mceVisualAid mceVisualGuides"><span style="font-size: 12pt;"><span style="font-size: 8pt;">Ved køb af varer over 1.000 kr. hos<span style="color: #333300;"><span style="text-align: center;" class="mceVisualAid mceVisualGuides"><span style="font-family: Calibri,sans-serif;"><span style="font-family: ''Jeffriana JF'';"><span style="font-family: ''Jeffriana JF'';"><span style="font-family: Calibri,sans-serif;"><span style="font-size: 12pt;"><span style="font-family: book antiqua,palatino;"><span style="color: #333300;"><span style="text-align: center; font-family: book antiqua,palatino;" class="mceVisualAid mceVisualGuides"><span style="font-family: Calibri,sans-serif;"><span style="font-family: ''Jeffriana JF'';"><span style="font-family: ''Jeffriana JF'';"><span style="font-family: book antiqua,palatino;"><span style="font-family: Calibri,sans-serif;"><span style="font-size: 12pt;"> <span style="color: #333300; font-size: 8pt;"><span style="font-family: Calibri,sans-serif;"><span style="font-family: book antiqua,palatino;"><span style="color: #333300;"><span style="text-align: center; font-family: book antiqua,palatino;" class="mceVisualAid mceVisualGuides"><span style="font-family: Calibri,sans-serif;"><span style="font-family: ''Jeffriana JF'';"><span style="font-size: 12pt;">Scheel-<span style="font-family: ''Jeffriana JF'';"><span style="font-size: 12pt;">Larsen.dk <span style="font-size: 8pt; font-family: book antiqua,palatino;">leverer og samler vi GRATIS..! på hele Sjælland. Ved køb under 1.000 kr. pålægges et fragtgebyr på 150 kr. Fragt til Jylland 350 kr.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n<table style="margin-left: auto; margin-right: auto; width: 540px; height: 225px;" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><a title="Cane-line" href="index.php?option=com_virtuemart&amp;page=shop.product_list&amp;category_id=29&amp;Itemid=1"><img src="images/stories/cane-line.jpg" alt="Cane-line" title="Cane-line" height="183" width="245" /></a></p>\r\n</td>\r\n<td>\r\n<p><span style="color: #99cc00;"><strong><span style="font-size: 8pt;"><a title="Natures Collection" href="index.php?option=com_virtuemart&amp;page=shop.product_list&amp;category_id=28&amp;Itemid=1"><span style="color: #99cc00;"><img src="images/stories/natures collection.jpg" alt="Natures Collection" title="Natures Collection" height="185" width="246" /></span></a></span></strong></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span style="color: #99cc00;"><strong><span style="font-size: 8pt; font-family: book antiqua,palatino;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Lidt billeder fra vores store udstilling der rummer rigtig mange krukker og havemøbler</span></strong></span><br />\r\n<table style="margin-left: auto; margin-right: auto; width: 519px; height: 221px;" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><img src="images/stories/krukkebillede1.jpg" alt="" height="214" width="160" /></p>\r\n</td>\r\n<td>\r\n<p><img src="images/stories/krukkebillede2.jpg" alt="" height="216" width="163" /></p>\r\n</td>\r\n<td valign="top"><img src="images/stories/mbler1.jpg" alt="" height="215" width="165" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br /><a title="Cane-line Diamond Lounge" href="index.php?option=com_virtuemart&amp;page=shop.product_list&amp;category_id=29&amp;Itemid=1"><br /></a></p>\r\n<p><br /><br /><br /></p>\r\n', '\r\n<p>&nbsp;</p>\r\n<p><span style="color: #333300;"><span style="font-size: 10pt;">På Sjælland leverer, samler og sætter vi op - Gratis ved køb over 1.000 kr.</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: ''Verdana'',''sans-serif''; font-size: 8.5pt;"><span style="color: #333300; font-size: 10pt;">I resten af landet gælder følgende:</span></span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: right;"><span style="color: #333300; font-size: 10pt;"><span style="font-family: ''Verdana'',''sans-serif'';">2-5 dage alt afhængig af, hvor i Danmark, varerne skal leveres til. </span></span><span style="font-family: ''Verdana'',''sans-serif''; color: #333300; font-size: 10pt;">Vi leverer kun til brofaste øer. Vi bruger et transportfirma over længere afstande og dette vil koste 350 kr inkl. moms og møblerne leveres usamlet. </span><span style="font-family: ''Verdana'',''sans-serif''; color: #333300; font-size: 10pt;">Der leveres ikke til Færøerne, Grønland og udlandet.</span></p>', 0, 0, 0, 10000, '2011-08-19 02:20:00', 62, '', '2014-04-25 11:00:05', 62, 0, '0000-00-00 00:00:00', '2011-08-19 02:20:00', '0000-00-00 00:00:00', '', '', '', 502, 0, 2, '', '', 1, 0, '', 1, '*', ''),
(5, 0, 'Tilbud', 'container-text', '', '<br />\r\n<p><span style="color: #99cc00;"><strong><span style="font-size: 10pt; font-family: verdana,geneva;">NYHEDSREDAKTIONEN<br /></span></strong></span></p>\r\n<p><span style="font-family: verdana,geneva;"><strong><span style="color: #99cc00;"></span></strong></span><span style="color: #333333;"><span style="font-size: 8pt;">Vi har nu åbnet vores store </span><span style="font-size: 8pt;">Krukke- og<br />Havemøbeludstilling med mange nyheder! <br />I Havemøbeludstillingen forefindes rigtig <br />mange lækre havemøbelsæt, Stole, Borde, <br />Loungesæt, Solvogne, Parasoller, Acces-<br />sories</span></span><span style="font-family: verdana,geneva; color: #000000;"><span style="font-size: 8pt;"><span style="color: #333333;"> etc.</span><br style="font-size: 8pt;" /></span><br /></span></p>\r\n<p><span style="font-family: verdana,geneva;"><strong><span style="color: #99cc00;">KRUKKER</span></strong></span> <strong><span style="color: #99cc00;">I </span><span style="color: #99cc00;">2014</span></strong></p>\r\n<p><span style="font-size: 8pt; color: #333333;">Vi har fået flere 100 forskellige krukker <br />hjem </span><span style="font-size: 8pt; color: #333333;">i 2014 og nu også fra Afrika - fra <br />de helt små </span><span style="font-size: 8pt;"><span style="color: #333333;">til de helt store...!</span><br /><br /></span></p>\r\n<p><span style="font-family: verdana,geneva;"><strong><span style="color: #99cc00;">SKIND</span></strong></span></p>\r\n<p><span style="font-family: verdana,geneva;"><strong><span style="color: #99cc00;"></span></strong></span><span style="color: #333333;"><span style="font-size: 8pt;">På skindsiden udvider vi med skind fra en <br />Angora </span><span style="font-size: 8pt;">Ged, sælskind og koskind alle i en <br />rigtig lækker kvalitet</span>.</span><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #515100; font-size: 12pt;"><strong><br /></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', 1, 0, 0, 10000, '2011-08-19 02:25:11', 62, '', '2014-04-01 13:56:46', 62, 0, '0000-00-00 00:00:00', '2011-08-19 02:25:11', '0000-00-00 00:00:00', '', '', '', 91, 0, 1, '', '', 1, 0, '', 0, '*', ''),
(6, 0, 'footer text', 'footer-text', '', '<div class="f-info">\r\n<div class="clr" style="height: 10px;"></div>\r\n<p style="float: left; color: #363533;">Copyright © 2011 Scheel-Larsen.dk . All rights reserved<br /> Scheel-Larsen Krukker &amp; Havemøbler ApS • CVR 30711912 • <a style="text-decoration: none; color: #363533; font-size: 12px;" href="mailto:info@scheel-larsen.dk">info@scheel-larsen.dk</a></p>\r\n<a style="float: right; text-decoration: none; color: #363533; font-size: 12px;" target="_blank" href="http://mywebcreations.dk">Design af My Web Creations</a></div>', '', 1, 0, 0, 2, '2011-08-19 02:34:47', 62, '', '2014-02-18 06:04:44', 62, 0, '0000-00-00 00:00:00', '2011-08-19 02:34:47', '0000-00-00 00:00:00', '', '', '', 5, 0, 3, '', '', 1, 0, '', 0, '*', ''),
(7, 0, 'Om Scheel-Larsen', 'om-os', '', '<div class="text-intro">\r\n<div class="text-introp">\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;">&nbsp;</p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;"><span style="color: #74c738;"><b><span style="font-size: 28pt;">Om Scheel-Larsen ... </span></b></span></p>\r\n<p style="margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;"><span style="font-family: ''Calibri'',''sans-serif''; font-size: 12pt;"><span style="color: #003300; font-size: 28pt;"><img style="margin-left: 10px; float: right;" src="images/stories/farfar 1949.jpg" width="186" height="144" /></span></span></p>\r\n<span style="font-family: ''Calibri'',''sans-serif''; font-size: 12pt;"><span style="color: #003300; font-size: 28pt;"></span></span>\r\n<p><span>Scheel-Larsen er et gammelt familieejet selskab der har eksisteret i 87 år. Grundlæggeren var min farfar Henry Scheel-Larsen, der i 1924 åbnede isenkramforretningen Scheel-Larsen på hjørnet af Duntzfelts alle og Strandvejen i Hellerup, med ekspertise inden for glas, porcelæn, værktøj, havemøbler og haveartikler.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in;">&nbsp;</p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in;">&nbsp;</p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in;">&nbsp;</p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in;">&nbsp;</p>\r\n<p><span><img style="margin-right: 10px; float: left;" class="caption" alt="Per Scheel-Larsen" src="images/stories/dias1.jpg" width="137" height="196" /></span></p>\r\n<p><span>I 1959 blev Per Scheel-Larsen medindehaver af forretningen i Hellerup. Ligeledes stødte Klaus Scheel-Larsen - den yngste af&nbsp; Henry''s sønner til i 1966, hvor man erhvervede sig lejemålet i Rødovre Centret.</span></p>\r\n<p><br /><span>I 1987 ændrede familien navnet til Scheel-Larsen Køkken &amp; Have.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;"><span style="font-family: ''Calibri'',''sans-serif''; font-size: 12pt;">&nbsp;</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;">&nbsp;&nbsp;</p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;">&nbsp;&nbsp;&nbsp;</p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;">&nbsp;</p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;">I år 2000 overtog jeg - Thomas Scheel-Larsen - butikkerne og drev dem i 8 år, frem til afhændelsen til Imerco A/S den 3. september 2007. I de forgangne år har jeg satset kraftig på have- og havemøbeldelen, som altid har været familiens kendetegn på Strandvejen.</p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;">&nbsp;</p>\r\n<div class="text-introp"><span><span face="Calibri, sans-serif" size="3" style="font-size: small;"><img style="margin-left: 10px; float: right;" src="images/stories/thomas scheel-larsen.jpg" width="137" height="183" /></span></span></div>\r\n<p><span>2011: Min kone og jeg viderefører nu forretningen Scheel-Larsen under navnet "Scheel-Larsen Have- &amp; Havemøbler ApS", og vi viderefører de værdier, som altid har kendetegnet Scheel-Larsen, nemlig:&nbsp;</span></p>\r\n<p><span>at levere de bedste produkter til den bedste pris, og samtidig yde vore kunder den bedste og mest professionelle service.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;"><span style="color: #000000;"><span style="font-size: 12pt;"></span>&nbsp;</span></p>\r\n<p><span>Vi arbejder kun sammen <img style="margin-right: 10px; float: left;" src="images/stories/havembleudstilling anno.jpg" width="207" height="147" /> med udvalgte og seriøse leverandører herhjemme og i udlandet. Alle varer er nøje udvalgt med henblik på funktionalitet, design, brugsværdi og ikke mindst kvalitet. Vi har erfaring med produkterne vi sælger og kan derfor 100% stå inde for dem. Vort sortiment fornyes løbende året igennem. Vi udbygger løbende varesortimentet, således at det også kommer til at omfatte juletræer, julebelysning, grill, udendørsbelysning, haveredskaber, krukker, blomster etc.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>Vi tilbyder fuld tilfredshed eller pengene tilbage i 14 dage.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span><img style="margin-right: 10px; float: left;" src="images/stories/gl. billede af scheel bil.jpg" width="205" height="154" />Har du som kunde specielle ønsker om varer, som ikke umiddelbart findes i vort sortiment, vil vi gøre alt, hvad der er muligt for at fremskaffe den ønskede vare inden for rimelig tid.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt;">&nbsp;</p>\r\n</div>\r\n</div>', '', 1, 0, 0, 10000, '2011-08-19 02:49:01', 62, '', '2012-01-12 08:57:31', 62, 0, '0000-00-00 00:00:00', '2011-08-19 02:49:01', '0000-00-00 00:00:00', '', '', '', 51, 0, 3, '', '', 1, 0, '', 0, '*', ''),
(8, 0, 'Salgs- og leveringsbetingelser', 'salgs', '', '<div class="text-intro" style="text-align: justify;">\r\n<p style="text-align: left;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="line-height: 115%; color: #66ab27; font-size: 28pt;">Salgs- og leveringsbetingelser</span></b><span style="line-height: 115%; color: #66ab27; font-size: 28pt;"></span></span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Priser </span></b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Alle priser er inkl. moms og afgifter og i danske kroner. Den angivne pris ved bestillingstidspunktet er den gældende bestillingspris. Leveringsomkostninger beregnes særskilt og fremgår inden godkendelse af købet. Der tages forbehold for prisfejl, force majeure og udsolgte varer.</span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Levering</span></b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Vi leverer uden beregning på hele Sjælland, dog kun hvis beløbet overstiger 1000 kr. Endvidere samler og sætter vi varerne op. Pap og indpakning medtages, hvis dette ønskes.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />I resten af landet gælder følgende:</span></p>\r\n<p><span face="arial, helvetica, sans-serif" style="font-family: arial, helvetica, sans-serif;"><br /></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><b>2-5 dage alt afhængig af, hvor i Danmark, varerne skal leveres til.</b></span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><b></b></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Vi leverer kun til brofaste øer. Vi bruger et transportfirma over længere afstande.&nbsp;Der leveres ikke til Færøerne, Grønland og udlandet.&nbsp;</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Der tages forbehold for udsolgte varer og udskudt leveringstid hos Scheel-Larsen Krukker &amp; Havemøbler ApS grossister. Du har endvidere mulighed for at få varen leveret til en anden adresse end betalingsadressen. Du kan f.eks. få varen leveret på din arbejdsplads. Ønsker du varen leveret til en anden adresse end betalingsadressen, skal du blot udfylde felterne under leveringsadresse.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;">Sammen med varerne modtager du en faktura. Vælger du anden leveringsadresse, vil fakturaen blive tilsendt på e-mail. Alle fakturaer udstedes på dansk. Hvis du ønsker at få tilsendt et nyt eksemplar af fakturaen, så send en e-mail til<span style="color: #99cc00;"> <a href="mailto:info@scheel-larsen.dk"><span style="color: #99cc00;">info@scheel-larsen.dk</span></a>.</span></span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><span style="color: #99cc00;"><span style="color: #99cc00;"></span></span></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />For at lette leveringen, kan du give tilladelse til at fragtmanden stiller varen et nærmere angivet sted, ellers stilles de ved hoveddøren. Det er et krav, at du er til stede på leveringstidspunktet, med mindre at du i kommentarfeltet i forbindelse med din bestilling giver tilladelse til, at varen - på dit eget ansvar - placeres et nærmere angiven sted på adressen</span></p>\r\n<p style="margin: 12pt 0cm;"><span style="font-size: 12pt; font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27;">Fragt</span></b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Fragt koster kr. 350,00, hvis det er uden for Sjælland. En postforsendelse uden omdeling koster kr. 65,00 uanset vægt. Der beregnes ikke gebyr for emballage. Er du ikke hjemme på den aftalte leveringsdato, vil fragtmanden tage dine varer med igen, medmindre du har givet samtykke til at varerne kan stilles - på eget ansvar - et nærmere angiven sted på adressen. Er varen sendt med Post Danmark, vil du modtage et Track an Trace nr. så du kan følge varens vej. Er du ikke hjemme modtager du en afhentningsseddel i din postkasse, hvorefter du kan afhente din pakke på posthuset i op til 7 dage.<b></b></span></p>\r\n<p style="margin: 12pt 0cm;"><span style="font-size: 12pt; font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27;">Betaling</span></b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Hos www.scheel-larsen.dk kan De betale på følgende måder:</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />- Dankort, online</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;">- Mastercard<br /></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;">- Visa<br /></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;">- Efter aftale, kreditaftale<br /></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;">- Kontant, ved butikssalg&nbsp;<br /></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;">- Bankoverførsel, Jyske bank konto 5017-1330009.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Ved betaling med kort vil beløbet først blive trukket på din konto, når varen afsendes. Scheel-larsen.dk krypterer alle dine kortoplysninger med den såkaldte SSL (Secure Socket Layer) protokol. Det betyder, at uvedkommende ikke kan aflæse dit kortnummer eller andre informationer under transaktionen med PBS. Bemærk, at vi ikke opkræver gebyr for betaling med kort.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Ved bankoverførsel bedes det pågældende beløb overført til konto 5017-1330009.</span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Reklamationsret</span></b><span style="color: #66ab27; font-size: 12pt;"></span></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Scheel-Larsen Krukker &amp; Havemøbler ApS yder 2 års reklamationsret i henhold til købeloven, på alle produkter købt på www.scheel-larsen.dk. Er der yderligere reklamationsret eller garanti vil det fremgå særskilt af fakturaen. Skulle varen mod forventning gå i stykker under reklamationsperioden, repareres den vederlagsfrit af enten vores værksted eller producentens. Reklamationsretten dækker ikke fejl, skader eller slidtage, direkte eller indirekte opstået som følge af forkert betjening, ringe vedligeholdelse, vold eller uautoriserede indgreb.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Reklamationer skal modtages indenfor rimelig tid, efter at du har konstateret skaden. Reklamerer du inden 2 måneder, anses reklamationen altid for værende rettidig.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Skulle varen have taget skade under fragt, beder vi dig bemærke dette overfor fragtselskabet, og kontakte Scheel-Larsen Krukker &amp; Havemøbler ApS på e-mail <span style="color: #74b945;"><a href="mailto:info@scheel-larsen.dk."><span style="color: #74b945;">info@scheel-larsen.dk.</span></a></span></span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Reklamation</span></b><span style="color: #66ab27; font-size: 12pt;"></span></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Ved fejl, mangler eller eventuelt udeblevne leverancer, bedes henvendelse rettet til:</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Scheel-Larsen Krukker &amp; Havemøbler ApS, e-mail: <span style="color: #74b945;"><a href="mailto:info@scheel-larsen.dk"><span style="color: #74b945;">info@scheel-larsen.dk</span></a></span> eller mobil: 41628001.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Ved henvendelse, bedes følgende oplyst: Fakturanr., købstidspunkt, kopi af eventuelt forudgående korrespondance, beskriv fejlen og send meget gerne et foto med af varen.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Varereturnering foregår til følgende adresse:</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><b><br />Scheel-Larsen Krukker &amp; Havemøbler ApS</b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><b>Hesselrødvej 26, Karlebo</b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><b>2980 Kokkedal</b></span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Returnering</span></b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">I forbindelse med reklamationssager afholder Scheel-Larsen Krukker &amp; Havemøbler ApS selvfølgelig returneringsomkostningerne.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Send os en mail til <span style="color: #74b945;"><a href="mailto:info@scheel-larsen.dk"><span style="color: #74b945;">info@scheel-larsen.dk</span></a></span>, beskriv fejlen og send meget gerne et foto med af varen. Vi vil herefter afhente det defekte produkt og levere et nyt tilsvarende produkt, hvis lager haves. I modsat fald refunderes beløbet Hvis du bor i nærheden, er du også velkommen til personligt at indlevere varerne.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Ved tilbagesendelse af defekte eller forkerte varer til Scheel-Larsen Krukker &amp; Havemøbler ApS, hvor fejl eller defekt, defineret og angivet af dig, ikke konstateres, vil varen blive tilbagesendt til dig inklusiv et ekspeditionsgebyr. Ekspeditionsgebyret er kr. 250,- inkl. moms for enkeltdele og kr. 350,- inkl. moms for sæt. Varer bør returneres med en fakturakopi, hvor købstidspunktet for det reklamerede produkt fremgår, da varen ellers vil blive henlagt indtil der forligger fakturakopi og eventuelt fejlmeddelelse på produktet.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Vær opmærksom på at du selv skal afholde omkostningerne til returnering af varer til os, som ikke er defekte.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Bemærk, at vi ikke modtager pakker sendt pr. efterkrav. Returnering kan også ske ved at nægte modtagelse, af varen.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Er du i tvivl, er du altid velkommen til at kontakte Scheel-Larsen Krukker &amp; Havemøbler ApS på e-mail <span style="color: #74b945;"><a href="mailto:info@scheel-larsen.dk"><span style="color: #74b945;">info@scheel-larsen.dk</span></a></span> eller mobil: 41628001.</span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Ombytning</span></b><span style="color: #66ab27; font-size: 12pt;"></span></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Skal du bytte en vare - så returnerer du varen til ovenstående adresse sammen med Scheel-Larsen Krukker &amp; Havemøbler ApS RETURFORMULAR. Efterfølgende skal du gå ind i webshoppen og købe den vare du ønsker igen. Under betalingen angiver du under bemærkninger, at ordren er vedrørende ombytning af din oprindelige ordre. Når vi modtager dine varer retur, vil vi hurtigst mulig ekspedere din ombytning, og når vi trækker beløbet fra din konto, er det selvfølgelig kun de fulde omkostninger til fragten du skal betale igen samt en eventuel difference. Såfremt du ønsker at ombytte varen til en anden og billigere vare, vil vi overføre differencen til din bankkonto.</span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Refusion</span></b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">I tilfælde af et eventuelt nedslag i prisen, returnerede varer eller forudbetalte varer som afbestilles før afsendelse, vil der foretages en hel eller delvis tilbagebetaling af købesummen.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Er varen betalt med Dankort/kreditkort, vil beløbet blive krediteret dit kort. Har du betalt via bankoverførsel, beder vi dig i din mail vedlægge oplysninger om registreringsnr. og kontonr. for din bankkonto. Disse oplysninger er ikke følsomme og kan derfor uden videre oplyses pr. e-mail eller anden traditionel korrespondanceform. Tilbagebetaling sker så hurtigt som muligt, efter at vi har modtaget varen retur og kontrolleret, at den lever op til betingelserne for fortrydelsesret eller reklamation</span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Fortrydelsesret</span></b><span style="color: #66ab27; font-size: 12pt;"></span></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Ved handel på www.scheel-larsen.dk har du altid 14 dages fortrydelsesret fra modtagelsen af dine varer. Hvis du vælger at fortryde et køb, skal du blot returnere varen i samme stand og mængde, som du modtog den. Når varen er modtaget retur og godkendt, refunderes beløbet til din konto indenfor få dage. Omkostninger til returnering skal du selv afholde. Fortrydelse kan også ske ved at nægte modtagelse eller efter nærmere aftale at aflevere varen personligt til os.</span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Personlige oplysninger</span></b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Registrering af dine personlige oplysninger bliver altid behandlet etisk korrekt af Scheel-Larsen Krukker &amp; Havemøbler ApS. Vi betragter dine personlige data som en tillidssag. Vi vil gerne understrege at absolut INGEN personlige oplysninger, der registreres på www.scheel-larsen.dk på noget tidspunkt bliver overdraget, solgt eller gjort tilgængelig for tredjemand. Alle informationer opbevares på betryggende vis, og i henhold til dansk lovgivning.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />I forbindelse med elektronisk betaling bruges en sikker krypteret metode gennem Webshop-systemet. Det er en godkendt udbyder med godkendelse fra E-handelsmærket.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><br />På www.scheel-larsen.dk anvender vi kun såkaldte cookies i begrænset omfang. En cookie er en lille fil, som bliver sendt fra vores hjemmeside til din computer for midlertidigt at gemme oplysninger. Eksempelvis omkring hvilke varer, du har lagt i din indkøbskurv. Cookies kan slettes ved at gå ind i Internet Explorer under punktet ”Funktioner” og derefter ”Internetindstillinger”. Under dette menupunkt vælges ”Slet cookies”. Herved slettes ALLE cookies.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Når du står for at gennemføre et køb, er der en række oplysninger vi udbeder os. Disse informationer er nødvendige for at kunne fakturere og fremsende varer. Dine personlige oplysninger opbevares så længe det er nødvendigt - dog max. 5 år efter dit sidste køb, hvorefter oplysningerne vil blive slettet.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Under et køb udbeder vi os navn, adresse, telefonnummer og e-mail adresse. Disse informationer bruges udelukkende til behandling af ordren. Informationerne transmitteres og lagres elektronisk på ukrypteret form, og gemmes i 5 år. Selve "kontrakten" (købsaftalen) lagres ikke hos www.scheel-larsen.dk på en måde, så du senere kan logge dig ind og se/ændre status. Alle kontrakter indgås på dansk.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Desuden registrerer vi IP-adressen, hvorfra eventuelt køb foretages. Informationen finder normalt ingen anvendelse, men kan bruges i en eventuel politiefterforskning. Alle falske bestillinger politianmeldes.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Man kan desuden valgfrit få sin e-mail adresse optaget på en nyhedsliste hos www.scheel-larsen.dk, således at man løbende modtager nyheder, information om lagersalg, udsalg og anden information fra www.scheel-larsen.dk. Denne service kan til enhver tid tilmeldes og frameldes som man ønsker.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Jf. persondataloven oplyser vi på forespørgsel om registrerede oplysninger og på baggrund af eventuelt indsigelser foretager vi sletning i det omfang det ønskes.</span></p>\r\n<p style="line-height: normal; margin: 12pt 0cm;"><span style="font-family: arial, helvetica, sans-serif;"><b><span style="color: #66ab27; font-size: 12pt;">Sikkerhed ved betaling Online med dankort</span></b></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Det er sikkert at handle hos www.scheel-larsen.dk. Samtidig spare du tid og penge, ved ikke at skulle stå i kø i butikkerne, eller på posthuset, samtidig slipper du for gebyrer<span style="color: #74b945;">. <a href="http://www.scheel-larsen.dk/"><span style="color: #74b945;">www.scheel-larsen.dk</span></a></span> betalingssystem er godkendt og certificeret af PBS og E-handelsfonden.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Når du betaler med kort, bliver alle dine data krypteret/kodet med SSL (Secure Socket Layer) protokol. Det betyder, at uvedkommende ikke kan aflæse dine kortdata under transaktionen med PBS.</span></p>\r\n<p><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"></span><span class="Apple-style-span" style="font-family: arial, helvetica, sans-serif;"><br />Kryptering med SSL benyttes i langt de fleste internetbutikker. Vi kommer aldrig i besiddelse af dit kortnr. eller kontonr., men trækker det af dig som kunde godkendte beløb fra din konto via et transaktionsnummer og først når dine vare afsendes fra os. Ved betaling med kort via internettet er du altid sikret mod misbrug. Du har mulighed for at afvise en betaling, når du modtager din betalingsoversigt og du har ingen selvrisiko i tilfælde af, at dit kort bliver misbrugt i en internetbutik, der benytter SSL i sit betalingssystem. Dermed er du faktisk bedre stillet end i den fysiske verden, hvor du har en selvrisiko på kr. 1.200,00 når dit betalingskort misbruges ved brug af pinkoden. Dataene du sender i forbindelse med køb på dankort er krypteret, det er kun og kun PBS der kan læse dem. Hverken www.scheel-larsen.dk eller andre kan aflæse dine data. Du kan finde flere oplysninger om betaling over internettet på <span style="font-size: 10pt;"><span style="color: #74b945;"><a href="http://www.betaling.dk/"><span style="color: #74b945;">www.betaling.dk</span></a></span> eller på <span style="font-size: 10pt;"><span style="color: #74b945;"><a href="http://www.forbrugersikkerhed.dk/"><span style="color: #74b945;">www.forbrugersikker-hed.dk</span></a></span></span></span></span></p>\r\n</div>', '', 1, 0, 0, 10000, '2011-08-19 03:06:22', 62, '', '2014-02-18 06:15:14', 62, 0, '0000-00-00 00:00:00', '2011-08-19 03:06:22', '0000-00-00 00:00:00', '', '', '', 46, 0, 4, '', '', 1, 0, '', 0, '*', ''),
(9, 0, 'Kontact page text', 'kontact-page-text', '', '<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; text-align: left;"><span style="font-family: ''Jeffriana JF''; color: black; font-size: 18pt;">Scheel-<span style="font-family: ''Jeffriana JF''; color: black;">Larsen.dk</span></span></p>\r\n<p><span style="font-size: 8pt; font-family: arial,helvetica,sans-serif;">v/Helle Scheel-Larsen<br /><br />Hesselrødvej 26, Karlebo<br /><br />2980 Kokkedal<br /><br />Mobil: 41628001<br /><br />Email: <a href="mailto:info@scheel-larsen.dk" class="btn_link">info@scheel-larsen.dk</a></span></p>\r\n<p><span style="color: #000000; font-family: arial,helvetica,sans-serif; font-size: 8pt;"><strong>Åbningstider:<br /></strong><br />Mandag-fredag, kl. 10.00-18.00<br /><br />Lørdag, søn- og helligdage, kl. 10-16</span></p>', '', 1, 0, 0, 2, '2011-08-19 03:49:14', 62, '', '2014-03-09 05:51:05', 62, 0, '0000-00-00 00:00:00', '2011-08-19 03:49:14', '0000-00-00 00:00:00', '', '', '', 57, 0, 1, '', '', 1, 0, '', 0, '*', ''),
(10, 0, 'Blank page', 'blank-page', '', '<p>Blank</p>', '', 1, 0, 0, 0, '2011-08-19 07:36:53', 62, '', '2011-08-23 03:02:18', 62, 0, '0000-00-00 00:00:00', '2011-08-19 07:36:53', '0000-00-00 00:00:00', '', '', '', 6, 0, 1, '', '', 1, 3, '', 0, '*', ''),
(11, 0, 'Keener Boy Furniture, Baby Furniture, Kids Furniture', 'keener-boy-furniture-baby-furniture-kids-furniture', '', '<p><img alt="" src="images/nit_3.jpg" style="width: 122px; height: 75px; margin-left: 10px; margin-right: 10px; float: left;" />Gov. Andrew M. Cuomo, suggesting it was time for the state to "come to grips" with the proliferation of gambling in New York and neighboring states, said Tuesday that he was weighing the legalization of commercial, non-Indian casinos said Tuesday that he was weighing the legalization of said Tuesday that he was weighing the legalization of commecommein New York State</p>\r\n', '\r\n<p>is known as one of the best destination for many foreign people. The white sandy beaches, sparkling blue water and the variety of recreational opportunities in areas that buy all their own residential property in the city and will be permanent.</p>\r\n<p>The different cultures, the design of furniture have influenced. There are several issues that can be seen in many homes in the region. If you compare Furniture with other furniture, you will notice that there is a practical design that integrates the overall impression of the house can while providing maximum comfort and convenience for the individual.</p>\r\n<p>Well, a lot of furniture that can be seen at your local places, it is always important to be careful when looking for the right furniture, transform your house into a home really. It is very important for all owners of the best furniture they need for their home while they are able to find their love freely and comfortably with their house.</p>\r\n<p>But before you new furniture right for your home, you need the furniture, which are your home needs. You must do your part in advance to be able to efficiently and correctly store. You need your own list of necessary furniture for your home. You need to bring to avoid a checklist, the wrong parts.</p>', 0, 0, 0, 4, '2011-08-19 07:57:59', 62, '', '2012-01-20 09:50:43', 62, 0, '0000-00-