(12, 0, 'Krukker/havebeholdere', 'krukkerhavebeholdere', '', '<p><b><span style="line-height: 115%; color: #92d050; font-size: 16pt;">Haveaffaldsbeholdere godkendt i Gentofte<br />og Gladsaxe kommuner</span></b></p>\r\n<p><span style="font-size: 10pt;">En nem og miljøvenlig måde at komme af med sit haveaffald på. Haveaffald <br />er følgende: Blade, blomster, grene, græs, kvas og kviste og ukrudt uden<br />jord.</span></p>\r\n<p><span style="font-size: 10pt;">Affaldsordningen betyder, at alle parcel og rækkehuse kan komme af med<br />deres haveaffald hver 14 dag året rundt i Gentofte kommune. Du må have<br />6 affaldsenheder pr. husstand. Beholdere på hjul må have str. 140 liter, <br />190 liter og 240 liter.</span></p>\r\n<p><span style="font-size: 10pt;">Det eneste du skal gøre er, at være tilmeldt den kommunale dagrenovations-<br />ordning og stille dine beholder ud på afhentningsdagen inden kl. 7.00. På <br />følgende link til Gentofte kommune kan du læse alt om affaldsordningen:</span></p>\r\n<p><span style="color: #80ab00; font-size: 10pt;"><b><a href="http://www.gentofte.dk/Borger/Bolig/Affald-og-Genbrug/~/media/Nyt%20Gentofte%20dk/PDF/Borger/Bolig/Affald%20og%20Genbrug/Vejeldning%20for%20ordningen%20for%20haveaffald.ashx"><span style="color: #80ab00;">Gentofte</span></a></b></span></p>\r\n<p>&nbsp;</p>\r\n', '\r\n<p><span style="font-size: 10pt;"> I Gladsaxe kommune kan du have ubegrænset antal affaldsenheder. Der af-<br /> hentes haveaffald fra medio februar og til midten af december. Der afhentes<br />hver 14 dag. Haveaffald er følgende: Blade, blomster, grene, græs, kvas, <br />kviste og ukrudt uden jord.</span></p>\r\n<p><span style="font-size: 10pt;">Beholdere på hjul i Gladsaxe kommune, må have litermål på 140 liter og 190<br />liter.</span></p>\r\n<p><span style="font-size: 10pt;">Du kan læse alt om haveaffaldsordningen i Gladsaxe kommune på følgende<br />link:</span></p>\r\n<p><strong><span style="color: #80ab00; font-size: 10pt;"><a href="http://www.gladsaxe.dk/Default.aspx?ID=8839"><span style="color: #80ab00;">Gladsaxe</span></a></span></strong></p>\r\n<p>&nbsp;</p>', 1, 0, 0, 4, '2011-08-18 00:00:00', 62, '', '2012-01-22 09:06:06', 62, 0, '0000-00-00 00:00:00', '2011-08-18 00:00:00', '0000-00-00 00:00:00', '', '', '', 25, 0, 1, '', '', 1, 5374, '', 0, '*', ''),
(13, 0, '__404__', '__404__', '__404__', '<h1>Bad karma : we can''t find that page !</h1>\r\n<p>You asked for <strong>{%sh404SEF_404_URL%}</strong>, but despite our computers looking very hard, we could not find it. What happened ?</p>\r\n<ul>\r\n<li>the link you clicked to arrive here has a typo in it</li>\r\n<li>or somehow we removed that page, or gave it another name</li>\r\n<li>or, quite unlikely for sure, maybe you typed it yourself and there was a little mistake ?</li>\r\n</ul>\r\n<h4>{sh404sefSimilarUrlsCommentStart}It''s not the end of everything though : you may be interested in the following pages on our site:{sh404sefSimilarUrlsCommentEnd}</h4>\r\n<p>{sh404sefSimilarUrls}</p>', '', 1, 0, 0, 0, '2004-11-11 12:44:38', 62, '', '2014-05-13 08:48:12', 62, 0, '0000-00-00 00:00:00', '2004-10-17 00:00:00', '0000-00-00 00:00:00', '', '', '', 1, 0, 0, '', '', 1, 145872, '', 0, '*', '');
