INSERT INTO `i63il_virtuemart_categories_da_dk` (`virtuemart_category_id`, `category_name`, `category_description`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1, 'Teakmøbler', '', '', '', '', 'teakmobler'),
(2, 'Havestole og bænke', '<span style="color: #99cc00; font-family: arial black,avant garde; font-size: 12pt;"><span style="color: #99cc00; font-family: arial black,avant garde; font-size: 12pt;"></span></span>\r\n<p><span style="color: #99cc00; font-family: arial black,avant garde; font-size: 12pt;">Havestole og Bænke <span style="font-family: arial,helvetica,sans-serif;"><strong><span style="font-size: 10pt;">til de hyggelige stunder....!</span></strong></span><br /><br /></span></p>', '', '', '', 'havestole-og-baenke'),
(3, 'Havemøbler', '<p><strong><span style="color: #99cc00; font-size: 12pt; font-family: arial black,avant garde;">Havemøbelsæt</span></strong><em><span style="font-family: ''Lucida Calligraphy'';"></span></em><strong><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #99cc00;"> sommeren er den tid på året de fleste af os ser frem til med varme og glæde..!</span></strong><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #808080;"> Lad dig inspirere af vores udvalg af havemøbler, parasoller, krukker etc. Vi håber der er muligheder og løsninger, der opfylder dine behov for indretning af haven, terrassen, balkonen eller andre steder, du måtte ønske at skabe stemning.</span><span style="font-family: ''Lucida Calligraphy'';"></span></p>', '', '', '', 'havemobler'),
(4, 'Hvide/sortmalet møbler', '', '', '', '', 'hvide-sortmalet-mobler'),
(5, 'Design fra Nardi', '<p><span style="font-size: 12pt;"><strong><span style="color: #99cc00;">Designer møbler</span></strong></span> <span style="color: #808080;"><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;">Italienske Nardi producerer og leverer designmøbler af </span><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;">meget høj kvalitet. Nardi sortimentet er fanebærer for </span><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;">en helt ny generation af plastmøbler, der absolut ikke skal forveksles med klassiske plastmøbler fra før årtusindskiftet. Plastmaterialet hedder resin og besidder en lang række unikke kvaliteter der egner sig fantasisk til det nordiske vejr. Møblerne er således 100% vedligeholdelsesfrie, er meget uv-bestandige, lette men samtidig meget holdbare. Designet taler for sig selv.</span></span></p>', '', '', '', 'design-fra-nardi'),
(7, 'WEBER® Grill', '<p>Weber</p>', '', '', '', 'weber-grill'),
(8, 'Solvogne/dækstole', '<p><span style="color: #99cc00; font-family: arial black,avant garde; font-size: 12pt;"><strong>Solvogne</strong></span></p>', '', '', '', 'solvogne-daekstole'),
(9, 'Parasol/Pavillion etc.', '<p><span style="font-family: arial black,avant garde; font-size: 12pt; color: #99cc00;">Parasoller & Pavillioner</span><strong><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><span style="color: #99cc00;"> smukke Parasoller og Pavillioner til at skygge, når solen står højt på himlen....!</span></span><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;"> </span></strong></p>', '', '', '', 'parasol-pavillion-etc'),
(10, 'Hynder/Hyndebokse', '<p><span style="font-family: arial black,avant garde; color: #99cc00; font-size: 12pt;">Hynder & Hyndebokse <span style="font-size: 10pt; color: #808080; font-family: arial,helvetica,sans-serif;">hænger uløseligt sammen. Sørg altid for, at få dine polyester hynder i hyndeboksen inden regnen kommer. Nogle af vores Hyndebokse kan også bruges til en ekstra siddeplads...! Eller på altanen til øl/vand, kartofler etc. </span></span></p>', '', '', '', 'hynder-hyndebokse'),
(11, 'Den lille Have/Altan', '<p>Cafésæt</p>', '', '', '', 'den-lille-have-altan'),
(13, 'Havebeholdere', '<p><b><span style="line-height: 115%; color: #92d050; font-size: 16pt;"><span style="font-size: 12pt; font-family: arial black,avant garde;">Haveaffaldsbeholdere godkendt i Gentofte, Gladsaxe kommuner m.fl.</span> <span style="font-size: 10pt;"><br />(undersøg, hvilke størrelser din kommune afhenter)</span></span></b><span style="font-size: 8pt;"> En nem, hurtig og miljøvenlig måde at komme af med sit haveaffald på...! </span></p>\r\n<p><span style="font-size: 8pt;">Haveaffald er følgende: Blade, blomster, grene, græs, kvas, kviste og ukrudt uden jord.</span></p>', '', '', '', 'havebeholdere'),
(14, 'Gavekort', '<p><span style="font-family: arial black,avant garde; font-size: 12pt; color: #99cc00;">Gavekort</span></p>', '', '', '', 'gavekort'),
(19, 'MUUBS Havemøbler mv.', '<p><span style="color: #000000;"><span style="font-family: arial black,avant garde; color: #99cc00; font-size: 12pt;">MUUBS</span><span style="color: #000000;"><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;"> er en innovativ møbel- og interiør virksomhed. De har specialiseret sig i at designe møbler og interiør udelukkende i rå materialer. Muubs produkterne har alle et råt og unikt urbant look, der passer ind i de fleste boligindretninger som kontrast til det minimalistiske eller i sync med det mere organiske. Muubs har eget design studio i Danmark og produktionssteder i såvel Danmark som på Bali med de fordele, dette giver i forhold til at skabe og levere et konstant flow af nye og tidssvarende møbler og interiør in the rough.</span> <br /></span><span style="font-size: 10pt; color: #333300;"><span style="color: #000000;"></span></span><br /></span></p>', '', '', '', 'muubs-havemobler-mv'),
(18, 'Accessories til Haven', '<p style="font-family: arial black,avant garde; font-size: 12pt; color: #99cc00;"><span style="font-family: arial black,avant garde; font-size: 12pt; color: #99cc00;">Lanterner, Bålfade, Ude- og inde lys etc ... </span><span style="font-family: arial black,avant garde; color: #99cc00; font-size: 10pt;"><span style="color: #000000; font-family: arial,helvetica,sans-serif;"></span></span></p>\r\n<p style="font-family: arial black,avant garde; font-size: 12pt; color: #99cc00;"><span style="font-family: arial black,avant garde; color: #99cc00; font-size: 10pt;"><span style="color: #000000; font-family: arial,helvetica,sans-serif;"><br /></span></span></p>', '', '', '', 'accessories-til-haven'),
(17, 'Terrassevarmere/gas', '<p>Terrassevarmere/gas</p>', '', '', '', 'terrassevarmere-gas'),
(20, 'Fyrværkeri', '<p>Fyrværkeri</p>', '', '', '', 'fyrvaerkeri'),
(21, '1000 Krukker', '<p><span style="font-family: arial black,avant garde; font-size: 12pt; color: #99cc00;">Generelt for alle Krukker, der gerne vil have et langt liv....!</span><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #808080;"> Husk altid 1/3 Leca i bunden af krukken og endnu vigtigere, altid op på krukkefødder når vi når oktober måned, hvor frosten snart vil sætte ind. Dette giver et rigtig godt dræn i krukken, således at den ikke frostspringes.</span><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #808080;"></span></p>\r\n<p> </p>', '', '', '', '1000-krukker'),
(34, 'Krukker Romantic', '<p><span style="font-family: arial black,avant garde; color: #99cc00; font-size: 14pt;">Krukker Romantic</span> <span style="color: #808080; font-family: verdana,geneva;">Choco Terracotta krukker er æltet sammen af forskellige slags ler, hvilket giver den smukke beige/jord farve. Leret graves ud af det frodige Mekong delta, hvor der til stadighed aflejres masser af ler fra deltaet.</span><strong><span style="color: #99cc00;"> </span></strong></p>', '', '', '', 'krukker-romantic'),
(25, 'Loungemøbler', '<p><strong><span style="color: #99cc00; font-size: 12pt; font-family: arial black,avant garde;">Loungemøbler</span></strong><em><span style="font-family: ''Lucida Calligraphy'';"></span></em><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;"> er du på udkig efter noget særligt med ekstra fokus på afslapning og ægte lounge-stemning, så overvej en stilfuld sofagruppe. Smagfuldt design, flotte hynder, henslængt stemning og nem vedligeholdelse.<br /><br /></span></p>\r\n<p><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;">Polyrattan er havemøbler, som er flettet i kunststoffiber af høj kvalitet. Til trods for, at det er kunststof, så har Polyrattan gløden og varmen fra naturlige materialer, som bambus og søgræs. Så du får et smukt naturligt look i din have, udestue eller på altanen.</span></p>\r\n<p> </p>', '', '', '', 'loungemobler'),
(40, 'Bænke', '', '', '', '', 'baenke'),
(26, 'Related product', '', '', '', '', 'related-product'),
(27, 'Covers', '<p><span style="font-size: 12pt; font-family: arial black,avant garde; color: #99cc00;"><strong>Covers</strong></span><span style="font-size: 10pt; color: #99cc00;"> - selvom det er udendørsmøbler af høj kvalitet ....!</span><br />og der står de kan stå ude hele året, anbefaler vi et havemøbelcover, når du ikke anvender møblerne i vintersæsonen. Det forlænger møblernes liv samt mindsker vedligeholdelse/forårsrengøring af møblerne. <br /><br /></p>', '', '', '', 'covers'),
(28, 'Skind', '<p><span class="hps"><span style="font-size: 12pt; font-family: ''Arial Black''; color: #99cc00;">Økologisk Lamme- og Renskind fra Natures Collections</span><span style="font-family: ''Arial Black''; color: #99cc00;"></span><span style="font-family: arial black,avant garde; color: #99cc00; font-size: 12pt;"><span style="color: #333333;"><span class="hps"><strong><span style="color: #99cc00;"> og Organic Sheep</span></strong></span></span></span><span style="font-size: 12pt; font-family: ''Arial Black''; color: #99cc00;"><span style="font-family: arial,helvetica,sans-serif; color: #333333; font-size: 8pt;"><span class="hps"><strong><span style="color: #99cc00;"> produkterne er primært fremstillet af lammeskind fra New Zealand, Australien, Finland og Island.</span></strong> <span style="color: #808080; font-size: 10pt;">Råvarerne udvælges nøjsomt for at opnå den bedste kvalitet. Leverandørerne har gennem mange års erfaring i branchen, erhvervet en unik viden om valg og behandling af lammeskind. Derfor er Natures Collection og Organic Sheep i dag førende distributører af lammeskind i Skandinavien og synonym med kvalitet, eksklusivitet og design. </span></span></span></span></span><span style="color: #808080; font-size: 10pt;"><span style="font-family: arial,helvetica,sans-serif;">Der bruges ingen kunstig farve eller detrimental krom i garvningen. Uden disse kemikalier er lammeskindene både hud- og allergi venlige. Alle processer i garveprocessen opfylder EU-standarder for bevarelse og beskyttelse af vores natur. <span class="hps"><span style="font-size: 12pt; font-family: ''Arial Black''; color: #99cc00;"><span style="font-family: arial,helvetica,sans-serif; color: #333333; font-size: 8pt;"><span class="hps"><span style="color: #808080; font-size: 10pt;"><strong>Vi bringer naturen ind i boligen...!</strong><span style="color: #808080; font-size: 10pt;"> </span></span></span></span></span></span><br /></span></span></p>\r\n<p class="mcevisualaid"> </p>\r\n<p class="mcevisualaid"> </p>', '', '', '', 'skind'),
(29, 'Cane-line', '<p><span style="font-family: ''arial black''; color: #99cc00;"><span style="font-size: 12pt;">Cane-line - Æstetik og funktionalitet</span><span style="font-family: arial,helvetica,sans-serif;"><strong><span style="font-size: 10pt;"> Cane-line er et dansk designfirma med 25 års erfaring og er på nuværende tidspunkt repræsenteret i 90 lande.</span></strong></span></span><span style="font-size: 10pt; color: #808080;"><span style="font-family: arial,helvetica,sans-serif;"> Life Made Comfortable er essensen af Cane-line. …! Fokus er på komfort og kvalitet, og produktionen foregår med stor respekt for miljø og mennesker.</span><span style="font-family: arial,helvetica,sans-serif;"> ”Hvert design er skabt med de skandinaviske sommerdage- og nætter på nethinden. </span></span><span style="font-size: 10pt; color: #808080;"><span style="font-family: arial,helvetica,sans-serif;">Cane-line ønsker at indbyde til et rigt udeliv, hvor havemøblerne understøtter stemningen” Cane-lines danske designere har en mission om at få æstetik og funktion til at spille sammen og supplere hinanden. </span></span><span style="font-size: 10pt; font-family: Times;"><br /></span><span style="font-family: ''arial black''; color: #99cc00;"><span style="font-size: 10pt; font-family: Times;"></span></span></p>', '', '', '', 'cane-line'),
(30, 'Mosaik & Smedejern', '<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;"><span style="font-size: 10pt; font-family: Calibri; color: black;"><span style="color: #99cc00; font-family: arial black,avant garde;"><strong><span style="font-size: 12pt;">Marmor, Mosaik & Smedejern</span></strong></span> <span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;">vores leverandør Villa Home & Garden - der har mange års erfaring inden for marmor, mosaik og smedejern - bestræber sig på at fremstille æstetisk smukke møbler. Æstetik kræver engagement. Et engagement som ikke tillader noget hastværk. Det er et begreb, som kun er retfærdiggjort når produktet er fremstillet med respekt for håndværket og for den tradition som ligger bag og med den bevidsthed, at godt håndværk tager tid. Derfor gøres der brug af de gamle overleverede håndværksteknikker - skønhed opstår når de fremstiller et værdifuldt produkt i overensstemmelse med naturen og det originale håndværk. Man bestræber sig på, at være fair overfor miljøet, derfor vil du modtage et produkt, som vil holde i generationer og ikke mindst fremstillet med respekt for traditionerne - men samtidig med tanke for fremtiden...!</span></span></p>', '', '', '', 'mosaik-smedejern'),
(39, 'Havemøbelsæt', '<p><span style="font-size: 12pt;"><strong><span style="color: #99cc00;">Havemøbler af høj kvalitet, </span></strong><span style="color: #99cc00; font-size: 10pt;"><span style="font-family: arial,helvetica,sans-serif; color: #808080;">hvor der ikke er gået på kompromis med kvalitet og bæredygtighed.</span></span><strong><span style="color: #99cc00;"> <br /></span></strong></span></p>', '', '', '', 'havemobelsaet'),
(41, 'Bænke', '', '', '', '', 'baenke_53ce25bdb3956'),
(42, 'Stole & Chaiselong\\''s', '', '', '', '', 'stole-chaiselong-s'),
(43, 'Borde', '', '', '', '', 'borde'),
(44, 'Loungemøbler', '<p><strong><span style="color: #99cc00; font-size: 12pt; font-family: arial black,avant garde;">Loungemøbler</span></strong><em><span style="font-family: ''Lucida Calligraphy'';"></span></em><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;"> er du på udkig efter noget særligt med ekstra fokus på afslapning og ægte lounge-stemning, så overvej en stilfuld sofagruppe. Smagfuldt design, flotte hynder, henslængt stemning og nem vedligeholdelse.</span></p>\r\n<p><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;">Polyrattan er havemøbler, som er flettet i kunststoffiber af høj kvalitet. Til trods for, at det er kunststof, så har Polyrattan gløden og varmen fra naturlige materialer, som bambus og søgræs. Så du får et smukt naturligt look i din have, udestue eller på altanen.</span></p>', '', '', '', 'loungemobler_53ce25bf8ad66'),
(45, 'Solvogne & dækstole', '<p><span style="color: #99cc00; font-family: arial black,avant garde; font-size: 14pt;">Solvogne & dækstole <span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;">når tiden er til det...!</span></span></p>', '', '', '', 'solvogne-daekstole_53ce25bf9de1b'),
(32, 'Italienske', '<p><span style="font-family: arial black,avant garde; font-size: 12pt; color: #99cc00;">Italienske Urtepotter<span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #808080;"> vores italienske urtepotter fremstilles på et velrenomeret potteværksted i Toscana i Norditalien - et område, hvor der gennem århundreder har været tradition for fremstilling af smukt designede urtepotter af høj kvalitet. På Pottemageriet er det ægteparret Milo og Therese, der står for den daglige produktion. Det er en virksomhed, som er gået i arv, og som tredje generation ved de, hvad de har med at gøre. De tog derfor vores leverandørs opfordring op med glæde, da de bad dem fremstille en serie nye potter efter gamle, genfundne modeller. </span></span></p>', '', '', '', 'italienske'),
(38, 'Afrikanske Potter', '<p><span style="font-size: 12pt;"><span style="color: #99cc00; font-family: arial black,avant garde;"><strong>Afrikanske Potter</strong><span style="color: #99cc00; font-family: arial black,avant garde;"><strong><span style="font-family: verdana,geneva; color: #000000;"> </span></strong><span style="font-family: verdana,geneva; color: #000000; font-size: 8pt;"><span style="color: #808080;"><span style="color: #808080;">De <span style="color: #808080;">”Hvide<span style="color: #808080;">”<span style="color: #808080;"> krukker er fra Tunesien, hvor de har fremstillet krukker siden Romernes tid. Derfor er alle modellerne næsten også ægte ”romerske efterkommere”. Leret der bruges til disse krukker tages fra saltsøerne (De udtørrede søer) i Tunesien. Saltet bevirker, at der opstår den proces ved brændingen, at overfladen bliver hvid og en smule støvet. Krukkerne får et flot og rustikt udtryk.<br /><br /></span></span></span></span></span></span></span></span></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">De <span style="color: #808080;">”Røde<span style="color: #808080;">” krukker er fra Marokko, hvor de har lavet brugskrukker siden Franskmændene kom til landet for 150 år siden. Derfor er de marokkanske lavet i en mere fransk stil – almen mediterran stil, og minder derfor også om de græske krukker. Vores krukker bliver lavet hos en pottemager lige uden for Marrakech, som vores leverandør har kendt i rigtigt mange år.</span></span></span><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"><span style="color: #000000;"><span style="color: #808080;"> Alle krukker er selvfølgelig hånddrejede og af lokalt ler. Endvidere er de frostsikre ved rette behandling.</span></span></span></p>', '', '', '', 'afrikanske-potter'),
(33, 'Krukker Antique', '<p><span style="color: #99cc00; font-size: 12pt; font-family: arial black,avant garde;">Antique Terracotta Krukker fra Vietnam<span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><span style="color: #808080;"> vores leverandør får nu produceret terracotta krukkerne med en smuk antik overflade, således at krukkerne er født med den fantastiske patina, som det ofte tager lang tid for at opnå. Disse krukker er alle frostsikre ved den rette behandling.</span></span></span></p>', '', '', '', 'krukker-antique'),
(35, 'Krukker Classic', '<p><span style="color: #99cc00; font-family: arial black,avant garde; font-size: 14pt;">Krukker Classic</span> <span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;">er produceret i special ler som er blevet indfarvet så vi får den smukke farve der passer til de scandinaviske haver. </span><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;">Navnet Choco refererer til den smukke chokolade brune farve som disse krukker har. </span><br /> <br /><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #808080;">Da dette produkt ikke er glaceret, er det altid meget vigtigt at hæve krukken fra jorden med pottefødder, således at der ikke sker vinterskader.</span></p>', '', '', '', 'krukker-classic'),
(36, 'Pynt til Haven', '', '', '', '', 'pynt-til-haven'),
(37, 'Beton & Terrazzo', '<p><span style="color: #99cc00; font-family: arial black,avant garde; font-size: 14pt;"><b>Let Beton, Terrazzo & Black Soil</b></span> <span style="color: #808080;">til 2014 har vi fået en serie rigtig gode plantekrukker i letbeton..! Krukkerne er støbt med cement, sand, sten og vand. Derudover er der, for at gøre materialet lettere, tilsat additiver samt syntetiske fibre som gør betonkrukken lettere, men stadig med en stor hårdhed. Alle beton krukker er voksbehandlet, således at de fremstår med en flot overflade.</span><br /><br /></p>\r\n<p><span style="color: #808080;">Vores smukke Terrazzo krukker alle i en let kvalietet, med fiberdug passer fantastisk til moderne huse, hvor et smukt og enkelt design spiller godt sammen med husets ydre.</span></p>', '', '', '', 'beton-terrazzo'),
(46, 'Hyndebokse', '<p><span style="font-family: arial black,avant garde; color: #99cc00; font-size: 12pt;">Hynder & Hyndebokse <span style="font-size: 10pt; color: #808080; font-family: arial,helvetica,sans-serif;">hænger uløseligt sammen. Sørg altid for, at få dine polyester hynder i hyndeboksen inden regnen kommer. Nogle af vores Hyndebokse kan også bruges til en ekstra siddeplads...! Eller på altanen til øl/vand, kartofler etc. </span></span></p>', '', '', '', 'hyndebokse'),
(47, 'Hynder', '<p><span style="font-family: arial black,avant garde; color: #99cc00; font-size: 12pt;">Hynder & Hyndebokse <span style="font-size: 10pt; color: #808080; font-family: arial,helvetica,sans-serif;">hænger uløseligt sammen. Sørg altid for, at få dine polyester hynder i hyndeboksen inden regnen kommer. Nogle af vores Hyndebokse kan også bruges til en ekstra siddeplads...! Eller på altanen til øl/vand, kartofler etc. </span></span></p>', '', '', '', 'hynder'),
