(57, 'Borde', '<div class="body">\r\n<p><span style="font-family: arial black,avant garde; font-size: 14pt; color: #99cc00;">Borde fra Cane-line</span> <span style="color: #808080;">Hvordan skal dit nye havebord se ud? Skal havebordets design være stilrent, klassisk eller enkelt?  Er du til rustfrit stål, aluminium eller flet. Fiberbeton, skifer, keramik eller glas? Cane-line har det havebord, der passer til netop dit behov.</span></p>\r\n<p><span style="color: #808080;">Vi har et stort udvalg af forskellige spiseborde, sofaborde, caféborde og sideborde til din have eller terrasse.</span></p>\r\n</div>', '', '', '', 'borde_53ce25c0e2bf4'),
