(63, 'Hynder', '<p><span style="font-family: arial black,avant garde; font-size: 14pt; color: #99cc00;">Cane-lines havehynder</span> Her kan du finde havehynder til vores forskellige havemøbler og købe dem enkeltvis. Havehynder fra Cane-line findes i 3 forskellige stofkvaliteter.<br /><br /></p>\r\n<p><strong>Sort Dralon stof</strong>: Havehynder i Dralon er fremstillet af 100% gennemfarvet Akrylfiber og er modstandsdygtig overfor UV stråling. Betrækket kan håndvaskes (må ikke fjernes fra hynden) skal tørres lodret.<br /><br /></p>\r\n<p><strong>Chocolade, hvid og taupe: </strong>Havehynder i Paratempotest er fremstillet i 100 % gennemfarvet Akrylfiber er teflonbehandlet og er modstandsdygtig overfor UV stråling. Betrækket er aftagelig og kan vaskes ved 30 grader.<br /><br /></p>\r\n<p><strong>Hvid Cane-line TEX: </strong>Havehynderne er fremstillet af et coated polyester materiale, der er meget velegnet til udendørs brug. Havehynden har en <br />kerne af Quick dry foam, som sikre maksimal dræning og luft cirkulation. Hynden tørre herved hurtigere når den udsættes for regn og fugt.</p>', '', '', '', 'hynder_53ce25c25c007'),
(64, 'Parasol cover', '', '', '', '', 'parasol-cover'),
(65, 'Parasoller & Cover', '', '', '', '', 'parasoller-cover_53ce25c297d1d');
