(1, '', '<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim. Donec pede justo, fringilla vel, aliquet nec, vulputate eget, arcu. In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo. Nullam dictum felis eu pede mollis pretium. Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim.</p>', 'Trevor Sorbie', '', '', '', 'trevor-sorbie'),
(346, 'Beatrice', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Beatrice Antique Terracotta', '', '', '', 'beatrice-antique-terracotta'),
(347, 'Tomasso', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Krukken måler H91-Ø57 cm.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Tomasso Antique Terracotta', '', '', '', 'tomasso-antique-terracotta'),
(340, 'Mia', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Mia Choco Terracotta Romantic', '', '', '', 'mia-choco-terracotta-romantic'),
(341, 'Stella', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Stella Choco Terracotta Romantic', '', '', '', 'stella-choco-terracotta-romantic'),
(342, 'Lara', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Lara Choco Terracotta Romantic', '', '', '', 'lara-choco-terracotta-romantic'),
(343, 'Andrea', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Andrea Choco Terracotta Romantic', '', '', '', 'andrea-choco-terracotta-romantic'),
(344, 'Lola', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> <br /><br /></span></strong></p>', 'Lola Antique Terracotta', '', '', '', 'lola-antique-terracotta'),
(399, 'Benton', 'Flot sunlounger i texteline black powder aluminiums-<br />stel med bambusarmlæn.', 'Benton Sunlounger', '', '', '', 'benton-sunlounger'),
(345, 'Lucie', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> <br /><br /></span></strong></p>', 'Lucie Antique Terracotta', '', '', '', 'lucie-antique-terracotta'),
(734, 'Winze Loungesofa', '<p><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps">Winze loungesofa<span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"> <span class="hps">flettet <span class="hps">i 3 <span class="hps">mm runde <span class="hps">syntetisk <span class="hps">polyrattan <br /><span class="hps">på <span class="hps">en aluminiumsramme inkl. hynder. Super siddekomfort!<br /><br /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n<p>Højde: 71 cm<br /> Bredde: 220 cm<br /> Dybde: 90 cm</p>', 'Winze Loungesofa', '', '', '', 'winze-loungesofa'),
(11, '190 liter', '<p>Køb to stk. og spar 200 kr.!!!</p>', '190 liter Haveaffaldsbeholder - Ved køb af 2 stk. SPAR 200 kr.', '', '', '', '190-liter-haveaffaldsbeholder-ved-kob-af-2-stk-spar-200-kr'),
(16, '2 stk. 190 liters haveaffaldsbeholdere', '<p>2 stk. 190 liters godkendt haveaffaldsbeholdere.</p>', '2 stk. 190 liter haveaffaldsbeholdere', '', '', '', '2-stk-190-liter-haveaffaldsbeholdere'),
(12, '140 liter', '<p>Køb to stk. og spar 200 kr. !!!</p>', '140 liter Haveaffaldsbeholder - Ved køb af 2 stk. SPAR 200 kr.', '', '', '', '140-liter-haveaffaldsbeholder-ved-kob-af-2-stk-spar-200-kr'),
(14, '', '<p>2 stk. 140 liters godkendt haveaffaldsbeholder.</p>', '2 stk. 140 liter haveaffaldsbeholdere', '', '', '', '2-stk-140-liter-haveaffaldsbeholdere'),
(15, '240 liter Haveaffaldsbeholder - Ved køb af 2 stk. SPAR 200 kr.', '<p>Køb to stk. og spar 200 kr.!!!</p>', '240 liter Haveaffaldsbeholder - Ved køb af 2 stk. SPAR 200 kr.', '', '', '', '240-liter-haveaffaldsbeholder-ved-kob-af-2-stk-spar-200-kr'),
(17, '240 liter', '<p>2 stk. 240 liters godkendt haveaffaldsbeholdere.</p>', '2 stk. 240 liter haveaffaldsbeholdere', '', '', '', '2-stk-240-liter-haveaffaldsbeholdere'),
(18, 'Arezzo Luksus Havesæt', '<p style="text-align: left; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in; vertical-align: baseline;"><span style="font-family: Calibri; color: #333333; font-size: 10pt;"><span style="font-family: Calibri; font-size: 10pt;"><span style="font-family: Calibri; font-size: 10pt;">Bord og 4 stole i Sandfarvet polyrattan. Bordet måler <span style="font-family: Calibri; font-size: 10pt;"><br />100X180 cm</span> og hertil er 4 luksus polyrattan stole inkl. <br />hynder.<br /><br /></span></span></span></p>\r\n<p style="text-align: left; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in; vertical-align: baseline;"><span style="color: #333333;"> Kan stå ude hele året!</span></p>', 'Arezzo Luksus Havesæt', '', '', '', 'arezzo-luksus-havesaet'),
(338, 'Vittoria', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.</p>', 'Vittoria Choco Terracotta Romantic', '', '', '', 'vittoria-choco-terracotta-romantic'),
(50, 'Varese Polyrattan stol', '<p>En dejlig højrygget Polyrattan stol med en fantastisk <br />siddekomfort. Eksl. hynde</p>\r\n<p> </p>\r\n<p> </p>', 'Varese Polyrattan stol', '', '', '', 'varese-polyrattan-stol'),
(51, 'Nardi Ninfea Relax sæt', '<p>Elegante designermøbler i lette og vedligeholdelsesfrie <br />materialer. Stellet er af aluminium, stolen af plast og <br />den flotte bordplade er udført i kraftigt tempereret glas<br /> med sorte striber. Flot, anderledes og sindsygt lækkert! <br />Bordets mål: 110x110 cm. Inkl. 4 stole.</p>', 'Nardi Ninfea Relax sæt', '', '', '', 'nardi-ninfea-relax-saet'),
(52, 'Nardi Ninfea Relax sæt', '<p>Elegante designermøbler i lette og vedligeholdelsesfrie <br />materialer. Stellet er af aluminium, stolen af plast og <br />den flotte bordplade er udført i kraftigt tempereret glas<br /> med hvide striber. Flot, anderledes og sindsygt lækkert! <br />Bordets mål: 110x110 cm. Inkl. 4 stole.</p>', 'Nardi Ninfea Relax sæt', '', '', '', 'nardi-ninfea-relax-saet_53ce25cf1427d'),
(53, '', '<p style="text-align: left; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in; vertical-align: baseline;"><span style="font-family: Calibri; color: black; font-size: 12pt;">Luksus solvogn – antracit plast med åndbart <br />syntetisk stof. </span><span style="font-family: Calibri; color: black; font-size: 12pt;">Disse solvogne kræver ingen <br />vedligeholdelse, men de kan naturligvis rengøres <br />med vand, sæbe og en blød børste.</span></p>', 'Alfa solvogn', '', '', '', 'alfa-solvogn'),
(730, 'Linen lammeskind - korthåret', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores New Zealandske lammeskind.<br /><br /></p>\r\n<p>Husk at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 100x60 cm<br /><span style="color: #333333;">Hårlængde: 5 cm<br /><span style="color: #333333;">Farve: Taupe<br /></span></span></span>', 'Taupe Lammeskind - korthåret', '', '', '', 'taupe-lammeskind-kortharet'),
(20, '', '<p>Hynde i 100 % sort polyester med skumfyld. <br />Kan håndvaskes ved 30 gr.</p>', 'Sædehynde til Latin stolen', '', '', '', 'saedehynde-til-latin-stolen'),
(21, 'Milan stol med teak armlæn', '<p>100% vedligeholdelsesfri. Fantastisk siddekomfort.<br />Kan stå ude hele året. Stolen er lavet af kraftig <br />aluminium stel med 4-line polyrattan flet.</p>\r\n<p> </p>', 'Milan stol med teak armlæn', '', '', '', 'milan-stol-med-teak-armlaen'),
(737, 'Zoe Midtermodul', 'Midtermodulet måler: <br /><br />H66 cm-D88 cm-B76 cm.', 'Zoe Midtermodul', '', '', '', 'zoe-midtermodul'),
(809, 'Christophe Dining Sæt', '<p><span class="hps">Denne serie<span class="hps"> <span class="hps">er flettet <span class="hps">af <span class="hps">5 mm <span class="hps">syntetisk <span class="hps">polyrattan <span class="hps">i en varm <span class="hps"><br />brun <span class="hps">mixet <span class="hps">farve, der <span class="hps">giver udseende af <span class="hps">ægte bambus<span class="hps">. <span class="hps">Serien <br />omfatter <span class="hps">spisestol, bord<span class="hps"><span class="hps"> samt <span class="hps">en <span class="hps">komfortabel <span class="hps">øreklapstol <span class="hps">med <br />skammel <span class="hps">og <span class="hps">et <span class="hps">lille <span class="hps">sidebord. <br /><br /><span class="hps">Bordet <span class="hps">leveres <span class="hps">med glasplade <span class="hps">og <span class="hps">stolen <span class="hps">med en tyk <span class="hps">beige <span class="hps">hynde<br />med <span class="hps">stofkvalitet <span class="hps">og <span class="hps">lysægthed helt i top!. <span class="hps">S<span class="hps">tolen  <span class="hps">passer også <br /><span class="hps">fint til <span class="hps">vores <span class="hps">spisebord i <span class="hps">Teak Cécille. <span class="hps"><br /><br />Flere matchende <span class="hps">møbler til disse finder du<span class="hps"> tilgængelige i <span class="hps">Santino <span class="hps"><br />serien, hvilken er af ​​samme <span class="hps">flet.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>', 'Christophe Dining Sæt', '', '', '', 'christophe-dining-saet'),
(25, 'Cremona polyrattan stol i sandgrå', '<p>Luksus stol i sandgrå. Fantastisk siddekomfort - <br />trendy og flot designet! Passer til alle teakborde. <br />Stolen er lavet i kraftig aluminium stel med 1-linet<br /> polyrattan flet.</p>', 'Cremona polyrattan stol i sandgrå', '', '', '', 'cremona-polyrattan-stol-i-sandgra'),
(26, 'Cremone polyrattan stol sort', '<p>Luksus stol. Fantastisk siddekomfort - trendy og flot de-<br />signet! Passer til alle teakborde. Stolen er lavet i kraftig<br /> aluminium stel med 1-linet polyrattan flet.</p>', 'Cremone polyrattan stol sort', '', '', '', 'cremone-polyrattan-stol-sort'),
(27, 'Torino stol sandgrå', '<p>Super siddekomfort - 100% vedligeholdelsesfri! Stolen er lavet <br />i kraftig aluminiumstel med 1-linet polyrattan flet.</p>', 'Torino Luksus Stol', '', '', '', 'torino-luksus-stol'),
(28, 'Asti stol', '<p>Polyrattan stol. Super siddekomfort - 100% vedligeholdel-<br />sesfri! Stolen er lavet med aluminium stel og 4-linet <br />polyrattan flet.</p>', 'Asti stol i sort', '', '', '', 'asti-stol-i-sort'),
(29, 'Luksus hynde til Torino stol', 'Luksus sædehynde i sort polyester med ekstra<br /> kraftig skumkerne. Kan håndvaskes ved 30 gr.', 'Luksus hynde - Torino stol', '', '', '', 'luksus-hynde-torino-stol'),
(30, 'Sædehynde til Asti stol i grå', '<p><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;">Sædehynde til Asti og Torino stol i strukturpolyester </span><br /><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;">i grå. kan håndvaskes ved 30 gr.</span></p>', 'Sædehynde til Asti stol i grå', '', '', '', 'saedehynde-til-asti-stol-i-gra'),
(31, 'Sædehynde til Asti og Torino stol - sort', '<p>Sædehynde til Asti og Torino stol i strukturpolyester<br /> i sort. kan håndvaskes ved 30 gr.</p>', 'Hynde til Asti og Torino stol - sort', '', '', '', 'hynde-til-asti-og-torino-stol-sort'),
(32, '', '<p>Superdesignet liggestol i 4-linet polyrattan flet.<br />100% vedligeholdelsesfri.</p>', 'Pistoia liggestol i sort', '', '', '', 'pistoia-liggestol-i-sort'),
(33, '', '<p>Fantastisk flot solvogn i lækkert design. <br />4-linet polyrattan flet med stel i aluminium.<br />Indstillelig ryg.</p>', 'Teramo solvogn', '', '', '', 'teramo-solvogn'),
(34, 'Alexandria 2 pers. Teakbænk', '<p><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;" size="2" face="Calibri">Lækker 2 personer teakbænk (120 cm) i den bedste<br /> kvalitet. En meget robust bygget bænk med god <br />siddekomfort. Rigtig flot design.</span></p>', 'Alexandria 2 pers. Teakbænk', '', '', '', 'alexandria-2-pers-teakbaenk'),
(35, 'Alexandria 3 pers. Teakbænk', '<p><span style="font-family: verdana,geneva; font-size: 8pt;">Lækker 3 personers teakbænk (150 cm) i den bedste<br />kvalitet. En meget robust bygget bænk med god siddekomfort.<br /> Rigtig flot design.</span></p>', 'Alexandria 3 pers. Teakbænk', '', '', '', 'alexandria-3-pers-teakbaenk'),
(36, 'Bologna Havemøbelsæt', '<p style="text-align: left; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in;"><span style="color: #000000; font-size: 8pt; font-family: verdana,geneva;">Bordet er lavet i sort Aintwood med sortlakeret alu.stel og måler <br />90X205 cm hertil er 6 polyrattanstole. Lækkert og vedligeholdel-<br />sesfrit havesæt, der kan stå ude hele året. </span></p>', 'Bologna Aintwood/Polyrattan', '', '', '', 'bologna-aintwood-polyrattan'),
(482, 'Venice Beach', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!<br /></span></strong>En absolut flot sunlounge kreeret i luksus polyrattan og med <br />en super liggekomfort. Sunloungen er inkl. en dejlig tyk <br />hynde i beige.</p>\r\n<p>Solvognen fås nu kun i farven Taupe!</p>\r\n<p>Kan stå ude hele året!</p>', 'Venice Beach - sunlounge', '', '', '', 'venice-beach-sunlounge'),
(37, 'Bologna Havemøbelsæt', '<p style="text-align: left; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in;"><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;"><span style="color: #000000;">Bordet er lavet i sort aintwood med sortlakeret alu.stel <br />og måler </span><span style="color: #4a452a;"><span style="color: #4a452a;"><span style="color: #4a452a;"><span style="color: #000000;">90X150 cm hertil er 4 polyrattanstole. Nedenfor <br />kan tilvælges </span><span style="color: #000000;">med eller uden hynde i gråpatineret. </span><span style="color: #000000;">Læk-<br />kert og vedligeholdelsesfrit </span><span style="color: #000000;">havesæt, </span><span style="color: #4a452a;"><span style="color: #4a452a;"><span style="color: #4a452a;"><span style="color: #000000;">der kan stå ude hele <br />året.</span><span style="color: #4a452a;"> <br /></span></span></span></span></span></span></span></span></p>\r\n<p style="text-align: left; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in;"><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><span style="color: #4a452a;"><span style="color: #4a452a;"><span style="color: #4a452a;"></span></span></span></span><span style="color: #4a452a; font-size: 8pt; font-family: verdana,geneva;"><span style="color: #4a452a;"><span style="color: #4a452a;"><span style="color: #4a452a;"><br style="color: #4a452a;" /></span></span></span></span></p>', 'Bologna Aintwood/Polyrattan', '', '', '', 'bologna-aintwood-polyrattan_53ce25cf83bbf'),
(38, '', '<p>Solvogn i polyrattan flet (aluminiumsstel)<br />med 2 hjul, armlæn og indstillelig ryg.<br />Superflot og nem at håndtere. kan stå ude <br />hele året.</p>\r\n<p> </p>\r\n<p> </p>', 'Avellino solvogn', '', '', '', 'avellino-solvogn'),
(735, 'Winze Loungebord', '<p><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps">Winze loungebord <span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps">flettet <span class="hps">i 3 <span class="hps">mm runde <span class="hps">syntetisk <span class="hps">polyrattan <br /><span class="hps">på <span class="hps">en aluminiumsramme inkl. bordplade i glas.<br /><br /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n<p>Højde: 45 cm.<br /> Bredde: 130 cm.<br /> Dybde: 68 cm.</p>', 'Winze Loungebord', '', '', '', 'winze-loungebord'),
(40, 'Sassari luksus lænestole sæt', '<p><span style="font-family: Calibri; color: #4a452a; font-size: 10pt; font-weight: bold;">inkl. skamler, bord med glasplade og hynder.<br /></span></p>\r\n<p style="text-align: left; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in;"><span style="font-family: Calibri; color: black; font-size: 10pt;">Fra de traditionelle teaktræsmøbler til det mere <br />eksklusive "<span style="font-family: Calibri; color: black; font-size: 10pt;">Inside<span style="font-family: Calibri; color: black; font-size: 10pt;"> <span style="font-family: Calibri; color: black; font-size: 10pt;">goes<span style="font-family: Calibri; color: black; font-size: 10pt;"> out" design. Et sortiment <br />der til fulde er på højde med internationale trends<br /> indenfor livsstil og indretning.</span></span></span></span></span></p>\r\n<p> </p>\r\n<p><span style="font-family: Calibri; color: #4a452a; font-size: 10pt; font-weight: bold;"></span> </p>', 'Sassari luksus lænestole sæt', '', '', '', 'sassari-luksus-laenestole-saet'),
(793, 'Mirabelle Brown-Wash Stol inkl. hynde', '<p>Super Romantisk serie i Brown-Wash polyrattan flet. <br />Stolen - der er en af flere modeller i denne serie - <br />måler: H86-B60-D69 cm.<br /><br /></p>\r\n<p>Stolen er inkl. beige hynde og har en siddekomfort <br />der er helt i top.<br /><br /></p>\r\n<p>Denne serie kan stå ude hele året ...!</p>', 'Mirabelle Brown-Wash Stol inkl. hynde', '', '', '', 'mirabelle-brown-wash-stol-inkl-hynde'),
(794, 'Mirabelle White-Wash 3-pers. Bænk', '<p>Super Romantisk serie i Brown-Wash polyrattan flet. <br />Bænken måler: H86-B60-D69 cm.</p>\r\n<p>Bænken er inkl. beige hynde og har en siddekomfort <br />der er helt i top.</p>\r\n<p>Denne serie kan stå ude hele året ...!</p>', 'Mirabelle White-Wash 3-pers. Bænk', '', '', '', 'mirabelle-white-wash-3-pers-baenk'),
(284, 'Bianca luksus Dining Chair', 'Fantastisk flot Polyrattan stol med en super <br />siddekomfort. Inkl. ryg- og siddehynde i <br />farven beige/natur.', 'Bianca Luksus Dining Chair', '', '', '', 'bianca-luksus-dining-chair'),
(269, 'Nardi Loto Dinner', '<p>Elegante designermøbler i lette og vedlige-<br />holdelsesfrie materialer. Stellet er af aluminium,<br />stolen af plast og den flotte bordplade er udført<br />i kraftigt tempereret glas med sorte striber. Flot, <br />anderledes og sindsygt lækkert! Bordets mål: Ø170, <br />Inkl. 8 stole.</p>', 'Nardi Loto Dinner', '', '', '', 'nardi-loto-dinner'),
(270, 'Nardi Loto Dinner Ovalt', '<p>Elegante designermøbler i lette og vedligeholdelsesfrie <br />materialer. Stellet er af aluminium, stolen af plast og <br />den flotte bordplade er udført i kraftigt tempereret glas <br />med hvide striber. Flot, anderledes og sindsygt lækkert! <br />Bordets mål: 100x190 cm, inkl. 6 stole.</p>', 'Nardi Loto Dinner Ovalt', '', '', '', 'nardi-loto-dinner-ovalt'),
(783, 'Sébastien Eksklusiv Pavillion', '<p>En exklusiv pavillion i “New England” stil, som får tankarna <br />til skønne solskinsdage dage. Denne skønne Pavillion måler:<br />3,6x3,6 m<br /><br /></p>\r\n<p>Stolperne<span class="hps"> og <span class="hps">tag<span class="hps">lægter er kreeret i <span class="hps">hårdttræ og <span class="hps">overliggerne <br /><span class="hps">af <span class="hps">pulverlakeret aluminium. <span class="hps">Taget er <span class="hps">af <span class="hps">PU-behandlet <span class="hps">270 <span class="hps">gr. <br /><span class="hps">polyester. Pavillionen er med <span class="hps"><span class="hps">ventilations<span class="hps">luge <span class="hps">og <span class="hps">læderfor-<br />stærkninger. Siderne er teflonbehandlet<span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps">.<br /><br /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>', 'Sébastien Eksklusiv Pavillion', '', '', '', 'sebastien-eksklusiv-pavillion'),
(787, 'Mirabelle Bord Ø60 eller Ø110 cm', '<p>Super romantisk serie i Brown-wash polyrattan flet med en<br />topplade af kraftigt glas. Bordet fås i flere størrelser: Ø60 <br />og Ø110 cm.</p>\r\n<p><br />Hele serien kan stå ude hele året ...!<br /><br /></p>\r\n<p> </p>\r\n<p> </p>', 'Mirabelle Bord Ø60 eller Ø110 cm', '', '', '', 'mirabelle-bord-o60-eller-o110-cm'),
(786, 'Mirabelle Chaiselong', '<p>Super romantisk serie i brown-washed polyrattan flet, der <br />kan stå ude hele året ...!<br /><br /></p>\r\n<p>Denne lækre chaiselong måler: H86 cm-B68 cm-L143 cm<br />og er inkl. hynder.</p>\r\n<p> </p>', 'Mirabelle Chaiselong', '', '', '', 'mirabelle-chaiselong'),
(814, 'Hampsted stol - fås i 4 størrelser', '<p><span style="font-size: 8pt; font-family: verdana,geneva;">Havestolen med armlæn er en ægte klassiker til haven. Have-<br />stolens harmoniske design er tidløst, komfortabelt og passer <br />ind overalt i haven, på terrassen eller på altanen – uanset om <br />indretningen er moderne og minimalistisk eller mere klassisk <br />og romantisk. Havestolen som fås i 4 farver, giver mange ind-<br />retningsmuligheder til din have. Fremstilling af Hampsted have-<br />stolen kræver mange timers omhyggeligt håndværk, og det ses <br />i stolens fine og præcise vævning.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: arial,helvetica,sans-serif;"><span style="font-family: verdana,geneva;">Hampsted havestolen kræver et minimum af vedligehold. Med <br />et cover til havemøbler undgår du den mest besværlige rengøring, <br />hvis dine havemøbler har stået ubrugt over længere tid.</span><br /><br /><span style="font-family: verdana,geneva;"><a href="images/stories/hampsted%20i%20sort%20ori.jpg"><strong><span style="color: #808000;">Sættet kan ses her - i sort!</span></strong></a></span><br /></span></p>', 'Hampsted stol - fås i 4 farver', '', '', '', 'hampsted-stol-fas-i-4-farver'),
(54, '', '<p style="text-align: left; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in; vertical-align: baseline;"><span style="font-family: Calibri; color: black; font-size: 12pt;">Luksus solvogn – antracit plast med åndbart <br />syntetisk stof. <span style="font-family: Calibri; color: black; font-size: 12pt;">Disse solvogne kræver ingen <br />vedligeholdelse, men de kan naturligvis rengøres <br />med vand, sæbe og en blød børste.</span></span></p>', 'Alfa Solvogn', '', '', '', 'alfa-solvogn_53ce25cfe9ca1'),
(55, '', 'Elegante designermøbler i lette og vedlige-<br />holdelsesfrie materialer. Stellet er af aluminium,<br />stolen af plast og den flotte bordplade er udført<br />i kraftigt tempereret glas med hvide striber. Flot, <br />anderledes og sindsygt lækkert! Bordets mål: <br />150x150 cm, Inkl. 8 stole.', 'Nardi Lotto Dinner', '', '', '', 'nardi-lotto-dinner'),
(56, 'Nardi Lauro Havesæt', '<p>En tidløs stil kombineret med mange smarte detajler <br />hæver disse plastmøbler til et ekslusivt niveau og der <br />er et stort udvalg. Møblerne er produceret i et materiale, <br />som er slidstærkt, robust og meget nemt at vedligeholde.<br />Bordets mål: 100x210 cm eller som udtræksbord 140-210 cm<br />hertil 8 stabelbare Gemma stole.</p>', 'Nardi Lauro Havesæt', '', '', '', 'nardi-lauro-havesaet'),
(57, 'Nardi Maestrale', '<p>En tidløs stil kombineret med mange smarte detajler <br />hæver disse plastmøbler til et ekslusivt niveau og der <br />er et stort udvalg. Møblerne er produceret i et materiale, <br />som er slidstærkt, robust og meget nemt at vedligeholde.<br />Bordets mål: 100x160x220 i hvidt slagfast plast med <br />udtræksplade samt 8 Brezza stole som er stabelbare.</p>', 'Nardi Maestrale', '', '', '', 'nardi-maestrale'),
(58, 'Nardi Maestrale Cafésæt', '<p>Bord (90x90 cm) slagfast plast og 4 stabelbare stole<br /> i aluminium og plast. Super lækkert og slidstærkt.</p>', 'Nardi Maestrale Cafésæt', '', '', '', 'nardi-maestrale-cafesaet'),
(59, '', '<p>Sammenklappelig solvogn med hjul og <br />lille opbevaringsboks til diverse i ryg samt let<br /> indstillelig ryglæn.</p>\r\n<p> </p>\r\n<p>Super lækker og nem vedligeholdelsesfri solvogn!</p>', 'Nardi Nettuno', '', '', '', 'nardi-nettuno'),
(60, 'Nardi Flora Havemøbelsæt', '<p>En tidløs stil kombineret med mange smarte detajler <br />hæver disse plastmøbler til et ekslusivt niveau og der <br />er et stort udvalg. Møblerne er produceret i et materiale, <br />som er slidstærkt, robust og meget nemt at vedligeholde.<br />Bordets mål: 95x175 cm hertil 6 stk. 5-pos. stole.</p>', 'Nardi Flora Havesæt', '', '', '', 'nardi-flora-havesaet'),
(61, 'Roma Teakbord', '<p>Super flot udtræksbord i teak (Bord 100x160-220 cm). <br />Udtrækspladen kan gemmes i bordet. Plads til parasol<br /> i bordets midte.</p>', 'Roma Teakbord', '', '', '', 'roma-teakbord'),
(62, 'Udine Foldestol med armlæn', '<p>Maskinproduceret teaktræsstol med flot finish.<br />Formstøbt lænestøtte, så siddekomforten er i top!</p>', 'Udine Foldestol med armlæn', '', '', '', 'udine-foldestol-med-armlaen'),
(104, '', '', 'Hjul til 140 liter havebeholder', '', '', '', 'hjul-til-140-liter-havebeholder'),
(63, 'Padova Bord', '<p style="text-align: left; margin-top: 0pt; unicode-bidi: embed; direction: ltr; margin-bottom: 0pt; margin-left: 0in;"><span style="font-size: 10pt;"><span style="font-family: Calibri; color: black;"></span>Bord med butterfly udtræk. Stålfarvet alustel<br />med super lækker teakbordplade.</span></p>', 'Padova Bord (100x210-280 cm)', '', '', '', 'padova-bord-100x210-280-cm'),
