(727, 'Nardi Lauro Havesæt', '<p>En tidløs stil kombineret med mange smarte detajler <br />hæver disse plastmøbler til et ekslusivt niveau og der <br />er et stort udvalg. Havebordet er produceret i et materiale, <br />som er slidstærkt, robust og meget nemt at vedligeholde.<br />Bordets mål: 100x210 cm.</p>', 'Nardi Lauro Havebord', '', '', '', 'nardi-lauro-havebord'),
