(91, '', '<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p><span style="font-size: 9pt; font-family: arial,helvetica,sans-serif; color: black;">Dejlig 5-pos.stol i teak. Formstøbt ryg og sæde. Alle vores<br /> havemøbler er maskinlavet og sikrer <span style="font-size: 9pt; color: black;">dermed<span style="font-size: 9pt; color: black;"> en ensartet <br />korrekt samling. Teak har et stort naturligt indhold af olie, <br />der gør træet næsten uforgængeligt og <span style="font-size: 9pt; color: black;">vedligeholdelsesfrit<span style="font-size: 9pt; color: black;">. <br />Såfremt teak møblerne ikke behandles vil træet med <br />tiden patinere og få smukke sølvgrå nuancer. </span></span></span></span></span></p>', 'Gorizia 5-pos.Teakstol', '', '', '', 'gorizia-5-pos-teakstol'),
(92, '', 'Dejligt stort bord af bedste kvalitet. Bordet kan klappes <br />sammen. Endvidere hul til parasol.', 'Napoli Foldebord Ø150 cm', '', '', '', 'napoli-foldebord-o150-cm'),
(93, 'Bari 5-pos.Teakstol', '<p style="margin-top: 0pt; margin-bottom: 0pt; text-align: left; direction: ltr; unicode-bidi: embed; vertical-align: baseline;"><span style="font-size: 9pt; font-family: arial,helvetica,sans-serif; color: black;">Alle vores havemøbler er maskinlavet og sikrer <span style="font-size: 9pt; color: black;">dermed<span style="font-size: 9pt; color: black;"> en<br /> ensartet korrekt samling. </span></span>Teak har et stort naturligt indhold <br />af olie, der gør træet næsten uforgængeligt og <span style="font-size: 9pt; color: black;">vedligeholdel-<br />sesfrit<span style="font-size: 9pt; color: black;">. Såfremt teak møblerne ikke behandles vil træet med <br />tiden patinere og få smukke sølvgrå nuancer. <br /></span></span></span></p>', 'Bari 5-pos.Teakstol', '', '', '', 'bari-5-pos-teakstol'),
(94, '', 'Luksus solvogn i A-grade teak. Med hjul og <br />5-pos.ryg og sidebord.', 'Chieti Solvogn', '', '', '', 'chieti-solvogn'),
