(96, 'Viterbo Stol og Skammel', '<p>Adirondack lænestolen er indbegrebet af East Coast<br /> stemning og nostalgi, og så er den ideel til at ligge <br />og "flyde" i. Armlænet er bredt og kan snildt bruges<br /> som et lille bord til et krus the mm. En klassiker i <br />romantiske haver. Fås i teak og hvid.</p>', 'Viterbo Stol og Skammel', '', '', '', 'viterbo-stol-og-skammel'),
(97, 'Matera Teakbord 80x80 cm', '<p>Cafébord i Teak til små terasser og altaner.</p>\r\n<p> </p>', 'Matera Teakbord i flere størrelser', '', '', '', 'matera-teakbord-i-flere-storrelser'),
