(102, 'Partytelt 5x10 m', '<p><span style="font-size: 8pt; font-family: verdana,geneva;">Lækkert Partytelt med plads til 56 personer - til festlige lejligheder...!</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Partytelt,.Komplet med sider, gavle og ekstra kraftige stålrør 1,0-1,2x38-42 mm. Kraftig hvid presenning af rundvævet polyethylen 180 gr./m2. Nemt at rejse og opsætte. Monteres m/blækspruttelåse med plastkugler. Sidehøjde 2,12 m. Midterhøjde 2,98 m.</span></p>', 'Partytelt 5x10 m', '', '', '', 'partytelt-5x10-m'),
