(115, '', '<p><span style="font-size: 9pt; font-family: arial,helvetica,sans-serif; color: black;">Alle vores havemøbler er maskinlavet og sikrer <span style="font-size: 9pt; color: black;">dermed<span style="font-size: 9pt; color: black;"> en<br /> ensartet korrekt samling. Teak har et stort naturligt indhold <br />af olie, der gør træet næsten uforgængeligt og <span style="font-size: 9pt; color: black;">vedligeholdel-<br />sesfrit<span style="font-size: 9pt; color: black;">. Såfremt teak møblerne ikke behandles vil træet med <br />tiden patinere og få smukke sølvgrå nuancer. </span></span></span></span></span></p>', 'Piceno 5-pos.Teakstol', '', '', '', 'piceno-5-pos-teakstol'),
(116, 'Altan Parasol Ø160 Sort/Natur', '<p>Fantastisk kvalitetsparasol i 300 gr/m2 polyester cover med<br /> enkelthejs og forstærkninger i enderne. Endvidere UV og vand-<br />afvisende. Parasollen er inkl. altanbeslag. Fås i natur og sort.</p>', 'Altan Parasol Ø160 Sort/Natur', '', '', '', 'altan-parasol-o160-sort-natur'),
(117, '100% Genbrugsteak', '<p>Siena Skammel - Hvert møbel har deres eget særpræget <br />og unikke udseende. Tømmeret til disse smukke havemøbler<br />stammer fra Indonesien og er bjerget fra gamle og forfaldne<br />bygninger.</p>\r\n<p> </p>\r\n<p><span style="font-family: Calibri; color: black;"><br /></span></p>', '100% Genbrugsteak', '', '', '', '100-genbrugsteak'),
