(120, 'Italiensk antik Terracotta krukke', '<p>(H38 cm) Blomster: Hortensia "Antique", Gaultheria, <br />Lyserøde, pyntefrugt samt lille fugl. </p>\r\n<p> </p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres og sættes på plads ... </span></strong></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">helt GRATIS!</span></strong></span></p>', 'Italiensk antik Terracotta krukke', '', '', '', 'italiensk-antik-terracotta-krukke_53ce25d1292df'),
(121, 'Polyrattan Krukke', '<p>Sort Polyrattan krukke (H70 cm). Blomst: Hebedonna.</p>\r\n<p> </p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres og sættes på plads ... </span></strong></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">helt GRATIS!</span></strong></span></p>', 'Polyrattan Krukke', '', '', '', 'polyrattan-krukke'),
(122, 'Italiensk antik Terracotta krukke', '<p>Lækker Italiensk håndlavet krukke (H28 cm).</p>\r\n<p>Blomster: Solhat (lyserød), Gaultheria (lyserød), lyng (lyserød) </p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;"></span></strong></span> </p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres og sættes på plads ... </span></strong></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">helt GRATIS!</span></strong></span></p>', 'Italiensk antik Terracotta krukke', '', '', '', 'italiensk-antik-terracotta-krukke_53ce25d12f488'),
(123, 'Stonewashed gråpatineret polyrattan', '<p>Stolen er produceret i stonewashed gråpatineret polyrattan. <br />En rigtig flot stol, der er særdeles velegnet ude som inde. <br />Hynden kan tilkøbes herunder og fås i Taupe eller natur. <br />Fantastisk siddekomfort!</p>', 'Pariser stol', '', '', '', 'pariser-stol'),
