(128, 'Base One 50 kg', '<p>Sort parasolfod med kraftige hjul der er aftagelige. Foden pas-<br />ser til parasolstokke, der måler 38 mm, 48 mm og 58 mm.</p>\r\n<p>Parasolfoden er utrolig nem at flytte rundt med...!</p>', 'Base One 50 kg med hjul', '', '', '', 'base-one-50-kg-med-hjul'),
(137, 'Benevento Bord med 2 stole', '<p>Utrolig sødt sammenklappeligt havesæt i teak. Ideel til <br />den lille have eller altanen. Bordets mål er 70x70 cm. <br />Stolene er med armlæn.</p>', 'Benevento Bord med 2 stole', '', '', '', 'benevento-bord-med-2-stole'),
(129, '4 stk. Lucca Stole', '<p><span style="font-family: verdana,geneva; font-size: 8pt;">Super moderne sorte havestole i vejbestandig polyrattan eksl. hynder.<br /> <br />Polyrattan er et yderst slidstærkt materiale. Det er smudsafvisende, </span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;">vedligeholdelsesfrit og UV-bestandigt plastmateriale, der tåler </span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;">at stå ude hele året, og som ikke kræver en masse klargøring hvert år</span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;"> inden sæsonen starter.<br /> <br /> Stolene rengøres med vand og sæbe.</span></p>', '4 stk. Lucca Polyrattan Stole', '', '', '', '4-stk-lucca-polyrattan-stole'),
(131, 'Imperia Havesæt', '<p><span style="font-family: verdana,geneva; font-size: 8pt;">Lækkert lille sammenklappeligt havebord samt 2 klapstole, <br />der passer ideelt til den lille have eller altanen. Bordet er <br />af maghogni (Hvid Highgloss). Bordets mål er 65x65 cm el. <br />65x130 cm. Begge klapper kan slås ned, således at bordet <br />kun fylder 65x20 cm. Fås også i TEAK!</span></p>\r\n<p> </p>\r\n<p> </p>', 'Imperia Havesæt', '', '', '', 'imperia-havesaet'),
(738, 'Zoe Rundt Hjørnemodul', 'Rundt Hjørnemodul måler: <br /><br />H66 cm-D88 cm-B94/46 cm.', 'Zoe Rundt Hjørnemodul', '', '', '', 'zoe-rundt-hjornemodul');
