(536, 'Marseille sæbe Musc Blanc', '<p>Denne skønne spicy fruit Marseille sæbe er lavet efter en <br />gammel tradition i Marseille, af en master soapmaker, kogt <br />i en stor gryde, med copra olie. Copra er tørret kød eller <br />kerne, af kokosnødden. Kokosolie er udvundet fra det og <br />har gjort Copraolie et vigtigt landbrugsprodukt for mange <br />kokos-producerende lande. Sæben indeholder det naturlige <br />glycerin, som tillader det at rense din hud blidt. Denne sæbe <br />indeholder ikke animalsk fedtstoffer eller syntetisk overflade-<br />aktiver. Æteriske olie af Ylang, Lemon, Cedar, Guaiac wood.<br /> INGEN: Parabener eller Phenoxyethanoel. 96,5% naturlige <br />ingredienser.<em></em></p>', 'Marseille sæbe Musc Blanc 500ml', '', '', '', 'marseille-saebe-musc-blanc-500ml'),
