(413, 'Country Lounge chair m. skammel', 'Dejlig Luksus lounge lænestol med skammel i det fineste <br />polyrattan "Vintage Grey" med en tyk Grey wash hynde<br />til både stolen og skamlen. Lige til at sidde og meditere i.<br />Kan stå ude hele året rundt.', 'Country Lounge Chair m. skammel', '', '', '', 'country-lounge-chair-m-skammel_53ce25d1b41a7'),
(529, 'Benedine Choco Terracotta Classic', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.</p>', 'Benedine Choco Terracotta Classic', '', '', '', 'benedine-choco-terracotta-classic'),
(415, 'Simona', '<p>Omkring 1820-1860 var den franske Simona-potte en stor suc-<br />ces. Potten blev drejet hos en pottemager i latinerkvarteret i <br />Paris - hans navn er dog ukendt. Vores levrandør fandt urtepot-<br />ten på et loppemarked på Montmartre og får den nu produceret <br />i Toscana.</p>', 'Simona Grå Terracotta Ø16 cm inkl. underskål', '', '', '', 'simona-gra-terracotta-o16-cm-inkl-underskal'),
