(465, 'Esteban Positionsstol', '<p>5 pos.stol i aluminium/sort texteline - super siddekomfort.</p>\r\n<p>Kan stå ude hele året!</p>', 'Esteban Positionsstol', '', '', '', 'esteban-positionsstol_53ce25d2b4d99'),
(466, 'Esteban', 'Super elegant havesæt. Bordet måler 90x180 cm og er kre-<br />eret med en LOOK/BLACK glasplade og aluminiumsstel. Her-<br />til følger 4 positionsstole i texteline/alu. Super siddekomfort.<br /><br />', 'Esteban Havesæt Texteline/Alu', '', '', '', 'esteban-havesaet-texteline-alu'),
(467, 'Cover til parasol Ø4,0 og 3x3m', '<p>Et kraftigt cover til at beskytte din parasol for vejr og vind.<br />Dette cover er kreeret i Grey PVC.</p>', 'Cover til Parasol Ø4,0 og 3x3m', '', '', '', 'cover-til-parasol-o4-0-og-3x3m'),
(468, 'Cover til Havesæt m. 4 stole', '<p>Et rigtig Luksus Cover i Grey PVC til dine Havemøbler. Til<br />bord og stole, hvor målene er ca. 100x160 cm/4 stole.<br />Dette Cover måler: H:88 B:140 L:180.</p>', 'Cover til Havesæt m. 4 stole', '', '', '', 'cover-til-havesaet-m-4-stole_53ce25d2be20b'),
(469, 'Cover til Rundt Bord 4-6 stole', '<p>Et rigtig Luksus Cover i Black Polyester PU coated til dine<br /> Havemøbler. Coveret måler H:88 Ø:200</p>', 'Cover til Rundt Bord 4-6 stole', '', '', '', 'cover-til-rundt-bord-4-6-stole'),
(471, 'Rosenborg Stolhynde', '<p>Super flot Bænkhynde i stribet blå og hvid. 100% cotton. <br />Størrelsen på hynden er: 45x58 cm.</p>', 'Rosenborg Stolhynde', '', '', '', 'rosenborg-stolhynde'),
(472, 'Paolo Hynder til Paolo stol', 'Luksus Polyester hynder til Paolostolen - her er mulighed for,<br /> at vælge siddehynde i sort eller siddehynde med ryg i grå.', 'Paolo Hynder til Paolo stol', '', '', '', 'paolo-hynder-til-paolo-stol'),
(473, 'Nardi Maestrale Musa', '<p>En tidløs stil kombineret med mange smarte detajler <br />hæver disse plastmøbler til et ekslusivt niveau og der <br />er et stort udvalg. Møblerne er produceret i et materiale, <br />som er slidstærkt, robust og meget nemt at vedligeholde.<br />Bordets mål: 100x160x220 i hvidt slagfast plast med <br />udtræksplade samt 6 musa stole som er stabelbare.</p>', 'Nardi Maestrale Musa', '', '', '', 'nardi-maestrale-musa'),
(474, 'Cover til Parasol Ø3,0', '<p>Et kraftigt cover til at beskytte din parasol for vejr og vind.<br />Dette cover er kreeret i Grey PVC.</p>', 'Cover til Parasol Ø3,0', '', '', '', 'cover-til-parasol-o3-0'),
(475, 'Zorba Stabelstol', '<p>i powder coating aluminiumsstel/texteline med bambusarm-<br />læn, siddekomforten er helt i top. Denne elegante stol fås i <br />farverne sort eller hvid.</p>', 'Zorba Stabelstol', '', '', '', 'zorba-stabelstol'),
(476, 'Zorba Stabelstol', '<p>i powder coating aluminiumsstel/texteline med bambusarm-<br />læn, siddekomforten er helt i top. Denne elegante stol fås i <br />farverne sort eller hvid.</p>', 'Zorba Stabelstol', '', '', '', 'zorba-stabelstol_53ce25d31a8ee'),
(477, 'Zorba Havemøbelsæt', '<p>Bambusbord (Ø120xH72 cm) powder coating aluminiumsstel <br />samt 4 texteline stole med bambusarmlæn, hvor siddekom-<br />forten er helt i top. Dette elegante sæt fås i farverne sort eller<br /> hvidt.</p>', 'Zorba Havesæt Bambus/texteline', '', '', '', 'zorba-havesaet-bambus-texteline'),
(478, 'Milano Stol', '<p>Super smuk fletstol i Luksus Polyrattan - inkl. hynde. Fantas-<br />tisk siddekomfort...! <br /><br /></p>\r\n<p>Milanosættet fås under menupunktet "Havemøbelsæt"</p>', 'Milano Stol i Sandgrå/Hvid', '', '', '', 'milano-stol-i-sandgra-hvid'),
(479, 'Capri Cafesæt', 'Lækkert Cafésæt med bord i mosaik og støbejern i farverne<br />natur/beige hertil 2 flotte texteline/alu stole med en fantas-<br />tisk siddekomfort.', 'Capri Cafesæt', '', '', '', 'capri-cafesaet'),
(480, 'Camping Relaxer Chair', 'Dejlig og behagelig stol inkl. hynde til nakken i sort texteline<br /> og sort aluminiumsstel - når man bare ønsker at slappe af..!', 'Camping Relax Chair', '', '', '', 'camping-relax-chair'),
(481, 'Capri Stol', 'Dejlig stabelstol i sort aluminium og sort texteline - super<br />siddekomfort.', 'Capri Stol', '', '', '', 'capri-stol'),
(485, 'Simona Grå Terracotta', '<p>Omkring 1820-1860 var den franske Simona-potte en stor suc-<br />ces. Potten blev drejet hos en pottemager i latinerkvarteret i <br />Paris - hans navn er dog ukendt. Vores levrandør fandt urtepot-<br />ten på et loppemarked på Montmartre og får den nu produceret <br />i Toscana.</p>', 'Simona Grå Terracotta Ø16 cm inkl. underskål', '', '', '', 'simona-gra-terracotta-o16-cm-inkl-underskal_53ce25d32e172'),
(486, 'BBQ fireplace oval inkl. rist', '<p>Romantisk bålfad der er ovalt (D42xB54xH67 cm) til de hyg-<br />gelige sommeraftener....!<br /><br /></p>\r\n<p>Bålfadet er beregnet til, at lægge lidt brændeknuder i -<br />både for hyggen og for varmen.</p>', 'BBQ bålfad oval inkl. rist', '', '', '', 'bbq-balfad-oval-inkl-rist'),
(487, 'BBQ rundt bålfad inkl. rist', '<p>Virkelig hyggeligt rundt bålfad (47x67 cm) til at gøre<br />sommeraftnerne lidt længere....! <br /><br /></p>\r\n<p>Bålfadet er beregnet til, at lægge lidt brændeknuder i -<br />både for hyggen og for varmen.</p>', 'BBQ rundt bålfad inkl. rist', '', '', '', 'bbq-rundt-balfad-inkl-rist'),
(488, 'Udendørslys hvide 150x200 mm', 'Udendørslyset der i øvrigt brænder flot, har en brændetid <br />på 140 timer.', 'Udendørslys i hvidt 150x200 mm', '', '', '', 'udendorslys-i-hvidt-150x200-mm'),
(489, 'Undendørslys i hvidt 150x375 mm', '<p>Udendørslyset der i øvrigt brænder flot, har en brændetid <br />på 225 timer.</p>', 'Undendørslys i hvidt 150x375 mm', '', '', '', 'undendorslys-i-hvidt-150x375-mm'),
(490, 'Udendørslys i hvidt 150x500 mm', 'Udendørslyset der i øvrigt brænder flot, har en brændetid <br />på 280 timer.', 'Udendørslys i hvidt 150x500 mm', '', '', '', 'udendorslys-i-hvidt-150x500-mm'),
(491, 'Romantisk Lanterne fås i 3 str.', 'Super fin Lanterne, der vil pynte på enhver terrasse, havestue, <br />trappe etc.', 'Romantiske Lanterner fås i 3 str.', '', '', '', 'romantiske-lanterner-fas-i-3-str'),
(492, 'Light Metal Lanterner fås i 3 str.', 'Udendørs Lanterner til de hyggelige stunder i haven...!', 'Light Metal Lanterner fås i 3 str.', '', '', '', 'light-metal-lanterner-fas-i-3-str'),
(818, 'Core Teak Dining Table i 3 str.', '<p><span style="color: #808080;">Det nye flotte havebord, Core, er et retro teaktræs bord fra Cane-line. Stellet er fremstillet af aluminiums profiler, og bordpladen består af godkendte og certificerede FSC teaktræslameller. Core bordet fås i tre forskellige størrelser, og stellet fås i to forskellige farver, lava grå og taupe. Core havebordet er designet af Foersom & Hiort-Lorenzen.</span><br /><br /></p>\r\n<br /><span style="font-size: 8pt;"><a href="http://www.youtube.com/watch?v=5ErcPQ-jeC4"><span style="color: #808000; font-family: arial black,avant garde;">Se de flotte detaljer her</span></a></span>', 'Core Teak Dining Table i 3 str.', '', '', '', 'core-teak-dining-table-i-3-str'),
(496, 'Sidetable i Teak eller Hvidt', '<p>Sødt lille sidebord til Solvognen eller ...! <br />Målene L50xB50xH50 cm.</p>\r\n<p>Fås i Teak eller hvidlakeret mahogni.</p>', 'Sidetable i Teak eller Hvidt', '', '', '', 'sidetable-i-teak-eller-hvidt'),
(497, 'Butterfly Bord', '<p><span style="font-family: verdana,geneva; font-size: 8pt;">Lækkert lille sammenklappeligt havebord, der passer ideelt <br />til den lille have eller altanen. Bordet er af maghogni (Hvid <br />Highgloss). Bordets mål er 65x65 cm el. 65x130 cm. Begge<br /> klapper kan slås ned, således at bordet kun fylder 65x20 cm. <br /><br /></span></p>', 'Imperia Butterfly Bord', '', '', '', 'imperia-butterfly-bord'),
(498, 'Goa Luksus Loungesæt', '<p>Super lækkert og klassisk loungesæt i Rough Black inkl.<br />store lækre bløde hynder i Grey wash.</p>', 'Goa Luksus Loungesæt', '', '', '', 'goa-luksus-loungesaet'),
(499, 'Bellevue Cafebord', '<p>Super lækkert lille cafebord kreeret i aluminium og den<br />fineste teak.</p>', 'Bellevue Cafebord', '', '', '', 'bellevue-cafebord'),
(796, 'Sinai Stol White-Wash', 'Luksus polyrattan stol med super siddekomfort. Stolen fås<br /> i "White wash og Grey-Wash" polyrattan og er inkl. hynde i<br />farven natur.', 'Sinai Stol White-Wash', '', '', '', 'sinai-stol-white-wash'),
(780, 'Guy Parasolfod 35 kg', 'Denne parasolfod, der måler Ø50 cm, passer til parasoller, <br />hvis stok måler 35-48 mm og fås i tre farver Grå, Sort og <br />Brun.', 'Guy Parasolfod 35 kg (3 farver)', '', '', '', 'guy-parasolfod-35-kg-3-farver'),
(781, 'Guy Parasolfod 50 kg', 'Denne parasolfod der måler Ø58 cm passer til parasoller, hvis <br />stok måler 38-58 mm og fås i tre farver Grå, Sort og Brun.', 'Guy Parasolfod 50 kg (3 farver)', '', '', '', 'guy-parasolfod-50-kg-3-farver'),
(537, 'Pisa luksus stol', '<p>En fryd for øjet, med en fantastisk siddekomfort! <br />Pisa stolen er kreeret i mørkebrunt flet med armlæn.<br />Inkl. hynde i "Greywash".</p>', 'Pisa Luksus stol', '', '', '', 'pisa-luksus-stol'),
(502, 'Beach Luksus Loungesæt', '<span style="font-family: arial black,avant garde;">UDSTILLINGSMODEL</span><br />Super flot Luksus loungesæt i de lyse nuancer, hvor der ikke <br />er gået på kompromis med kvaliteten .. sættet som vist inkl.<br />hynder i grey wash....!', 'Beach Luksus Loungesæt', '', '', '', 'beach-luksus-loungesaet'),
(503, 'Rolls Loungesæt i natur', 'Smukt loungesæt der falder i med naturen - sættet har dejlige<br /> bløde former, tykke hynder og kan stå ude hele året....!', 'Rolls Loungesæt i natur', '', '', '', 'rolls-loungesaet-i-natur'),
(504, 'Taburet Memphis sort', '<p><span style="color: #99cc00;"><strong>Design fra MUUBS!</strong></span><br />Super rå og rustik taburet med sort eller naturfarvet <br />læder.<br /><br /></p>\r\n<p>Mål: 47x24x47 cm.</p>', 'Taburet Memphis Sort eller Natur', '', '', '', 'taburet-memphis-sort-eller-natur'),
(505, 'Taburet Square', '<p><span style="color: #99cc00;"><strong>Design fra MUUBS!</strong></span><br />Rå og rustik taburet i genbrugsteak.<br /><br /></p>\r\n<p>Mål: H45 cm.</p>', 'Taburet Square', '', '', '', 'taburet-square'),
(506, 'Sofabord Root', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!<br /></span></strong>Unikt bord/Teak Root fra Bali dia.: 50-60 cm.</p>', 'Sofabord Root', '', '', '', 'sofabord-root'),
(507, 'Bænk One', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!</span></strong><br />Recycled teak bænk fra Bali! Der forekommer "lus" i bænkene, <br />det vil sige andet teaktræ man fylder i de huller, der nu måtte <br />mangle - af historisk grund.</p>', 'Bænk One', '', '', '', 'baenk-one'),
(508, 'Loungesæt Lago', '<span style="color: #99cc00;"><strong>Design fra MUUBS!</strong></span><br />Super lækkert sæt bestående af to loungestole, to-pers.<br /> loungesofa samt bord i en rigtig kraftig polyrattan i farven<br />natur. Sættet er inkl. Mørk Grey Wash hynder.', 'Loungesæt Lago', '', '', '', 'loungesaet-lago'),
(509, 'Loungesæt Garda', '<p><span style="color: #99cc00;"><strong>Design fra MUUBS!</strong><br /><span style="color: #000000;">Super lækkert sæt bestående af en loungestol, tre-pers.</span><br /><span style="color: #000000;"> loungesofa, en puf samt bord i en rigtig kraftig polyrattan <br />i farven</span><span style="color: #000000;"> Dark Brown. Sættet er inkl. Mørk Grey Wash hynder.</span></span></p>', 'Loungesæt Garda', '', '', '', 'loungesaet-garda'),
(510, 'Sort Lammeskind - langhåret', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores Islandske lammeskind.<br /><br /></p>\r\n<p>Husk, at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 100-120 cm<br /><span style="color: #333333;">Hårlængde: 15-25 cm<br /><span style="color: #333333;">Farve: Sort<br /></span></span></span>', 'Sort Lammeskind - langhåret', '', '', '', 'sort-lammeskind-langharet'),
