(515, 'The Silver Sheep - long hair', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores Islandske lammeskind.<br /><br /></p>\r\n<p>Husk at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 110x90 cm.<br /><span style="color: #333333;">Hårlængde: Ca. 15 cm<br /><span style="color: #333333;">Farve: Sølv<br /></span></span></span>', 'The Silver Sheep - long hair', '', '', '', 'the-silver-sheep-long-hair'),
(516, 'The Black Sheep - short hair', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores Islandske lammeskind.<br /><br /></p>\r\n<p>Husk at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 110x90 cm.<br /><span style="color: #333333;">Hårlængde: Ca. 5 cm<br /><span style="color: #333333;">Farve: Sort<br /></span></span></span>', 'The Black Sheep - short hair', '', '', '', 'the-black-sheep-short-hair'),
(517, 'Elfenbensfarvet lammeskind - korthåret', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores New Zealandske lammeskind.<br /><br /></p>\r\n<p>Husk at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 100x60 cm.<br /><span style="color: #333333;">Hårlængde: ca. 6 cm<br /><span style="color: #333333;">Farve: Ivory<br /></span></span></span>', 'Ivory lammeskind - korthåret', '', '', '', 'ivory-lammeskind-kortharet'),
(518, 'Sort & hvidt Lammeskind - langhåret', '<span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"></span></span></span></span>\r\n<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores Islandske lammeskind.</p>\r\n<p>Husk, at der ikke er to skind der er ens!</p>\r\n<p><span style="color: #333333;">Mål: Ca. 100-120 cm<br /><span style="color: #333333;">Hårlængde: 15-25 cm<br /><span style="color: #333333;">Farve: Hvidt/sort</span></span></span></p>\r\n<span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"></span></span></span>', 'Hvidt/sort Lammeskind - langhåret', '', '', '', 'hvidt-sort-lammeskind-langharet'),
(519, 'Off-white Lammeskind - langhåret', '<span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"></span></span></span></span>\r\n<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores Islandske lammeskind.<br /><br /></p>\r\n<span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"></span></span></span></span>\r\n<p>Husk, at der ikke er to skind der er ens!<br /><br /></p>\r\n<p>Mål: 100-120 cm<br />Hårlængde: 15-25 cm<span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"><span style="color: #333333;"><br />Farve: Off-white<br /></span></span></span></span></span></span></p>', 'Off-white Lammeskind - langhåret', '', '', '', 'off-white-lammeskind-langharet'),
(520, 'Chair Pad Black - long hair', '<p>Langhåret stolehynde fra The Organic Sheep. Ren luksus <br />til stolesædet, blødt og lækkert. 100% rent naturprodukt. <br />Kommer i flere farver og passer til alle stole.<br /><br /></p>\r\n<p>Vælg nedenfor, hvilken længde der ønskes.<br /><br /></p>\r\n<p>Mål: Ca. 40x40 cm<br />Hårlængde: 13 cm/5 cm<br />Farve: Sort</p>', 'Chair Pad Black - long/short hair', '', '', '', 'chair-pad-black-long-short-hair'),
(521, 'Chair Pad White - long hair', '<p>Langhåret stolehynde fra The Organic Sheep. Ren luksus <br />til stolesædet, blødt og lækkert. 100% rent naturprodukt. <br />Kommer i flere farver og passer til alle stole.<br /><br /></p>\r\n<p>Vælg nedenfor, hvilken længde der ønskes.<br /><br /></p>\r\n<p>Mål: Ca. 40x40 cm<br />Hårlængde: 13 cm/5 cm<br />Farve: Hvidt</p>', 'Chair Pad White - long/short hair', '', '', '', 'chair-pad-white-long-short-hair'),
(522, 'Chair Pad Silver - long hair', '<p>Langhåret stolehynde fra The Organic Sheep. Ren luksus <br />til stolesædet, blødt og lækkert. 100% rent naturprodukt. <br />Kommer i flere farver og passer til alle stole.<br /><br /></p>\r\n<p>Vælg nedenfor, hvilken længde der ønskes.<br /><br /></p>\r\n<p>Mål: Ca. 40x40 cm<br />Hårlængde: 13 cm/5 cm<br />Farve: Sølv</p>', 'Chair Pad Silver - long/short hair', '', '', '', 'chair-pad-silver-long-short-hair'),
(523, 'Chair Pads - langhåret', '<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;"><span style="font-size: 10pt; font-family: Calibri; color: black;">Fantastisk smukt skind med et strejf af det rustikke look. <span style="font-size: 10pt; font-family: Calibri; color: black;">F<span class="hps">åre-<br />skind <span class="hps">fra Island <span class="hps">og England <span class="hps">harmonerer <span class="hps">perfekt med <span class="hps">moderne<br /> møbler, og <span class="hps">kan bruges både <span class="hps">ude og inde. <span style="font-size: 10pt; font-family: Calibri; color: black;">Nedenfor kan vælges <br />farven du ønsker. <span class="hps"></span></span></span></span></span></span></span></span></span></span></span><br /></span></p>\r\n<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;"> </p>\r\n<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;">Mål: 40x40 cm</p>\r\n<br /><br dir="ltr" spellcheck="false" id="tinymce" class="mceContentBody " contenteditable="true" />', 'Chair Pads - langhåret', '', '', '', 'chair-pads-langharet'),
(524, 'Luksus Rensdyrskind', '<p>Disse lækre økologiske rensdyrskind er skabt af naturen, <br />det vil sige, at ingen af skindene er indfarvede. Dermed er <br />det muligt at bringe naturen ind i boligen - og skabe en <br />hyggelig og varm atmosfære.<br /><br /></p>\r\n<p>Mål:130-140 cm<br /> Hårlængde: 4 cm</p>', 'Luksus Rensdyrskind', '', '', '', 'luksus-rensdyrskind'),
(525, 'Rensdyrskind', '<p>Disse lækre økologiske rensdyrskind er skabt af naturen, <br />det vil sige, at ingen af skindene er indfarvede. Dermed er <br />det muligt at bringe naturen ind i boligen - og skabe en <br />hyggelig og varm atmosfære.<br /><br /></p>\r\n<p>Mål:120x75 cm<br /> Hårlængde: 4 cm</p>', 'Rensdyrskind Deluxe', '', '', '', 'rensdyrskind-deluxe'),
(526, 'A2 Living Lanterne medium', '<p>Galvaniseret lanterne i enkelt og minimalistisk design. Lanter-<br />nen er perfekt til den moderne boligstil og boligindretning - ude <br />som inde.</p>\r\n<br />\r\n<p>Et enkelt og eksklusivt design i kraftige kvalitetsmaterialer. <br />Hængsler, nitter og hank er udført i rustfrie materialer lanter-<br />nen har magnet lukning.<br /><br /></p>\r\n<p>Mål: 19x19x42,5 cm<br />Vægt: 2.5 kg</p>', 'A2 Living Lanterne medium', '', '', '', 'a2-living-lanterne-medium'),
(527, 'Célia Antique Terracotta', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> </span></strong></p>', 'Célia Antique Terracotta', '', '', '', 'celia-antique-terracotta'),
(528, 'Sarah Oval Choco Terracotta Romantic', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.</p>', 'Sarah Oval Choco Terracotta Romantic', '', '', '', 'sarah-oval-choco-terracotta-romantic'),
(483, 'Simona Grå Terracotta', '<p>Omkring 1820-1860 var den franske Simona-potte en stor suc-<br />ces. Potten blev drejet hos en pottemager i latinerkvarteret i <br />Paris - hans navn er dog ukendt. Vores levrandør fandt urtepot-<br />ten på et loppemarked på Montmartre og får den nu produceret <br />i Toscana.</p>', 'Simona Grå Terracotta Ø14 cm inkl. underskål', '', '', '', 'simona-gra-terracotta-o14-cm-inkl-underskal'),
(287, 'Recycle Dinning Table', '<p>Fantastisk flot GenbrugsTeak. Hvert bord har sin helt egen <br />historie og kan have mere end 100 år på bagen!!</p>\r\n<p>Bordets mål er Ø135 cm.</p>', 'Recycle Dining Table', '', '', '', 'recycle-dining-table'),
(288, 'Bordone Italiensk Terracotta', '<p>Denne klassiker bliver fremstillet i Toscana i topkvalitet<br /> og med de fineste forskellige udskæringer.</p>', 'Bordone Terracotta', '', '', '', 'bordone-terracotta'),
(289, 'Banan Havemøbelsæt', '<span style="font-family: verdana,geneva;">Super fint havesæt i Teak til terrassen eller et lille </span><br /><span style="font-family: verdana,geneva;">hyggeligt sted i haven.</span>', 'Banan Havemøbelsæt', '', '', '', 'banan-havemobelsaet'),
(290, 'Filippa', '<p>Mellem Lucca og Firenze i Toscana ligger potteriet Bitossi. <br />Her har man igennem fem generationer fabrikeret alle <br />former for potter. Vores leverandør har udvalgt denne <br />enkle og smukke form og får den nu produceret på ”eget” <br />toscanske potteri.</p>', 'Filippa Italiensk Terracotta', '', '', '', 'filippa-italiensk-terracotta'),
(293, 'Rockefeller Bord', '<p><strong></strong>Bordet der er kreeret i Fiberbeton og bordbukkene i Recycled <br />teaktræ, kan bruges ude, såvel som inde - vedligeholdelsesfrit!<br /><br /></p>\r\n<p>Materialer: Fiberbeton er et håndlavet produkt - et materiale <br />af cement og kvartssand iblandet glasfiber. Denne kombination <br />giver en meget let plade med en høj styrke og et moderne udtryk.</p>', 'Rockefeller Bord', '', '', '', 'rockefeller-bord'),
(463, 'Heather til Parasoller', '<p>Forlæng sommeraften og få fuld udbytte af udelive..!</p>\r\n<p><br />Denne model skal sidde på parasolstokken og tilsluttes <br />220V.</p>', 'Heather til Parasoller', '', '', '', 'heather-til-parasoller'),
(349, 'Københavner Potten', '<p><span style="font-size: 8pt; color: #808080;">Fra 1860 og frem til 1950-60 blev der fabrikeret mange ler</span><span style="font-size: 8pt; color: #808080;">urtepotter i Danmark. Et af de mindre potterier, der havde til </span><span style="font-size: 8pt; color: #808080;">huse i København, fremstillede denne potte i ca. 50 år. Vores</span><span style="font-size: 8pt; color: #808080;"> leverandør fandt denne gamle lerpotte i et nedlagt gartneri </span><span style="font-size: 8pt; color: #808080;">og får den nu produceret nær Lucca i Toscana. <br /><br />Alle potter er inkl. underfade.</span></p>', 'Københavner Potten Lys (Ø14-Ø30 cm)', '', '', '', 'kobenhavner-potten-lys-o14-o30-cm'),
(295, 'Sofabord Japan', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!</span></strong><br />Recycled teak fra Bali! Der forekommer "lus" i bordene, <br />det vil sige andet teaktræ man fylder i de huller, der nu <br />måtte mangle - af historisk grund. <br /><br /></p>\r\n<p>Bordet kan bruges ude- såvel som inde - vedligeholdelsesfrit!</p>', 'Sofabord Japan', '', '', '', 'sofabord-japan'),
(348, 'Lisa Antique Terracotta', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> <br /><br /></span></strong></p>', 'Lisa Antique Terracotta', '', '', '', 'lisa-antique-terracotta'),
(296, 'Lazise Loungesæt', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!</span></strong><br />Fantastisk flot loungesæt bestående af:<br />2 midtermoduler sæde: 77x86 cm<br />3 hjørnemodul sæde: 86x86 cm<br />1 stol sæde: 86x86 cm<br />1 puf75x75x43 cm.<br /><br /></p>\r\n<p>Hvis ønskes, kan man til- og fravælge moduler nedenfor.</p>', 'Lazise Loungesæt', '', '', '', 'lazise-loungesaet'),
(297, 'Rundt spisebord i Recycled teak', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!<br /></span></strong>Fantastisk lækkert spisebord i Recycled teak - produceret<br />i Bali. Bordet kan bruges ude- såvel som inde - vedligeholdel-<br />sesfrit!<br /><br /></p>\r\n<p>Bordet fås i forskellige størrelser og kan vælges nedenfor. <br /><br /></p>', 'Rundt spisebord i Recycled teak', '', '', '', 'rundt-spisebord-i-recycled-teak'),
(298, 'Nevada Bord', '<p><strong><span style="color: #99cc00;"><br />Design fra MUUBS</span></strong><br />Bordpladen der måler: 220x110x74 cm, er kreeret i sort jern <br />med bordbukke af Recycle teak.<br /><br /></p>\r\n<p>Kun til indendørs brug!</p>', 'Nevada SpisebordBord', '', '', '', 'nevada-spisebordbord'),
(299, 'Pacific sæt 4-stripe', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!<br /></span></strong></p>\r\n<p>Super flot luksus havesæt bestående af bord og 6 stole<br />med hynder i beige/sorte. Dette kan vælges nedenfor.<br /><br /></p>\r\n<p>Havesættet kan derfor holde til at stå ude hele året rundt, <br />og uden videre vedligeholdelse - kun vand og sæbe.</p>', 'Pacific sæt 4-stripe', '', '', '', 'pacific-saet-4-stripe'),
(300, 'Teak stol', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!<br /></span></strong></p>\r\n<p>Fantastisk flot teak stol med polyrattan sæde i grå <br />eller brun. Stolene fås i voks/teak eller ubehandlet.<br /><br /></p>\r\n<p>Endvidere fås stolen i sortmalet teak med papirflet eller <br />teak med papirflet.<strong> </strong>Nedenfor kan vælges model.</p>', 'Teak stol', '', '', '', 'teak-stol'),
(383, 'Elonora', '<p>Black Soil er fremstillet af en speciel lertype, hvis kemiske<br />sammensætning indeholder jern, hvilket gør produkterne<br /> meget stærke. Alle krukkerne er frostsikre. <br /><br /></p>\r\n<p><br /><strong><span style="color: #99cc00;"></span></strong></p>', 'Elonora Black Soil', '', '', '', 'elonora-black-soil'),
(301, 'Æsker m/låg', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!</span></strong><br />Recycled boatwood af teak. Det er træ fra gamle <br />både der har ligget i havet, som blir trukket på land<br /> og repareret. Man kan se at træet har leget livet og <br />det er charmerende i sig selv.<br /><br /></p>\r\n<p>Kasserne måler: 12 cm, 16 cm og 20 cm</p>', 'Æsker m/låg', '', '', '', 'aesker-m-lag'),
(302, 'Osaka Spisebord Recycled teak', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!</span></strong><br />Recycled teak bord fra Bali! Der forekommer "lus" i bordene, <br />det vil sige andet teaktræ man fylder i de huller, der nu måtte <br />mangle - af historisk grund.<br /><br /></p>\r\n<p>Fås i mange størrelser (160 til 400 m) ønskes andre mål <br />finder vi også ud af det. Bordet fås også med en rustik <br />overflade, hvilken vælges nedenfor.</p>', 'Osaka Spisebord Recycled Teak (mange størrelser)', '', '', '', 'osaka-spisebord-recycled-teak-mange-storrelser'),
(303, 'Udendørs fad med stearin', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!<br /></span></strong></p>\r\n<p>Fadene er fundet i forskellige landsbyer på Bali, og har <br />været brugt til opbevaring af bla. mad. Vi har fået dem <br />renset og fyldt med stearin, og når stearinen er brændt<br />ud, har man et virkelig flot fad.</p>', 'Udendørs fad med stearin 2 str.', '', '', '', 'udendors-fad-med-stearin-2-str'),
(304, 'Rensdyrskind', '<p>Fantastisk lækkert Rensdyrskind til den kolde aften...!</p>', 'Rensdyrskind', '', '', '', 'rensdyrskind'),
(331, 'Martina', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling. </p>', 'Martina Choco Terracotta Classic', '', '', '', 'martina-choco-terracotta-classic'),
(332, 'Clara', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling. </p>', 'Clara Choco Terracotta Classic', '', '', '', 'clara-choco-terracotta-classic');
INSERT INTO `i63il_virtuemart_products_da_dk` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(543, 'Zenia Luksus Havesæt', '<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Super elegant havesæt til den kræsne familie ..! Sættet består<br /> af bord L180xB90xH73 cm med glasbordplade samt 4 Luksus <br />polyrattan stole inkl. "Grey Wash" hynder - siddekomfort helt i <br />top...! Havesættet er flettet over et varmgalvaniseret samt <br />pulverlakeret stålstel - kvaliteten er helt i top. Sættet findes <br />også i farven natur. <br /></span></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Vedligeholdelsesfrit og kan stå ude hele året...!<br /></span></span></p>', 'Zenia Luksus Havesæt', '', '', '', 'zenia-luksus-havesaet'),
(791, 'Mirabelle Stol u/armlæn inkl. hynde', '<p>Super Romantisk serie i White-Wash polyrattan flet. <br />Stolen u/armlæn - der er en af flere modeller i denne serie - <br />måler: H86-B60-D69 cm.<br /><br /></p>\r\n<p>Stolen er inkl. beige hynde og har en siddekomfort der er <br />helt i top.</p>\r\n<p><br />Denne serie kan stå ude hele året ...!<br /><br /></p>\r\n<p> </p>\r\n<p> </p>', 'Mirabelle Stol u/armlæn inkl. hynde', '', '', '', 'mirabelle-stol-u-armlaen-inkl-hynde'),
(305, 'Ground Bord - Fiberbeton', '<p><strong><span style="color: #99cc00;">Design fra MUUBS!</span></strong><br />Bordet måler 220x110 cm og er kreeret i Fiberbeton. Kan <br />bruges ude- såvel som inde - vedligeholdelsesfrit!<br /><br /></p>\r\n<p>Materialer: Fiberbeton er et håndlavet produkt - et materiale <br />af cement og kvartssand iblandet glasfiber. Denne kombination<br /> giver en meget let plade med en høj styrke og et moderne udtryk.</p>', 'Ground Bord - Fiberbeton', '', '', '', 'ground-bord-fiberbeton'),
(306, 'Pandora 25 sk.', '<p align="left"><span style="font-family: arial,helvetica,sans-serif; font-size: 8pt;">Et lille, men meget effektfuldt batteri i forhold til sin <br />størrelse. Store buketter i farverne grøn/sølv, sølvpalme, <br />guldregn og guld willow.</span></p>\r\n<h5><span style="font-family: arial,helvetica,sans-serif; font-size: 8pt;">NEM-VÆGT: 175 GRAM</span></h5>', 'Pandora 25 skud', '', '', '', 'pandora-25-skud'),
(307, '', '<p><span style="font-family: arial,helvetica,sans-serif;">PROF Batteri</span>, der skyder 36 super store buketter i 2 højder. <br />Guld-crackling som mineres i bunden af hvert skud, samt <br />en kæmpe buket i guld<span style="font-family: arial,helvetica,sans-serif;">knitrende stjerner. <br /><br /></span></p>\r\n<p><span style="font-family: arial,helvetica,sans-serif; font-size: 8pt;">NEM-VÆGT: 630 GRAM</span></p>', 'Big Crackling 36 skud', '', '', '', 'big-crackling-36-skud'),
(309, 'Surprice 48 skud', '<p>Et stort rundt batteri med 48 skud. Alle med store <br />flotte buketter som springer i et kæmpe kulørt show.<br /><br /></p>\r\n<p>NEM vægt: 715 g.</p>', 'Surprice 48 skud', '', '', '', 'surprice-48-skud'),
(310, 'Guld Chrysanthemum', '<p>40 brocadebuketter ... der daler mod jorden med en<br />blanding af guld og sølvregn.<br /><br /></p>\r\n<p>NEM vægt: 500 g.</p>', 'Guld Chrysanthemum', '', '', '', 'guld-chrysanthemum'),
(311, 'Glitterwave 35 vifteskud', '<p align="left"><span style="font-size: 8pt; font-family: verdana,geneva;"><span style="color: #000000;">Imponerende flotte røde haler, der alle springer i mega <br />flotte<span style="color: #000000;"> røde buketter med hvid glitter samt<span style="color: #000000;"> sølvbuketter <br />med grøn glitter.<br /><br /></span></span></span></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;"><span style="color: #000000;">Et batteri som skal ses.<br /><br /></span></span></p>\r\n<p><span style="font-size: 8pt;"><span style="color: #000000;"><span style="font-family: verdana,geneva; font-size: 8pt;">NEM vægt: 465 g.<br /><br /></span></span></span></p>\r\n<p><span style="font-size: 8pt;"><span style="color: #000000;"><span style="font-family: verdana,geneva; font-size: 8pt;"></span><a href="http://www.youtube.com/watch?v=MKywXiPWq5E&feature=channel&list=UL"><span style="color: #99cc00; font-size: 10pt;"><strong><span style="color: #99cc00;">Se batteriet på YouTube</span></strong></span></a><br /></span></span></p>', 'Glitterwave 35 vifteskud', '', '', '', 'glitterwave-35-vifteskud'),
(312, 'Silver Coco and Willow 49', '<p>Et imponerende flot vifte-batteri. Dette batteri er et sandt<br /> orgie af farver og effekter. Et super midnats-batteri for alle.<br /><br /></p>\r\n<p>NEM vægt: 956 g.<br /><br /></p>\r\n<p><span style="color: #99cc00;"><strong><a href="http://www.youtube.com/watch?v=-Y2VD5N2c0A"><span style="color: #99cc00;">Se batteriet på YouTube</span></a></strong></span></p>', 'Silver Coco and Willow 49 skud', '', '', '', 'silver-coco-and-willow-49-skud'),
(313, 'Dream Sky 25 skud', '<p style="margin: 0cm 0cm 0pt;"><span style="font-size: small;" size="3"><span style="font-family: Calibri;" face="Calibri">Et væld af flotte buketter og effekter. Alle buketter har <br />crackling i bunden og flotte farver på toppen.<br /><br /></span></span></p>\r\n<p style="margin: 0cm 0cm 0pt;"><span style="font-size: small;" size="3"><span style="font-family: Calibri;" face="Calibri">NEM vægt: 430 g.<br /><br /></span></span></p>\r\n<p style="margin: 0cm 0cm 0pt;"><span style="font-size: small;" size="3"><span style="font-family: Calibri;" face="Calibri">TILBUD - hvis der købes 2 batterier kr. 599,-<br /></span></span></p>', 'Dream Sky 25 skud', '', '', '', 'dream-sky-25-skud'),
(314, 'Mega crackling keglefontæne', '<p>Denne forntæne er noget af det ypperste der fås på det<br /> danske marked. Den udspyr flot guld med kraftig crackling-<br /> effekt i en højde på 8-10 m.<br /><br /></p>\r\n<p>NEM vægt: 500 g.</p>', 'Mega crackling keglefontæne', '', '', '', 'mega-crackling-keglefontaene'),
(834, 'Share Diningtable', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;">Share havebordet fås med understel i enten aluminium eller rustfrit stål. Du kan vælge mellem hvid eller grå glasplade eller hvid eller grå keramisk bordplade. Kombiner dit bord, så det passer til netop din stil og opnå et unikt og individuelt look.</span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;">Share spisebordserien fås også i en mindre udgave i størrelsen 160x100 cm.</span><br /><br /><span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;">Bordets mål: B210 cm-H69 cm-D100 cm.</span></p>\r\n</div>\r\n</div>', 'Share Diningtable 200x100 cm', '', '', '', 'share-diningtable-200x100-cm'),
(315, 'Superposen', '<p>Et super flot sortiment bestående af 4 flotte batterier, <br />6 raketter samt 2 bomberør. En super flot og super <br />effektfuld pakke til en super god nytårsaften.<br /><br /></p>', 'Superposen', '', '', '', 'superposen'),
(316, 'Dragon Fire', '<p>Et stk. 3" og 2 stk. 4" med stor guld- og blå buket<br />og stor flot guldbuket som daler mod jorden.<br /><br /></p>\r\n<p>NEM vægt: 206 g.</p>', 'Dragon Fire', '', '', '', 'dragon-fire'),
(317, 'Sølv Sortiment', '<p>Lækker fyrværkeripose med masser af fyrværkeri, <br />der giver underholdning til langt ud på aftenen.<br /><br /></p>\r\n<p>NEM vægt: 356 g.</p>', 'Sølv Sortiment', '', '', '', 'solv-sortiment'),
(318, 'Luksuspakke I', 'Fyrværkeri-sortiment til den kræsne "fyrværker".', 'Luksuspakke I', '', '', '', 'luksuspakke-i'),
(319, '', '<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;"><span style="font-size: 8pt; font-family: verdana,geneva; color: black;"><span style="color: black;">Et flot sortiment af fem flotte batterier samt et bomberør. <br />En flot effektfuld pakke til en god Nytårsaften.<br /><br /></span></span></p>\r\n<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;"><span style="font-size: 8pt; font-family: verdana,geneva; color: black;">NEM vægt: 1175 g.</span></p>', 'Megaposen', '', '', '', 'megaposen'),
(320, '', 'Junior fyrværkeri Mix. Super til en hyggelig Nytårsdag- <br />og aften.', 'Karrusel Mix', '', '', '', 'karrusel-mix'),
(321, '50 skuds batteri', '', '50 skuds batteri', '', '', '', '50-skuds-batteri'),
(337, 'Zeno', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Zeno Choco Terracotta Romantic', '', '', '', 'zeno-choco-terracotta-romantic'),
(333, 'Lilou', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling. </p>\r\n<p> </p>\r\n<p>Kommer igen til næste år!</p>', 'Lilou Choco Terracotta Classic', '', '', '', 'lilou-choco-terracotta-classic'),
(334, 'Darion Choco Terracotta', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Darion Choco Terracotta Classic', '', '', '', 'darion-choco-terracotta-classic'),
(335, 'Oliver', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Oliver Choco Terracotta Classic', '', '', '', 'oliver-choco-terracotta-classic'),
(336, 'Ismaele', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.</p>', 'Ismaele Choco Terracotta Romantic', '', '', '', 'ismaele-choco-terracotta-romantic'),
(359, 'Melon Potte Lys Terrecotta', '<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Melonpottens firkantede facon kendes i hele middelhavsområdet, og denne pottetype kan spores tilbage til det gamle Romerrige. Potten har især været anvendt til dyrkning af melonplanter. Dyrkning i urtepotte forhindrer råd og for tidlig modning. Melonpotten er kreeret efter gammel pottemagerteknik.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"><br />Alle potterne er inkl. underfade.<br /></span></p>', 'Melon Potte Lys Terrecotta', '', '', '', 'melon-potte-lys-terrecotta'),
(360, 'Melon', '<p>Melon-pottens firkantede facon kendes i hele middelhavs-<br />området, og denne pottetype kan spores tilbage til det gamle<br /> Romerrige. Potten har især været anvendt til dyrkning af me-<br />lonplanter. Dyrkning i urtepotte forhindrer råd og for tidlig <br />modning. Melon-potten er kreeret efter gammel pottemager-<br />teknik.</p>', 'Melon Grå Terrecotta', '', '', '', 'melon-gra-terrecotta'),
(361, 'Simona Lys Terracotta', '<p><span style="font-size: 8pt; color: #808080;">Omkring 1820-1860 var den franske Simona-potte en stor succes. Potten blev drejet hos en pottemager i latinerkvarteret i  Paris - hans navn er dog ukendt. Vores levrandør fandt urtepotten på et loppemarked på Montmartre og får den nu produceret </span><span style="font-size: 8pt; color: #808080;">i Toscana.</span></p>\r\n<p><span style="font-size: 8pt; color: #808080;"><br />Alle potter er inkl. underfade.<br /></span></p>', 'Simona Lys Terracotta', '', '', '', 'simona-lys-terracotta'),
(362, 'Simona Grå Terracotta', '<p>Omkring 1820-1860 var den franske Simona-potte en stor suc-<br />ces. Potten blev drejet hos en pottemager i latinerkvarteret i <br />Paris - hans navn er dog ukendt. Vores levrandør fandt urtepot-<br />ten på et loppemarked på Montmartre og får den nu produceret <br />i Toscana.</p>', 'Simona Grå Terracotta Ø14 cm inkl. underskål', '', '', '', 'simona-gra-terracotta-o14-cm-inkl-underskal_53ce25d549f3b'),
(363, 'Julie', '<p>Da designeren Ninetta Mariani skabte Julie-potten, udbrød <br />hun: ”Mere enkelt kan det ikke gøres”. Det var i Milano i <br />1960, og i dag kan vi kun give hende ret. I denne enkle og <br />charmerende potte vil planten altid være i fokus. (Inkl. <br />underskål). Julie Potten i lys fås kun til størrelse 21 cm.</p>', 'Julie Grå eller Lys Terracotta', '', '', '', 'julie-gra-eller-lys-terracotta'),
(364, 'Mattia', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> <br /><br /></span></strong></p>', 'Mattia Antique Terracotta', '', '', '', 'mattia-antique-terracotta'),
