(378, 'Flavia', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> <br /><br /></span></strong></p>', 'Flavia Antique Terracotta', '', '', '', 'flavia-antique-terracotta'),
(379, 'Bianca', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> <br /><br /></span></strong></p>', 'Bianca Antique Terracotta', '', '', '', 'bianca-antique-terracotta'),
(380, 'Gaia', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> <br /><br /></span></strong></p>', 'Gaia Antique Terracotta', '', '', '', 'gaia-antique-terracotta'),
(381, 'Akacie Tønde', '<p>Tønden er særdeles velegnet til beplantning, da træ har <br />naturlige isolerende egenskaber, hvorfor tønden bibeholder <br />en relativ konstant temperatur og fugt. Tønderne er frost-<br />sikre, hvis der bores drænhul i bunden. <strong><span style="color: #99cc00;"></span></strong></p>', 'Akacie Tønden', '', '', '', 'akacie-tonden'),
(815, 'Hampsted Sædehynde', '', 'Hampsted Sædehynder', '', '', '', 'hampsted-saedehynder'),
(384, 'Oceane let beton bord', '<p><strong><span style="color: #99cc00;">Super elegant bord til den lille hyggekrog<br /></span></strong>Bordet måler (80x80 cm) og er kreeret i let beton.</p>\r\n<p>Bordet kan stå ude hele året!</p>', 'Oceane bord Let Beton', '', '', '', 'oceane-bord-let-beton'),
(386, 'Frederico Terrazzo Krukke', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern i hjørnerne. <br /><br /></p>', 'Frederico Terrazzo Krukke', '', '', '', 'frederico-terrazzo-krukke'),
(387, 'Giosa Krukke', '<p><span class="Apple-style-span" style="font-family: ''book antiqua'', palatino; font-style: italic;"></span>Vores let beton krukker består af cement, sand, sten og vand <br />og for at gøre den lettere, er der nu tilsat additiver samt synte-<br />tiske fibre, som gør betonkrukken lettere, men stadig med en <br />stor hårdhed.<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"> (Beton blev oprindeligt opfundet af romerne for <br />mere <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">end tu<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">sind år siden og anvendes, som bekendt, i dag <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">til <br />mange forskellige <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">formål.)</span></span></span></span></span></p>', 'Giosa Let beton Krukke', '', '', '', 'giosa-let-beton-krukke'),
(653, 'Albertine - Black Soil Krukke 2014', '<p>Black Soil er fremstillet af en speciel lertype, hvis kemiske<br />sammensætning indeholder jern, hvilket gør produkterne<br /> meget stærke. Denne krukke er retteligt irgrøn!</p>\r\n<p>Mål: H168-Ø85 cm<br /><br /></p>', 'Albertine - Black Soil Krukke 2014', '', '', '', 'albertine-black-soil-krukke-2014'),
(388, 'Diego Terrazzo Krukke', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern. <br /><br style="color: #99cc00;" /><br /></p>', 'Diego Terrazzo Krukke', '', '', '', 'diego-terrazzo-krukke'),
(389, 'Ugle', 'Sød Ugle - der skaber lidt stemning i haven.<br /><span style="color: #99cc00;"><strong></strong></span>', 'Stor Ugle', '', '', '', 'stor-ugle'),
(390, 'Luciano 3x3M Parasol Olefin', 'Luksus 3x3 m Parasol med hardwood "White Wash" helstok <br />48 mm, læderforstærkninger og dobbelthejs. Endvidere er <br />dugen kreeret i 210 g/m2 Olefin - Vandafvisende....! Fås <br />nedenfor i farverne sort, taupe eller hvid.', 'Luciano 3x3 m Parasol Olefin', '', '', '', 'luciano-3x3-m-parasol-olefin'),
(391, 'Parasol Olefin', 'Luksus 3,30 m Parasol med tilt samt hardwood "White Wash" <br />helstok 48 mm, læderforstærkninger og dobbelthejs. Endvidere <br />er dugen kreeret i 210 g/m2 Olefin - Vandafvisende....! Fås <br />nedenfor i farverne sort, taupe eller hvid.', 'Picano Ø3,3 m Parasol Olefin', '', '', '', 'picano-o3-3-m-parasol-olefin'),
(660, 'Sacha let beton bord', '<p><strong><span style="color: #99cc00;">Super elegant Havebord<br /></span></strong>Bordet måler (80x80 cm) og er kreeret i let beton, der er<br />behandlet med voks. Bordet kan stå ude hele året.</p>', 'Sacha Let Beton Bord', '', '', '', 'sacha-let-beton-bord'),
(392, 'Papillion Havesæt', '<p>Timberstone bord kreeret af GRC beton forstærket med glas-<br />fiber og knust marmor samt 6 Paris "Grey Wash" polyrattan <br />Luksus stole - super flot sæt. På lager medio april.<br /><br /></p>\r\n<p>Bordet alene kan bestilles herunder til kr. 5.499,-</p>', 'Papillion Let Beton/Polyrattan', '', '', '', 'papillion-let-beton-polyrattan'),
(393, 'Bellevue Stol', '<p>Luksus stol, hvor stellet er i hvidmalet aluminium hertil fint-<br />slebet teak lameller - Super siddekomfort!</p>', 'Bellevue Stol', '', '', '', 'bellevue-stol_53ce25d629bcd'),
(394, 'Milano Stol', '<p>Super smuk fletstol i Luksus Polyrattan - inkl. hynde. Fantas-<br />tisk siddekomfort...! <br /><br /></p>', 'Milano Stol i Sandgrå', '', '', '', 'milano-stol-i-sandgra'),
(452, 'Bellevue Sæt', '<p>Luksussæt med 4 stabelstole og bord (Ø110xH73cm). Stel <br />i hvidmalet aluminium og fintslebet teak lameller.<br /><br />Design fra 1950''erne. Man kan kun drømme sig tilbage<br />til de gode gamle dage ....!</p>', 'Bellevue Luksus Havesæt', '', '', '', 'bellevue-luksus-havesaet'),
(395, 'Margot Sunlounger', 'Elegant sunlounger med trinløs ryg. Kreeret i hvidlakeret alu-<br />minium og off-white texteline. Målene er 200x70x38 cm.', 'Margot Sunlounger', '', '', '', 'margot-sunlounger_53ce25d6343c7'),
(396, 'Margot Havestol', '<p>Elegant stol i hvidlakeret aluminium og off-white texteline. <br />Super siddekomfort..!</p>', 'Margot Havestol', '', '', '', 'margot-havestol_53ce25d6372a8'),
(397, 'Zorba Havemøbelsæt', '<p>UDSTILLINGSMODEL med 8 stole<br />Bambusbord (Ø120xH72 cm) powder coating aluminiumsstel <br />samt 4 texteline stole med bambusarmlæn, hvor siddekom-<br />forten er helt i top.</p>', 'Zorba Havesæt Bambus/texteline', '', '', '', 'zorba-havesaet-bambus-texteline_53ce25d63a571'),
(767, 'Eliza Hyndeskab', '<p>Luksus hyndeskab til den pladskrævende familie..!<br /><br /></p>\r\n<p>Hyndeboksen indeholder to hylder, der kan tages ud. End-<br />videre findes Eliza i tre farver Sort, Natur og Grey-Wash.</p>\r\n<p><br />Mål: H120,5 cm-B140 cm-D70 cm</p>', 'Eliza Hyndeskab', '', '', '', 'eliza-hyndeskab'),
(398, 'Benton Havemøbelsæt', 'Fantastisk flot havesæt - Bordet er kreeret af Bambus med <br />white powder coating aluminiumsstel og måler 200x100x<br />H72 cm. Hertil 4 texteline aluminiumsstole med bambus- <br />armlæn - Super siddekomfort...! <strong><span style="color: #99cc00;"><a href="Solvogne/dakstole/Benton-Sunlounger/flypage.tpl.html"><span dir="ltr" spellcheck="false" id="tinymce" class="mceContentBody " contenteditable="true"></span></a></span></strong>', 'Benton Havesæt Bambus/texteline', '', '', '', 'benton-havesaet-bambus-texteline_53ce25d64071a'),
(177, 'Master-Touch® 67 cm', '<p style="margin-top: 0cm; margin-right: 2pt; margin-bottom: 2pt; margin-left: 2pt;"><span style="font-size: 8pt; font-family: Helvetica;">Master-Touch® 67 cm er toppen af poppen inden for de klassiske kuglegrill. 10-årigt garantiprogram, Grillareal: 67 cm i diameter, Praktisk lågholder, One-Touch™-rengøringssystem i rustfrit stål, 2 Char-Basket™-kulbakker, Topspjæld i aluminium, Rummelig askeskuffe, der nemt tages af og tømmes. Porcelænsemaljeret bund og låg, Nylonhåndtag med rustfrit varmeskjold, Revnesikrede, vejrbestandige hjul, Briketmålebæger, Fremstillet i USA, Farver: Sort. H: 109 cm, B: 84 cm, D: 69 cm.     </span></p>\r\n<p><span style="font-size: 8pt; font-family: Helvetica;"> <span style="font-size: 8pt; font-family: Helvetica;"></span></span></p>', 'Weber Master-Touch® 67 cm', '', '', '', 'weber-master-touch-67-cm'),
(178, 'Weber Performer® med gastænding', '<p><span style="font-family: Helvetica; font-size: 8pt;" class="Apple-style-span">Performer® med gastænding – en kulgrill med alskens luksus, der gør det nemt og hurtigt at få gang i briketterne. Tryk på knappen – og gassen antænder lynhurtigt kullene.</span></p>\r\n<p><span style="font-size: 8pt; font-family: Helvetica;">Produktspecifikation: 10-årigt garantiprogram, Grillareal: 57 cm i diameter, Termohærdet sidebord, Gastænding, der let antænder kullene, Char-Basket™-opbevaringsboks til eks. Briketter, Praktisk lågholder, 3 redskabsholdere, Integreret termometer i låget, One-Touch®-rengøringssystem, der gør det let at tømme grillen for aske, Rummelig askeskuffe i aluminium, 2 Char-Basket™-kulbakker, Porcelænsemaljeret bund og låg, Revnesikrede, vejrbestandige hjul, Fremstillet i USA, Farver: Sort, H: 109 cm, B: 119 cm, D: 66 cm.   </span></p>', 'Weber Performer® m. gast.', '', '', '', 'weber-performer-m-gast'),
(179, 'Weber Q® 100', '<p><span style="font-size: 8pt; font-family: Helvetica;">Weber Q® 100 er skabt til folk på farten. Uanset om du har båd, campingvogn eller blot skal have den med i bagagerummet på bilferien, klarer du nemt madlavningen i selskab med Weber Q® 100. Den kompakte letvægts-gasgrill er utrolig til at lave mindre retter som steaks, mørbrad, kyllingefiletter og andet, der skal grilles direkte. Weber Q® 100 er let at anvende, fylder ikke meget i bagagen – og passer både til små gasdåser og større gasflasker. Produktspecifikation: Brænder i rustfrit stål, Tænding ved tryk på knap, Trinløs regulering af varme, Grillrist i støbejern, Grillareal: 42,5 x 32 cm, Låg og bund af aluminium, Fremstillet i USA, Farver: Titanium og sort, H: 59,7 cm, B: 68,6 cm, D: 48 cm.   </span></p>', 'Weber Q® 100', '', '', '', 'weber-q-100'),
(180, 'Weber Q® 100 sort', '<p style="width: inherit; padding-top: 10px; padding-right: 2px; padding-bottom: 2px; padding-left: 5px; background-attachment: initial; background-color: initial; background-position: 0% 0%; background-repeat: no-repeat no-repeat; border-width: 1px; border-color: #bbbbbb; border-style: dashed; margin: 2px;"><span style="font-size: 8pt; font-family: Helvetica;">Weber Q® 100. Uanset om du har båd, campingvogn eller blot skal have den med i bagagerummet på bilferien, klarer du nemt madlavningen i selskab med Weber Q® 100. Den kompakte letvægts-gasgrill er utrolig til at lave mindre retter som steaks, mørbrad, kyllingefiletter og andet, der skal grilles direkte. Weber Q® 100 passer både til små gasdåser og større gasflasker. Produktspecifikation: Brænder i rustfrit stål, Tænding ved tryk på knap, Trinløs regulering af varme, Grillrist i støbejern, Grillareal: 42,5 x 32 cm, Låg og bund af aluminium, Fremstillet i USA, Farve: Sort, H: 59,7 cm, B: 68,6 cm, D: 48 cm.  </span></p>', 'Weber Q® 100 sort', '', '', '', 'weber-q-100-sort'),
(181, 'Weber Q® 200', '<p><span style="font-size: 8pt; font-family: helvetica;">Lige en tak større! Weber Q® 200, kan du nemt tage med dig på båden, i campingvognen eller bare i bilens bagagerum. Her på det fine grillareal har du masser af mulighed for at prøve kræfter med alt fra steaks og lækre stege til hele kyllinger og eksempelvis hjemmegrillet pizza – og de integrerede Flavorizer® Bars i grillristen sikrer den helt rigtige grillsmag. Produktspecifikation: Brænder i rustfrit stål, 2 arbejdsborde, der nemt foldes sammen og sparer plads, Tænding ved tryk på en knap, Trinløs regulering af varme, Grillrist i støbejern, Grillareal: 39 x 54 cm, 4 redskabsholdere, Låg og bund af aluminium, Fremstillet i USA, Farver: Titanium og sort, H: 66,1 cm, B: 80,5/130,6 cm, D: 61,6 cm.  </span></p>', 'Weber Q® 200', '', '', '', 'weber-q-200'),
(182, 'Weber Q® 300', '<p><span style="font-family: Helvetica;">Weber Q® 300 er flagskibet inden for veldesignede og moderne gasgrill. Her kan du grille både direkte og indirekte – præcist som på de store Spirit-, Genesis- og Summit-modeller – så gæsterne kan godt begynde at glæde sig til lækre stege, hele kyllinger eller måske friskbagt brød fra grillen. Specifikation: </span><span style="font-family: Helvetica;" class="Apple-style-span">2 brændere i rustfrit stål, 2 arbejdsborde, der nemt foldes sammen og sparer plads, Fastmonteret rullevogn, Termometer i låget, Tænding ved tryk på en knap, Trinløs regulering af varme, 2-delt grillrist i støbejern, Grillareal: 46 x 65 cm, 4 redskabsholdere, Låg og bund af aluminium, Vejrbestandige hjul, Farver: Titanium og sort. H: 140,9 cm, B: 92,7/140,3 cm, D: 76,2 cm.  </span></p>', 'Weber Q® 300', '', '', '', 'weber-q-300'),
(183, 'Weber Q® 300 sort', '<p><span style="font-family: Helvetica;">Weber Q® 300 er flagskibet inden for veldesignede og moderne gasgrill. Her kan du grille både direkte og indirekte – præcist som på de store Spirit-, Genesis- og Summit-modeller – så gæsterne kan godt begynde at glæde sig til lækre stege, hele kyllinger eller måske friskbagt brød fra grillen. Specifikation: 2 brændere i rustfrit stål, 2 arbejdsborde, der nemt foldes sammen og sparer plads, Fastmonteret rullevogn, Termometer i låget, Tænding ved tryk på en knap, Trinløs regulering af varme, 2-delt grillrist i støbejern, Grillareal: 46 x 65 cm, 4 redskabsholdere, Låg og bund af aluminium, Vejrbestandige hjul, Farver: Sort. H: 140,9 cm, B: 92,7/140,3 cm, D: 76,2 cm.  </span></p>', 'Weber Q® 300 sort', '', '', '', 'weber-q-300-sort'),
(184, 'Spirit® Classic E-210™', '<p><span style="font-size: 8pt; font-family: Helvetica;">Er du ude efter grill-sjov, kvalitet og et godt udgangspunkt for dine første erfaringer med en gasgrill? Så er Webers gasgrill Spirit® Classic E-210™ perfekt i din baghave. Du kan tilberede alverdens mad – samtidigt er begrænsningen, at du ikke vil kunne grille indirekte helt korrekt, da grillen kun har to brændere. Til gengæld gør det grillen utrolig nem at håndtere. Specifikation, 25-årigt garantiprogram, 2 rustfrie brændere, Porcelænsemaljerede grillriste Porcelænsemaljerede Flavorizer® Bars, Termometer i låget, Grillareal: 58 x 39 cm, 3 redskabsholdere, Revnesikrede, vejrbestandige hjul, H: 151 cm, B: 131 cm, D: 71 cm.   </span></p>', 'Spirit® Classic E-210™', '', '', '', 'spirit-classic-e-210'),
(185, 'Spirit® Classic E-310™', '<p><span style="font-family: Helvetica;" class="Apple-style-span">Den giver dig alle muligheder for at tænde op og hurtigt komme i gang med at udforske dét at lave mad på gas. Og så har den tilmed tre brændere – noget der sikrer, at du kan tilberede alverdens mad med alle de forskellige grillmetoder. Specifikation: 25-årigt garantiprogram, 3 rustfrie brændere, Porcelænsemaljerede grillriste, Porcelænsemaljerede Flavorizer® Bars, Termometer i låget, Grillareal: 64 x 44 cm, 3 redskabsholdere, Revnesikrede, vejrbestandige hjul. H: 160 cm, B: 137 cm, D: 76 cm.  </span></p>', 'Spirit® Classic E-310™', '', '', '', 'spirit-classic-e-310'),
(186, 'Spirit® Classic E‐320™', '<p><span style="font-size: 8pt; font-family: Helvetica;">Grillen har tre brændere – noget, der for alvor giver dig mulighed for at prøve de forskellige grillmetoder af – og så får du et gasblus oven i hatten, så du kan tilberede kartoflerne eller saucen, mens kødet hygger på grillristen. Specifikation, 25-årigt garantiprogram, 3 rustfrie brændere, 1 gasblus, Porcelænsemaljerede grillriste, Porcelænsemaljerede Flavorizer® Bars, Termometer i låget, Grillareal: 64 x 44 cm, 3 redskabsholdere, Revnesikrede, vejrbestandige hjul, H: 160 cm, B: 137 cm, D: 76 cm.   </span></p>', 'Spirit® Classic E‐320™', '', '', '', 'spirit-classic-e-320'),
(188, 'Genesis® E310', '<p><span style="font-size: 8pt; font-family: Helvetica;">Grillen med det imponerede grillareal og et overflødighedshorn af tilbehør. Der er ikke noget at sige til, at Genesis® E310 sammen med storebroderen E320 lynhurtigt er blevet en af danskernes foretrukne gasmodeller. Specifikation: 25-årigt garantiprogram, 3 rustfrie brændere, Emaljerede støbejerns grillriste, Porcelænsemaljerede Flavorizer® Bars, Porcelænsemaljeret låg med integreret termometer, Grillareal: 66 x 50 cm, Arbejdsborde i rustfrit stål, Elektronisk tænding, Trinløs regulering, 6 redskabsholdere. H: 164 cm, B: 152 cm, D: 76 cm.   </span></p>', 'Genesis® E310', '', '', '', 'genesis-e310'),
(812, 'Rømø Bålsted', '<p>Super lækkert Bålsted til de hyggelige aftener<br /><br />Mål: Ø52/40 cm-H50 cm-33 cm fod</p>', 'Rømø Bålsted - Dansk & Håndlavet', '', '', '', 'romo-balsted-dansk-handlavet'),
(358, 'Helena', '<p>I Lazio-regionen nord for Rom ligger byen Di Bolzena, som <br />engang var hjemsted for mange pottemagere. En af de før-<br />ende, Roberto Rosso, skabte en urtepotte med en karakteris-<br />tisk blondekant inspireret af det antikke Grækenland. Potten <br />var en stor succes i Italien i 1800-tallet men gik dog af mode. <br />Nu får vores leverandør den igen produceret i Toscana. (Inkl.<br />underskål)</p>', 'Helena Grå Terracotta', '', '', '', 'helena-gra-terracotta'),
(250, 'Bellevue Sæt', '<p>Luksussæt med 4 stabelstole og bord (Ø110xH73cm). Stel <br />i hvidmalet aluminium og fintslebet teak lameller.<br /><br />Design fra 1950''erne. Man kan kun drømme sig tilbage<br />til de gode gamle dage ....!</p>', 'Bellevue Luksus Havesæt', '', '', '', 'bellevue-luksus-havesaet_53ce25d69009d'),
(189, 'Genesis® 330™', '<p><span style="font-family: Helvetica;" class="Apple-style-span">Som noget nyt har grillen en smart, integreret sear station, hvor du blandt andet kan give dine bøffer og steaks perfekte grillmønstre. Specifikation: 25-årigt garantiprogram, 3 rustfrie brændere, Sear station, Gasblus, Frontmonterede knapper, Emaljerede støbejerns-grillriste, Porcelænsemaljerede Flavorizer® Bars, Porcelænsemaljeret låg med integreret termometer, Termolåg, Grillareal: 66 x 50 cm, Arbejdsborde i rustfrit stål, Sortlakerede låger, Elektronisk tænding, Trinløs regulering, 6 redskabsholdere. H: 164 cm, B: 152 cm, D: 76 cm.</span></p>', 'Genesis® 330™', '', '', '', 'genesis-330'),
(191, 'Genesis® 330™', '<p><span style="font-family: helvetica; font-size: 8pt;">Som noget nyt har grillen en smart, integreret sear station, hvor du blandt andet kan give dine bøffer og steaks perfekte grillmønstre. Specifikation: 25-årigt garantiprogram, 3 rustfrie brændere, Sear station, Gasblus, Frontmonterede knapper, Emaljerede støbejerns-grillriste, Porcelænsemaljerede Flavorizer® Bars, Porcelænsemaljeret låg med integreret termometer, Termolåg, Grillareal: 66 x 50 cm, Arbejdsborde i rustfrit stål, Sortlakerede låger, Elektronisk tænding, Trinløs regulering, 6 redskabsholdere. H: 164 cm, B: 152 cm, D: 76 cm.</span></p>', 'Genesis® 330™', '', '', '', 'genesis-330_53ce25d6971e6'),
(190, 'Genesis® S-310™', '<p><span style="font-size: 8pt; font-family: Helvetica;">Det er intet under, at Genesis® S-310™ lynhurtigt er blevet en af danskernes foretrukne gasmodeller – her kan du nyde godt design, geniale grillegenskaber og høj brugervenlighed i en og samme grill. Specifikation: 25-årigt garantiprogram, 3 rustfrie brændere, Frontmonterede knapper, Emaljerede støbejerns-grillriste, Porcelænsemaljerede Flavorizer® Bars, Porcelænsemaljeret låg med integreret termometer, Termolåg, Grillareal: 66 x 50 cm, Arbejdsborde i rustfrit stål, Elektronisk tænding, Trinløs regulering, 6 redskabsholdere. H: 164 cm, B: 152 cm, D: 76 cm.</span></p>', 'Genesis® S-310™', '', '', '', 'genesis-s-310'),
(192, 'Weber® Luksusbetræk 57 cm', '<p>Beskyt din Weber grill med et luksusbetræk. Alle grill fra Weber er dog bygget til at stå ude hele året og i alt slags vejr, men er nemmere at holde rene og pæne uden besvær med et betræk.</p>', 'Weber® Luksusbetræk 57 cm', '', '', '', 'weber-luksusbetraek-57-cm'),
(193, 'Weber® Luksusbetræk Q200', '<p>Beskyt din Weber grill med et luksusbetræk. Alle grill fra Weber er dog bygget til at stå ude hele året og i alt slags vejr, men er nemmere at holde rene og pæne uden besvær med et betræk.</p>', 'Weber® Luksusbetræk Q200', '', '', '', 'weber-luksusbetraek-q200'),
(194, 'Weber® Luksusbetræk Q200', '<p>Beskyt din Weber grill med et luksusbetræk. Alle grill fra Weber er dog bygget til at stå ude hele året og i alt slags vejr, men er nemmere at holde rene og pæne uden besvær med et betræk.</p>', 'Weber® Luksusbetræk Q200', '', '', '', 'weber-luksusbetraek-q200_53ce25d6a3151'),
(195, 'Weber® Luksusbetræk Q300', '<p>Beskyt din Weber grill med et luksusbetræk. Alle grill fra Weber er dog bygget til at stå ude hele året og i alt slags vejr, men er nemmere at holde rene og pæne uden besvær med et betræk.</p>', 'Weber® Luksusbetræk Q300', '', '', '', 'weber-luksusbetraek-q300'),
(196, 'Weber® Luksusbetræk E7S-300', '<p>Beskyt din Weber grill med et luksusbetræk. Alle grill fra Weber er dog bygget til at stå ude hele året og i alt slags vejr, men er nemmere at holde rene og pæne uden besvær med et betræk.</p>', 'Weber® Luksusbetræk E/S-300', '', '', '', 'weber-luksusbetraek-e-s-300'),
(197, 'Weber® Luksusbetræk 67 cm', '<p>Beskyt din Weber grill med et luksusbetræk. Alle grill fra Weber er dog bygget til at stå ude hele året og i alt slags vejr, men er nemmere at holde rene og pæne uden besvær med et betræk.</p>', 'Weber® Luksusbetræk 67 cm', '', '', '', 'weber-luksusbetraek-67-cm'),
(198, 'Burny Bullet Shape', '<p><span style="font-family: helvetica; font-size: 8pt;">Specialudgave inkl. vippebeslag og hjul.</span></p>\r\n<p><span style="font-family: helvetica; font-size: 8pt;">- Rustfri</span></p>\r\n<p><span style="font-family: helvetica; font-size: 8pt;">- 13 kW</span></p>\r\n<p><span style="font-family: helvetica; font-size: 8pt;">- Ø95 cm.</span></p>', 'Burny Bullet Shape', '', '', '', 'burny-bullet-shape'),
(199, 'Burny, Bullet Shape sort', '<span style="font-family: helvetica; font-size: 8pt;">Rustfrit hoved - 13 kW - Ø82 cm.</span>', 'Burny, Bullet Shape sort', '', '', '', 'burny-bullet-shape-sort'),
(200, 'Flame Heather', 'Inkl. hjulsæt, 9,3 kW, 208 cm.', 'Flame Heather', '', '', '', 'flame-heather'),
(201, 'Gavekort', '<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;"> Nedenfor vælges beløb på Gavekortet.</p>\r\n<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;"> </p>', 'Gavekort', '', '', '', 'gavekort'),
(274, '', '<p>En tidløs stil kombineret med mange smarte detajler <br />hæver disse plastmøbler til et ekslusivt niveau og der <br />er et stort udvalg. Møblerne er produceret i et materi-<br />ale, som er slidstærkt, robust og meget nemt at ved-<br />ligeholde. Toscana Bord med hul til parasol (95x165 cm) <br />samt 6 Flora 5 pos.stole.</p>', 'Flora/Toscana', '', '', '', 'flora-toscana'),
(273, 'Nardi Loto Dinner Ø170 cm', '<p>Elegante designermøbler i lette og vedligeholdelsesfrie <br />materialer. Stellet er af aluminium, stolen af plast og<br /> den flotte bordplade er udført i kraftigt tempereret glas <br />med hvide eller sorte striber. Flot, anderledes og sindsygt<br /> lækkert! Bordets mål: Ø 170 cm, inkl. 8 stole.</p>', 'Nardi Loto Dinner Ø170 cm', '', '', '', 'nardi-loto-dinner-o170-cm'),
(272, 'Juliette let beton bord', '<p><strong><span style="color: #99cc00;">Super elegant Havebord<br /></span></strong>Bordet måler (160x80 cm) og er kreeret i let beton, der er<br />behandlet med voks.<br /><br /></p>\r\n<p>Bordet kan stå ude hele året!</p>', 'Juliette Let Beton Bord', '', '', '', 'juliette-let-beton-bord'),
(819, 'Escape Sunlounge', '<p>Escape solvogn er komfort, når det er bedst, uanset om du sidder og læser en god bog eller ligger og nyder solen.<br /><br /></p>\r\n<p>Escape solvogn blev oprindeligt  skabt til et hotelprojekt i Caribien af den unge danske industridesigner Rikke Frost, der kontaktede Cane-line med sin idé. Designet var så specielt, at Cane-line ganske enkelt var nødt til at gå videre med projektet. Med sine runde og organiske former passer Escape solvogn til den moderne indretning i uderummet.<br /><br /></p>\r\n<p>Bredde: 72 cm-Højde 103 cm-Dybde 217 cm-Sædehøjde 28 cm.<br /><br /></p>\r\n<p>Nedenfor kan vælges flere hynder</p>', 'Escape Sunlounge', '', '', '', 'escape-sunlounge'),
(820, 'Chester Loungemøbler', '<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Chester lounge havemøbler indbyder til ren afslapning og passer både til en romantisk have eller til den store moderne tagterrasse. Chester serien indeholder en rummelig 3 personers lounge sofa, en komfortabel lounge stol, og en praktisk forskammel som også kan bruges som sofa bord. </span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Alle flettede Chester lounge havemøbler er naturligvis vedligeholdelsesfrie og fås i 2 forskellige flet farver - Natur og Graphit.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;"><strong><span style="color: #808000;"><a href="images/stories/grapfic.jpg"><span style="color: #808000;">Se Loungesættet i Graphit her!</span></a></span></strong><br /></span></p>\r\n</div>', 'Chester Loungemøbler', '', '', '', 'chester-loungemobler'),
(329, 'Elena Terracotta', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Elena Choco Terracotta Classic', '', '', '', 'elena-choco-terracotta-classic'),
(352, 'Galestro', '<p>Galestro er navnet på en bestemt lertype, men hvorfra <br />den har fået dette navn vides ikke. Vores Galestro-potte<br /> er konisk rund, den står fast og fremstår enkel og smuk.<br />Potten fremstilles i Toscana og er meget solgt i Italien.</p>', 'Galestro Rosa Terracotta', '', '', '', 'galestro-rosa-terracotta'),
(875, 'Mogolian Goatskin - Dusty brown', '<p><span class="hps">Disse <span class="hps">gedeskind <span class="hps">er kendt for deres <span class="hps">silkeagtige hår <span class="hps">og <span class="hps">blød <span class="hps">Cashmere underuld!<span class="hps"><span class="hps"></span></span></span></span></span></span></span></span></span></p>', 'Mogolian Goatskin - Dusty brown', '', '', '', 'mogolian-goatskin-dusty-brown'),
(353, 'Galestro', '<p>Galestro er navnet på en bestemt lertype, men hvorfra <br />den har fået dette navn vides ikke. Vores Galestro-potte<br /> er konisk rund, den står fast og fremstår enkel og smuk.<br />Potten fremstilles i Toscana og er meget solgt i Italien.</p>\r\n<p>(Inkl. underfad)</p>', 'Galestro Grå Terracotta', '', '', '', 'galestro-gra-terracotta'),
(354, 'Filippa', '<p><span style="color: #808080; font-family: verdana,geneva; font-size: 8pt;">Mellem Lucca og Firenze i Toscana ligger potteriet Bitossi. Her har man igennem fem generationer fabrikeret alle former for potter. Vores leverandør har udvalgt denne enkle og smukke form og får den nu produceret på ”eget” toscanske potteri.</span></p>\r\n<p><span style="color: #808080; font-family: verdana,geneva;"><br /><span style="font-size: 8pt;">Inkl. underfad.</span><br /></span></p>', 'Filippa Grå Terracotta 38 cm', '', '', '', 'filippa-gra-terracotta-38-cm'),
(355, 'Emilia', '<p>Lidt nord for Bologna finder man byen Modena, hvor Emilia-<br />potten er blevet produceret siden 1800-tallet. Pottens karak-<br />teristiske rebkant er inspireret af det gamle Romerrige. Kruk-<br />ken bliver I dag fremstillet i Toscana efter gammel teknik.</p>', 'Emilia Lys Terracotta', '', '', '', 'emilia-lys-terracotta'),
(221, 'Camille Terracotta', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet. Fås i Choco eller rød ler<strong>.<span style="color: #99cc00;"><br /></span></strong></p>', 'Camille Choco Terracotta Romantic', '', '', '', 'camille-choco-terracotta-romantic'),
(530, 'Marseille sæbe Fruits D''epices 500 ml', 'Denne skønne spicy fruit Marseille sæbe er lavet efter en <br />gammel tradition i Marseille, af en master soapmaker, kogt <br />i en stor gryde, med copra olie. Copra er tørret kød eller <br />kerne, af kokosnødden. Kokosolie er udvundet fra det og <br />har gjort Copraolie et vigtigt landbrugsprodukt for mange <br />kokos-producerende lande. Sæben indeholder det naturlige <br />glycerin, som tillader det at rense din hud blidt. Denne sæbe <br />indeholder ikke animalsk fedtstoffer eller syntetisk overflade-<br />aktiver. Parfumen indeholder: æteriske olie af kardemomme,<br />Ylang, litsea cubeba Patchouli, Davan, lemon, cumin og eu-<br />calyptus<em>. INGEN: Parabener eller Phenoxyethanoel over 95% <br />naturlige </em><em>ingredienser.</em>', 'Marseille sæbe Fruits D''epices 500 ml', '', '', '', 'marseille-saebe-fruits-d-epices-500-ml'),
(670, 'Pindsvin Choco Terracotta', '<p>Choco Terracotta er æltet sammen af forskellige slags ler, <br />hvilket giver den smukke beige/jord farve. Leret graves ud <br />af det frodige Mekong delta, hvor der til stadighed aflejres <br />masser af ler fra deltaet.<br /><br /></p>\r\n<p><strong><span style="color: #99cc00;">På lager ultimo februar 2014..!</span></strong></p>', 'Pindsvin Choco Terracotta', '', '', '', 'pindsvin-choco-terracotta'),
(663, 'Olielampe i sort Terrazzo', '<p>Terrazzo lampen er produceret med cement iblandet knust <br />granit. Olielampen er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. <br /><br /></p>', 'Olielampe i sort Terrazzo', '', '', '', 'olielampe-i-sort-terrazzo');
INSERT INTO `i63il_virtuemart_products_da_dk` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(795, 'Franck Teakbord med X-ben', '<p>Super lækkert og Rustikt Teakbord Dinningtable på L220x<br />B100xH74 cm (ses her sammen med Zoe polyrattan stol) <br />Fås også som Loungebord på L120xB65xH50 cm.<br /><br /></p>\r\n<p>Bordet kan stå ude hele året!<br /><br /></p>', 'Franck Teakbord med X-ben', '', '', '', 'franck-teakbord-med-x-ben'),
(789, 'Mirabelle Diningtable i White-wash', '<p>Super romantisk serie i White-wash polyrattan flet med en <br />topplade af kraftigt glas. <br /><br />Bordet fås i to størrelser: (150x90x73 cm) og <br />(220x100x73 cm)<br /><br class="mceVisualAid mceVisualGuides" />Hele serien kan stå ude hele året ...!<br /><br /></p>', 'Mirabelle Diningtable i White-Wash', '', '', '', 'mirabelle-diningtable-i-white-wash'),
(790, 'Mirabelle Stol', '<p>Super Romantisk serie i White-Wash polyrattan flet. <br />Stolen - der er en af flere modeller i denne serie - <br />måler: H86-B60-D69 cm.<br /><br /></p>\r\n<p>Stolen er inkl. beige hynde og har en siddekomfort der er <br />helt i top.</p>\r\n<p><br />Denne serie kan stå ude hele året ...!<br /><br /></p>\r\n<p> </p>\r\n<p> </p>', 'Mirabelle Stol White-Wash', '', '', '', 'mirabelle-stol-white-wash'),
(495, 'Grå dækstolshynde', 'Dækstolshynder i flere farver.', 'Grå dækstolshynde', '', '', '', 'gra-daekstolshynde'),
(325, 'Det lille italienske Cafésæt', 'Sødt lille Cafésæt bestående af bord (Ø70) samt to stole<br />ekskl. hynder, hvor siddekomforten er i top. Sættet er i <br />mørkebrunt polyrattan.', 'Det lille italienske Cafésæt', '', '', '', 'det-lille-italienske-cafesaet'),
(326, 'Paolo polyrattan stol', '<p>Super flot stol i sort læderlook (polyrattan) ekskl. <br />hynde i sort. Super siddekomfort!<br /><br /></p>', 'Paolo polyrattan stol', '', '', '', 'paolo-polyrattan-stol'),
(470, 'Rosenborg Bænkhynde', '<p>Super flot Bænkhynde i stribet blå og hvid. 100% cotton. <br />Størrelsen på hynden er: 150x45 cm.</p>', 'Rosenborg Bænkhynde', '', '', '', 'rosenborg-baenkhynde'),
(226, 'Chloé Terracotta', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved den rette behandling.<strong><span style="color: #99cc00;"><br /></span></strong></p>', 'Chloé Choco Terracotta Romantic', '', '', '', 'chloe-choco-terracotta-romantic'),
(836, 'Cameron bord med x-ben', '<p>Dejligt rustikt Teakbord, der er blevet sandblæst og hvidpig-<br />menteret - så det står helt råt og lækkert!</p>\r\n<p> </p>\r\n<p>Bordets mål: L220 cm-H75 cm-B95 cm.</p>', 'Cameron bord med X-ben', '', '', '', 'cameron-bord-med-x-ben'),
(228, 'Sarah Terracotta', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags <br />ler, hvilket giver den smukke beige/jord farve. Leret graves ud <br />af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet. Vores krukker er frostsikre ved korrekt be-<br />handling. </p>\r\n<p><b><br /></b></p>', 'Sarah Choco Terracotta Romantic', '', '', '', 'sarah-choco-terracotta-romantic'),
(230, 'Léa Terracotta', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slag ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.</p>\r\n<p><b><br /></b></p>', 'Léa Choco Terracotta Classic', '', '', '', 'lea-choco-terracotta-classic'),
(253, 'Margot Havesæt', '<p>Elegant Havemøbelsæt kreeret i hvidlakeret aluminium og <br />off-white texteline, bordet gemmer en udtræksplade, der <br />med et snuptag køres let ud ved at trække i den ene ende <br />af bordpladen. Bordet måler: L180/240xB100xH76 cm. Her-<br />til leveres 6 stole med en siddekomfort i top!</p>', 'Margot Havesæt', '', '', '', 'margot-havesaet_53ce25d76af0d'),
(328, 'Antoine Loungesæt i Royal Grey', '<p>Fantastisk loungesæt i luksus polyrattan flet i farven<br /> Royal Grey. Luksussættet er inkl. hynder i en duche <br />sandfarve. Super siddekomfort! <br /><br /></p>', 'Antoine Loungesæt i Royal Grey', '', '', '', 'antoine-loungesaet-i-royal-grey'),
(816, 'Sæde- og ryghynde til Derby/Lansing/Cornell', 'Mål på sædehynden: B49-H7,2-D48 cm.<br /><br />Til sædehynderne fås også ryghynde i farverne <br />(Sort, hvid, chocolate og Taupe)<br /><br />', 'Sædehynde til Derby/Lansing/Cornell', '', '', '', 'saedehynde-til-derby-lansing-cornell'),
(322, 'Margrethe Krukken 2013', '<p>Smuk stentøjskrukke der er frostsikret ved den rette <br />behandling.<br /><br /></p>\r\n<p><strong><span style="color: #99cc00;"><br /></span></strong></p>', 'Margrethe Krukken 2013', '', '', '', 'margrethe-krukken-2013'),
(233, 'Mathis Terrazzo Krukke', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern i hjørnerne. <span><strong><br /><br /></strong></span></p>', 'Mathis Terrazzo Krukke', '', '', '', 'mathis-terrazzo-krukke'),
(251, 'Paris Havesæt', '<p>Fantastisk flot sæt, hvor der ikke er gået på kompromis med<br />kvaliteten. Bordet der måler L220xB100XH73 cm har et hvid-<br />lakeret alu.stel og en bordplade i fintslebet Bambus. Til sættet <br />er 6 Paris Luksus polyrattan stole i "Grey Wash" inkl. hynder <br />i farven natur.<span style="color: #99cc00;"><strong> <br /></strong></span></p>', 'Paris Havesæt Bambus/polyrattan', '', '', '', 'paris-havesaet-bambus-polyrattan'),
(235, 'Manon Terracotta Krukke', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud <br />af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet. Vores krukker er frostsikre ved korrekt be-<br />handling.<br /><br /><strong><span style="color: #99cc00;"> </span></strong></p>', 'Manon Choco Terracotta Classic', '', '', '', 'manon-choco-terracotta-classic'),
(236, 'Ines Terracotta Krukke', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>', 'Ines Choco Terracotta Classic', '', '', '', 'ines-choco-terracotta-classic'),
(252, 'Rayan Havesæt', '<p>Teak foldebord med hvid fuge - super smukt bord!</p>\r\n<p>Der medfølger 4 polyrattan stole (white wash) <br />inkl. hynder.</p>\r\n<p><br />Måler: L180xB95xH73 cm.</p>', 'Rayan Havesæt', '', '', '', 'rayan-havesaet'),
(237, 'Krukkefad H5-D30', '', 'Krukkefade i sort Terrazzo', '', '', '', 'krukkefade-i-sort-terrazzo'),
(238, 'Théo Choco Terracotta Classic', '<p><span style="font-size: 8pt; font-family: verdana,geneva;">Choco Terracotta krukker er æltet sammen af forskellige slags ler, <br />hvilket giver den smukke beige/jord farve. Leret graves ud af det <br />frodige Mekong delta, hvor der til stadighed aflejres masser af ler <br />fra deltaet. <br /><br /></span></p>', 'Théo Choco Terracotta Classic', '', '', '', 'theo-choco-terracotta-classic'),
(239, 'Yanis Choco Terracotta Classic', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slag ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.</p>', 'Yanis Choco Terracotta Classic', '', '', '', 'yanis-choco-terracotta-classic'),
(240, 'Mathéo Terracotta Krukke 4 str.', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud <br />af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet. Vores krukker er frostsikre ved korrekt be-<br />handling.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Mathéo Choco Terracotta Romantic', '', '', '', 'matheo-choco-terracotta-romantic'),
(241, 'Maxime Terracotta Krukke 3 str.', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slag ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. <strong><span style="color: #99cc00;"></span></strong></p>', 'Maxime Choco Terracotta Classic', '', '', '', 'maxime-choco-terracotta-classic'),
(243, 'Gabriel Terracotta Krukke', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.</p>', 'Gabriel Choco Terracotta Classic', '', '', '', 'gabriel-choco-terracotta-classic'),
(254, 'Imperia Hynde', '<p>Super flot hynde i stribet blå og hvid 100% cotton.</p>\r\n<p>Str. 40x40 cm.</p>', 'Imperia Hynde', '', '', '', 'imperia-hynde'),
(245, 'Léo Terracotta Krukke 4 str.', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags <br />ler, hvilket giver den smukke beige/jord farve. Leret graves ud <br />af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet. Vores krukker er frostsikre ved korrekt be-<br />handling.<strong><span style="color: #99cc00;"> <br /></span></strong></p>\r\n<p> </p>\r\n<p><b><br /></b></p>', 'Léo Choco Terracotta Classic', '', '', '', 'leo-choco-terracotta-classic'),
(357, 'Helena', '<p>I Lazio-regionen nord for Rom ligger byen Di Bolzena, som <br />engang var hjemsted for mange pottemagere. En af de før-<br />ende, Roberto Rosso, skabte en urtepotte med en karakteris-<br />tisk blondekant inspireret af det antikke Grækenland. Potten <br />var en stor succes i Italien i 1800-tallet men gik dog af mode. <br />Nu får vores leverandør den igen produceret i Toscana.</p>', 'Helena Lys Terracotta', '', '', '', 'helena-lys-terracotta'),
(255, 'Pierre Altan- & Havesæt', '<p><span style="font-family: verdana,geneva; font-size: 8pt;">Lækkert lille sammenklappeligt havebord samt 2 folde-<br />stole med armlæn, der passer ideelt til den lille have eller <br />altanen. Bordet er af maghogni - coating: PU lacquer (High-<br />gloss). Bordets mål er 70x70 cm. </span></p>', 'Pierre Altan- & Havesæt', '', '', '', 'pierre-altan-havesaet_53ce25d7de2e8'),
(247, 'Jules Terracotta Krukke 3 str.', '<p>Vores smukke terracotta får vi nu produceret med en <br />smuk antik overflade, således at krukkerne er født med <br />den smukke patina som det ofte tager lang tid at opnå <br />på sine krukker. Vores krukker er frostsikre ved korrekt be-<br />handling.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Jules Antique Terracotta', '', '', '', 'jules-antique-terracotta'),
(248, 'Maëlle Terracotta Krukke H73-Ø57', '<p><strong></strong>(H73-Ø57) Vores smukke terracotta får vi nu produceret med <br />en rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<strong><span style="color: #99cc00;"> <br /><br /></span></strong></p>', 'Maëlle Antique Terracotta', '', '', '', 'maelle-antique-terracotta'),
(782, 'Tor Parasolfod 50 kg', 'Denne Granitfod, der måler Ø50 cm passer til parasoller, hvis <br />stok måler 35-48 mm. Parasolfoden har to hjul så den er let og <br />flytte rundt med.', 'Tor Parasolfod 50 kg', '', '', '', 'tor-parasolfod-50-kg'),
(256, 'Cafésæt Martin', '<p>Cafébord med 2 klapstole i sortlakeret træ.<br />Dejligt lille sæt til den lille have eller altanen.<br /><br /></p>\r\n<p>Kommer igen til marts!</p>', 'Cafésæt Martin', '', '', '', 'cafesaet-martin'),
(832, 'Breeze Stabelstol', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Breeze havemøbel kollektionen fra designerne Strand+Hvass er en af vores nyeste havemøbel serier. Havestolen er elegant og opbygget over en klassisk rørkonstruktion, som giver stolen en unik lethed og elegance. Stolen er fremstillet i Cane-line fiber, der gør den vejrbestandig og praktisk talt vedligeholdelsesfri. Vi anbefaler dog almindelig rengøring for at bevare stolene flotte og elegante.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Vi anbefaler at tildække Breeze havestolene med et møbelovertræk, hvis de ikke bliver brugt over længere tid, f.eks. i vintersæsonen.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Breeze serien er dansk design og kvalitetshåndværk og er udført i vejrbestandige og vedligeholdelsesfrie materialer.</span><br /><br /></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Mål: B60 cm-H83 cm-D61 cm-Sædehøjde 45 cm.</span></p>\r\n</div>\r\n</div>', 'Breeze Havestol m/armlæn', '', '', '', 'breeze-havestol-m-armlaen'),
(258, 'Albert Altansæt', 'Sættet består af bord (Ø60 cm) og 2 stole i <br />jern/mosaik.', 'Albert Altansæt', '', '', '', 'albert-altansaet'),
(259, 'Cafésæt Mille', '<p>Super sødt og let cafésæt bestående af bord (Ø60 cm)</p>\r\n<p>og 2 stabelstole i aluminium og sort polywood.</p>', 'Cafésæt Mille', '', '', '', 'cafesaet-mille'),
(260, 'Josefine Have- & Cafésæt', 'Sættet der er lavet i jern består af 2 stole og bord <br />der måler (70x70 cm). Flot sæt!', 'Josefine Have- & Cafésæt', '', '', '', 'josefine-have-cafesaet'),
(261, 'Bellevue Cafésæt', '<p>Super skønt lille sæt for den kræsne...! Sættet består af <br />to stole og et bord, der måler Ø70 cm - designet i 1950''erne.</p>', 'Bellevue Cafésæt', '', '', '', 'bellevue-cafesaet_53ce25d8069b7'),
(262, 'Sinai Stol Grey-Wash', 'Luksus polyrattan stol med super siddekomfort. Stolen fås<br /> i "White wash og Grey-Wash" polyrattan og er inkl. hynde i<br />farven natur.', 'Sinai Stol Grey-Wash', '', '', '', 'sinai-stol-grey-wash'),
(280, 'Georg Luksus (Indstillelig ryg)', 'Super lækker luksus polyrattan stol med indstillelig <br />ryg. Fås i farverne sort og natur. Vedligeholdelesesfri!', 'Georg Luksus (Indstillelig ryg)', '', '', '', 'georg-luksus-indstillelig-ryg'),
(788, 'Mirabelle Dinningtable i Brown-Wash', '<p>Super romantisk serie i Brown-wash polyrattan flet med en <br />topplade af kraftigt glas. <br /><br />Bordet måler: H73 cm, L150 cm, B90 cm.</p>\r\n<p><br />Hele serien kan stå ude hele året ...!<br /><br /></p>', 'Mirabelle Dining table i Brown-Wash', '', '', '', 'mirabelle-dining-table-i-brown-wash'),
(785, 'Cécille White Wash Teakbord', '<p>Super lækkert sandblæst og derefter hvidpigmenteret Teak-<br />bord i et dejligt rustikt look og samtidig med en overflade <br />der er blød og lækker. Dette bord fås i Ø130 cm, Ø150 cm<br /> og Ø180 cm til sidstnævnte medfølger en Lazy Susi..!<br /><br /><br /></p>\r\n<p><a href="images/stories/1958_circus.jpg"><strong><span style="color: #808000;">Se yderligere detaljer her!</span></strong></a></p>', 'Cécille White Wash Teakbord', '', '', '', 'cecille-white-wash-teakbord'),
(292, 'Det engelske Havesæt', '<p>Flot havesæt bestående af bord (165x80), bænk og 2 stole. <br />Fås i teak eller sortlakeret mahogny.</p>\r\n<p>Her får man et strejf af den engelske kolonistil.</p>', 'Det Engelske Havesæt', '', '', '', 'det-engelske-havesaet'),
(133, 'Oristano Terracotta krukke', '<p>Krukken er produceret i special ler, som brændes ved ca. 20 %<br /> mere varme end normale terracotta krukker, dette gør terracotta <br />krukken mindre porøs end normale terracotte krukker, <br />samtidig med at den bliver mere vejrbestandig.</p>', 'Oristano Choco Terracotta Classic', '', '', '', 'oristano-choco-terracotta-classic'),
(350, 'Københavner Potten', '<p>Fra 1860 og frem til 1950-60 blev der fabrikeret mange ler-<br />urtepotter i Danmark. Et af de mindre potterier, der havde til <br />huse i København, fremstillede denne potte i ca. 50 år. Vores<br /> leverandør fandt denne gamle lerpotte i et nedlagt gartneri <br />og får den nu produceret nær Lucca i Toscana. (Inkl. underskål)</p>', 'Københavner Potten Rosa', '', '', '', 'kobenhavner-potten-rosa'),
(351, 'Københavner Potten Grå', '<p>Fra 1860 og frem til 1950-60 blev der fabrikeret mange ler-<br />urtepotter i Danmark. Et af de mindre potterier, der havde til <br />huse i København, fremstillede denne potte i ca. 50 år. Vores<br /> leverandør fandt denne gamle lerpotte i et nedlagt gartneri <br />og får den nu produceret nær Lucca i Toscana. (Inkl. underskål)</p>', 'Københavner Potten Grå', '', '', '', 'kobenhavner-potten-gra'),
(136, 'Ancona Choco Terracotta Romantic', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> </span></strong></p>', 'Ancona Choco Terracotta Romantic', '', '', '', 'ancona-choco-terracotta-romantic'),
(271, 'Bambus - Milano Bord', 'Bambus bord (L218xB110xH73) fantastisk flot. <br />Hvidlakeret aluminiums ben, der er indstillelige.\r\n<p>Tages ind om vinteren! Du kan nedenfor vælge<br /> med/uden luksus polyrattan stole.</p>', 'Bambus - Milano Bord/sæt', '', '', '', 'bambus-milano-bord-saet'),
(187, 'Spirit® Premium E-320™', '<p><span style="font-size: 8pt; font-family: Helvetica;">Når det næstebedste bare ikke er godt nok! Spirit® Premium E-320™ er cremen, når vi taler om en grill perfekt til dig, der lige er begyndt at grille på gas. Specifikation: 25-årigt garantiprogram, 3 rustfrie brændere, 1 gasblus, Arbejdsborde i stål, Elektronisk tænding, Porcelænsemaljerede grillriste, Porcelænsemaljerede Flavorizer® Bars, Termometer i låget, Grillareal: 64 x 44 cm, 6 redskabsholdere. H: 157 cm, B: 135 cm, D: 76 cm.   </span></p>', 'Spirit® Premium E-320™', '', '', '', 'spirit-premium-e-320'),
(847, 'Zoe Luksus Stol', 'En dejlig polyrattan stol med en rigtig god siddekomfort - denne er inkl. beige hynde. <br /><br />Stolen er et produkt ud af mange i denne serie..!', 'Zoe Luksus Stol i natur og sort', '', '', '', 'zoe-luksus-stol-i-natur-og-sort'),
(139, 'Kæmpe Terracotta Krukke', '<p>Den er produceret i ler, som brændes ved 20% mere <br />varme end normalt, således bliver krukken mindre porøs<br /> og mere vejrbestandig. Leveres med en stor buksbom.</p>\r\n<p>Mål: H59 cm - Ø61 cm</p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres og sættes på plads ... </span></strong></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">helt GRATIS!</span></strong></span></p>', 'Kæmpe Terracotta Krukke', '', '', '', 'kaempe-terracotta-krukke'),
(140, 'Florence Hyndeboks', '<p>Luksus Hyndeboks i A-grade Teak med mørk gummifuge.<br />Hyndeboksen måler: B130xD50xH60 cm. Super flot møbel -<br />og så slipper man for at rende langt med havehynderne!</p>', 'Florence Teak Hyndeboks', '', '', '', 'florence-teak-hyndeboks'),
(141, 'Rieti Luksus Hyndeboks', '<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;"><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: black;">Luksus Hyndeboks i mahogni, som er hvidlakeret i høj-<br />glanslak og Teaklåg med hvid gummifuge. Hynde-<br />boksen måler: B130xD50xH60 cm. <span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: black;">Elegant</span> møbel - og <br />så slipper man for, at rende langt med havehynderne!</span></p>', 'Rieti Luksus Hyndeboks', '', '', '', 'rieti-luksus-hyndeboks'),
(142, 'Rosenborg Sæt', '<p>Klassisk og smukt sæt, der består af to stole, en bænk <br />og et bord. Sættet<span style="font-family: verdana,geneva;"> er af mahogni og højglanslakeret. <br />Bordets mål: L165xB80xH75 cm. </span></p>\r\n<p>Sættes ind om vinteren!</p>\r\n<p> </p>\r\n<p> </p>', 'Rosenborg Sæt', '', '', '', 'rosenborg-saet'),
(143, 'Krukkefødder', '<p><span style="color: #99cc00;"><strong>Krukkerfødder</strong></span><br />Løft din krukke fra jorden om vinteren...! Dette gøres for, at <br />krukken drænes for vand.</p>', 'Giv dine krukker et længere liv!', '', '', '', 'giv-dine-krukker-et-laengere-liv'),
(144, 'Terracotta krukke med Buksbom højde 180 cm', '<p>Skab liv med stil - Fantastisk flot Choco Terracotta krukke</p>\r\n<p>med stor KVALITETS Buksbom krydret med Camillia,</p>\r\n<p>pudemos samt små grønne æbler. </p>\r\n<p> </p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres og sættes på plads ...</span></strong></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">helt GRATIS!</span></strong></span></p>', 'Buksbom og krukke højde 180 cm', '', '', '', 'buksbom-og-krukke-hojde-180-cm'),
(145, 'Isjuletræ', '<p>Isjuletræ fra Sirius med 200 lys højde 52 cm.</p>\r\n<p>Teknisk data:</p>\r\n<p>8 meter tilslutningsledning</p>\r\n<p>12,8 W/24V </p>', 'Isjuletræ', '', '', '', 'isjuletrae'),
(146, 'Siddende bjørne', '<p>Siddende bjørne med 60 lys - kan bruges inde og ude. </p>\r\n<p>Teknisk data:</p>\r\n<p>Højde 18 cm, 6W/24V.</p>', '2 stk. siddende bjørne', '', '', '', '2-stk-siddende-bjorne'),
(147, 'Stor Teddybjørn', '<p>Teddybjørn med 200 lys kan bruges inde og ude.</p>\r\n<p>Teknisk data: Højde 50 cm - 12,8W/24V.</p>', 'Stor Teddybjørn', '', '', '', 'stor-teddybjorn'),
(148, 'Is Egern', '<p>Is Egern med 200 lys kan bruges ude og inde. </p>\r\n<p>Teknisk data: Højde 50 cm, 9,13W/24V.</p>', 'Is Egern', '', '', '', 'is-egern'),
(149, 'Issvampe', '<p>Tre Issvampe med 90 lys kan bruges inde og ude.</p>\r\n<p>Teknisk data: Ø16 cm og 8 mtr. tilslutningsledning. 5,76W/24V.</p>', 'Issvampe med 90 lys', '', '', '', 'issvampe-med-90-lys'),
(150, 'Issvampe', '<p>Issvampe med 120 lys kan bruges inde og ude.</p>\r\n<p>Teknisk data: Ø35 cm og 8 mtr. tilslutningsledning.</p>\r\n<p>7,2 W/24V</p>', 'Issvampe med 120 lys', '', '', '', 'issvampe-med-120-lys'),
(151, 'Juletræ i krukke med 45 lys', '<p>Fantastisk flot Juletræ (Nordmannsgran) i stor håndlavet</p>\r\n<p>Terracotta krukke (H150 cm) inkl. lyskæde fra Sirius med</p>\r\n<p>45 lys lige til at sætte i stikkontakten.</p>\r\n<p> </p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres og sættes på plads ...</span></strong></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">helt GRATIS!</span></strong></span></p>', 'Juletræ i krukke med 45 lys', '', '', '', 'juletrae-i-krukke-med-45-lys'),
(152, 'Juletræ med 90 lys', '<p>Fantastisk flot Juletræ (Nordmannsgran) i stor håndlavet</p>\r\n<p>Terracotta krukke (H150 cm) inkl. lyskæde fra</p>\r\n<p>Sirius med 90 lys lige til at sætte i stikkontakten.</p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres og sættes på plads ...</span></strong></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">helt GRATIS!</span></strong></span></p>', 'Juletræ i krukke med 90 lys', '', '', '', 'juletrae-i-krukke-med-90-lys'),
(153, 'Tech-line Start set 45 lys', '<p>Tech-line - et komplet system</p>\r\n<ul>\r\n<li style="text-align: left;">230 volt INGEN transformer</li>\r\n<li style="text-align: left;">Spar op til 90% af det normale strømforbrug</li>\r\n<li style="text-align: left;">Op til 50.000 brændetimer</li>\r\n<li style="text-align: left;">Tilslut op til 4000 lysdioder.</li>\r\n</ul>\r\n<p>Tech-line Start set 45 lys.</p>\r\n<p>Teknisk data: Farve hvid, 4,5 mtr. med lys +</p>\r\n<p>1,5 mtr. ledning, 2,7W/230V.</p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres </span></strong></span><span class="Apple-style-span" style="font-size: 16px;"><strong><span style="color: #86b300;">helt GRATIS i Nordsjælland!</span></strong></span></p>\r\n<p> </p>', 'Tech-line Start set 45 lys', '', '', '', 'tech-line-start-set-45-lys'),
(154, 'Tech-Line supplement 45 lys', '<p>Tech-line - et komplet system</p>\r\n<ul>\r\n<li style="text-align: left;">230 volt INGEN transformer</li>\r\n<li style="text-align: left;">Spar op til 90% af det normale strømforbrug</li>\r\n<li style="text-align: left;">Op til 50.000 brændetimer</li>\r\n<li style="text-align: left;">Tilslut op til 4000 lysdioder.</li>\r\n</ul>\r\n<p>Tech-line supplement sæt 45 lys.</p>\r\n<p>Teknisk data: Farve hvid, 4,5 mtr. med lys, 2,7W/230V.</p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres </span></strong><strong><span style="color: #86b300;">helt GRATIS i Nordsjælland!</span></strong></span></p>', 'Tech-Line supplement 45 lys', '', '', '', 'tech-line-supplement-45-lys'),
(155, 'Tech-line supplement 90 lys', '<p>Tech-line - et komplet system</p>\r\n<ul>\r\n<li style="text-align: left;">230 volt INGEN transformer</li>\r\n<li style="text-align: left;">Spar op til 90% af det normale strømforbrug</li>\r\n<li style="text-align: left;">Op til 50.000 brændetimer</li>\r\n<li style="text-align: left;">Tilslut op til 4000 lysdioder.</li>\r\n</ul>\r\n<p>Tech-line supplement sæt 90 lys.</p>\r\n<p>Teknisk data: Farve hvid, 9 mtr. med lys, 5,4W/230V.</p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres </span></strong><strong><span style="color: #86b300;">helt GRATIS i Nordsjælland!</span></strong></span></p>', 'Tech-Line supplement 90 lys', '', '', '', 'tech-line-supplement-90-lys'),
(156, 'Tech-Line Net', '<p>Tech-line - et komplet system</p>\r\n<ul>\r\n<li style="text-align: left;">230 volt INGEN transformer</li>\r\n<li style="text-align: left;">Spar op til 90% af det normale strømforbrug</li>\r\n<li style="text-align: left;">Op til 50.000 brændetimer</li>\r\n<li style="text-align: left;">Tilslut op til 4000 lysdioder.</li>\r\n</ul>\r\n<p>Tech-line Net 90 lys.</p>\r\n<p>Teknisk data: Farve hvid, 1,2x1,2 mtr. +</p>\r\n<p>1,5 mtr. ledning, 5,4W/230V.</p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres </span></strong><strong><span style="color: #86b300;">helt GRATIS i Nordsjælland!</span></strong></span></p>', 'Tech-Line Net', '', '', '', 'tech-line-net'),
(157, 'Tech-Line Net 168 lys', '<p>Tech-line - et komplet system</p>\r\n<ul>\r\n<li style="text-align: left;">230 volt INGEN transformer</li>\r\n<li style="text-align: left;">Spar op til 90% af det normale strømforbrug</li>\r\n<li style="text-align: left;">Op til 50.000 brændetimer</li>\r\n<li style="text-align: left;">Tilslut op til 4000 lysdioder.</li>\r\n</ul>\r\n<p>Tech-line Net 168 lys.</p>\r\n<p>Teknisk data: Farve hvid, 1,7x1,4 mtr. med lys +</p>\r\n<p>1,5 mtr. ledning, 10,08W/230V.</p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #86b300;">Leveres </span></strong><strong><span style="color: #86b300;">helt GRATIS i Nordsjælland!</span></strong></span></p>', 'Tech-Line Net 168 lys', '', '', '', 'tech-line-net-168-lys'),
(285, 'Paris sofasæt', 'Fantastisk flot sofaarrangement i brun stonewash<br />"luksus polyrattan" med flot bord, hvor der er lagt <br />en glasplade på toppen. Inkl. sorte hynder.', 'Paris sofasæt', '', '', '', 'paris-sofasaet'),
(291, 'Øreklap Lounge Chair med skammel', '<p>Fantastisk flot Lounge Chair Natural Rattan med<br />skammel inkl. Beige hynder - super siddekomfort! <br /><br />Bør stå under overdækning.</p>', 'Øreklap Lounge Chair', '', '', '', 'oreklap-lounge-chair'),
(339, 'Viola', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> <br /></span></strong></p>', 'Viola Choco Terracotta Romantic', '', '', '', 'viola-choco-terracotta-romantic'),
(283, 'Jumbo Hyndeboks', '<p>Rigtig fin hyndeboks i sort 4-linet polyrattan med indbyg-<br />get hyndepose og kraftig lynlås. Her er der plads til hyn-<br />derne og lidt til. Kan stå ude hele året!</p>\r\n<p>Mål: L133xB57xH83 cm.</p>', 'Jumbo Hyndeboks', '', '', '', 'jumbo-hyndeboks'),
(281, 'Nina Polyrattan spisestol', '<p>Super flot stol med et strejf af romantik. Siddekom-<br />forten er helt i top. (inkl. hynde).<br /><br /></p>\r\n<p>Vedligeholdelsesfri!</p>', 'Nina Polyrattan spisestol', '', '', '', 'nina-polyrattan-spisestol'),
(282, 'Pigalle Stoneware', '<p>Super flot stentøjskrukke i petroleumsfarve.<br /><br /></p>\r\n<p><strong><span style="color: #99cc00;"></span></strong><strong><span style="color: #99cc00;"><br style="color: #99cc00;" /></span></strong></p>', 'Pigalle Stoneware', '', '', '', 'pigalle-stoneware'),
(278, 'Milano Havesæt', '<p>Luksus Polyrattan Havesæt bestående af bord (Ø120)<br />samt 4 fletstole med en fantastisk siddekomfort...!</p>\r\n<p>Ønskes flere stole til sættet, findes de under menu-<br />punktet polyrattan stole.</p>', 'Milano Havesæt Sandgrå/Hvidt', '', '', '', 'milano-havesaet-sandgra-hvidt'),
(279, 'Milano Stol', '<p>Super fin stol med en fantastisk siddekomfort.<br />Inkl. hynde.</p>', 'Milano Stol', '', '', '', 'milano-stol'),
(277, 'Den engelske Bænk', 'Fantastisk flot Teakbænk kreearet efter den engelske arkitekt<br />Sir Edward Lutyens - her er kræset om detaljerne.', 'Den Engelske Bænk', '', '', '', 'den-engelske-baenk'),
(276, 'Luksus Teak Dækstol', '<p>Super flot kvalitets dækstol med en rigtig god sidde-<br />komfort!</p>', 'Luksus Teak Dækstol', '', '', '', 'luksus-teak-daekstol'),
(275, 'Lucas Sunbed', 'Luksus Royal Grey polyrattan Solvogn med parasol <br />og luksushynde - når man ikke vil gå på kompromis<br />med kvaliteten...', 'Lucas Sunbed', '', '', '', 'lucas-sunbed'),
(356, 'Emilia', '<p>Lidt nord for Bologna finder man byen Modena, hvor Emilia-<br />potten er blevet produceret siden 1800-tallet. Pottens karak-<br />teristiske rebkant er inspireret af det gamle Romerrige. Kruk-<br />ken bliver I dag fremstillet i Toscana efter gammel teknik.</p>', 'Emilia Grå Terracotta', '', '', '', 'emilia-gra-terracotta'),
(330, 'Simone Choco Classic', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling. </p>', 'Simone Choco Terracotta Classic', '', '', '', 'simone-choco-terracotta-classic'),
(217, 'Lucas Krukke', '<p style="margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-align: left; direction: ltr; unicode-bidi: embed;">Vores let beton krukker består af cement, sand, sten og vand <br />og for at gøre den lettere, er der nu tilsat additiver samt synte-<br />tiske fibre, som gør betonkrukken lettere, men stadig med en <br />stor hårdhed.<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"> (Beton blev oprindeligt opfundet af romerne for <br />mere <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">end tu<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">sind år siden og anvendes, som bekendt, i dag <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">til <br />mange forskellige <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">formål.)</span></span></span></span></span></p>', 'Lucas Let beton Krukke', '', '', '', 'lucas-let-beton-krukke'),
(176, 'One-Touch® Premium 57 cm', '<p><span style="font-family: Helvetica; font-size: 8pt;" class="Apple-style-span">Kuglegrillen One-Touch® Premium 57 cm er som den originale grill, George Stephen opfandt i 1952 - med et par luksuriøse opdateringer i topklassen<i>. S</i>pecifikation: 10-årigt garantiprogram, Grillareal: 57 cm i diameter, One-Touch™-rengøringssystem i rustfrit stål, Topspjæld i aluminium, Rummelig askeskuffe, der nemt tages af og tømmes, 2 kulskinner Porcelænsemaljeret bund og låg, Nylonhåndtag med varmeskjold, Revnesikrede, vejrbestandige hjul, Briketmålebæger, Fremstillet i USA. Farve: Sort, H107 cm, B 71 cm, D 58 cm.   </span></p>', 'One-Touch® Premium 57 cm', '', '', '', 'one-touch-premium-57-cm'),
(286, 'Romance Havesæt', '<p>Romantisk havesæt med 4 Laura stole i polyrattan flet inkl. <br />hynder. Bordet måler: B: 90 L: 150/210. Dejligt havesæt til få<br /> - og til mange!<br /><br /></p>\r\n<p>Kan stå ude hele året rundt!</p>', 'Romance Teak/Polyrattan', '', '', '', 'romance-teak-polyrattan'),
(808, 'Odessa Loungebord 76x76 cm', 'Mål: H32-B76-D76 cm.', 'Odessa Loungebord 76x76 cm', '', '', '', 'odessa-loungebord-76x76-cm'),
(736, 'Zoe Chaiselong', 'Chaiselongen måler: <br /><br />H66 cm-D88 cm-B154 cm.', 'Zoe Chaiselong højre', '', '', '', 'zoe-chaiselong-hojre'),
(733, 'Winze Loungestol', '<p><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps">Winze loungestol<span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"> <span class="hps">flettet <span class="hps">i 3 <span class="hps">mm runde <span class="hps">syntetisk <span class="hps">polyrattan <br /><span class="hps">på <span class="hps">en aluminiumsramme inkl. hynde. Super siddekomfort!<br /><br /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n<p>Højde: 71 cm<br /> Bredde: 92 cm<br /> Dybde: 90 cm</p>', 'Winze Loungestol', '', '', '', 'winze-loungestol'),
(531, 'Fransk opvaskemiddel Rosmarin & salvie 1l', 'Skøn ny Franske opvaskemiddel med Rosmarin & salvie <br />æteriske olier 1 liter med pumpe. Indeholder ingen syntetiske <br />farver stoffer...!', 'Fransk opvaskemiddel Rosmarin & Salvie', '', '', '', 'fransk-opvaskemiddel-rosmarin-salvie'),
(532, 'Fransk opvaskemiddel med Lavendel', '<p>Skøn ny fransk opvaskemiddel med Lavendel æteriske olier, <br /> 1 liter med pumpe. Indeholder ingen syntetiske farverstoffer..!</p>', 'Fransk opvaskemiddel med Lavendel', '', '', '', 'fransk-opvaskemiddel-med-lavendel'),
(533, 'Fransk opvaskemiddel Fruits D''epices', '<p>Skøn ny Fransk opvaskemiddel med spicy fruits, en skøn <br />mix af bla. ylang, kardemomme, patchouli, eucalyptus <br />æteriske olier. 1 liter med pumpe - indeholder ingen syntetiske <br />farverstoffer...!</p>', 'Fransk opvaskemiddel Fruits D''epices', '', '', '', 'fransk-opvaskemiddel-fruits-d-epices'),
(534, 'Marseille sæbe Lavendel 500ml', '<p>Denne skønne lavendel flydende Marseille sæbe er lavet efter <br />en gammel tradition i Marseille, af en master soapmaker, kogt<br /> i en stor gryde, med coprah og argan olie. Copra er tørret kød <br />eller kerne, af kokosnødden. Kokosolie er udvundet fra det og <br />har gjort Copraolie til et vigtigt landbrugsprodukt for mange <br />kokos-producerende lande. Sæben indeholder det naturlige <br />glycerin, som tillader det at rense din hud blidt. Denne sæbe <br />indeholder ikke animalsk fedtstoffer eller syntetisk overflade-<br />aktiver. Parfumen indeholder: Lavendel & lavandin æteriske olier.<br /> INGEN: Parabener eller Phenoxyethanoel. 97% naturlige ingre-<br />dienser.</p>', 'Marseille sæbe Lavendel 500ml', '', '', '', 'marseille-saebe-lavendel-500ml'),
(535, 'Marseille sæbe Oliven 500ml', '<p>Denne skønne lavendel flydende Marseille sæbe er lavet efter <br />en gammel tradition i Marseille, af en master soapmaker, kogt<br /> i en stor gryde, med coprah og argan olie. Copra er tørret kød <br />eller kerne, af kokosnødden. Kokosolie er udvundet fra det og <br />har gjort Copraolie til et vigtigt landbrugsprodukt for mange <br />kokos-producerende lande. Sæben indeholder det naturlige <br />glycerin, som tillader det at rense din hud blidt. Denne sæbe <br />indeholder ikke animalsk fedtstoffer eller syntetisk overflade-<br />aktiver. Parfumen indeholder:æteriske olie af Litsea Cubeba,<br />Eucalyptus, citronella og lavendel. INGEN: Parabener eller <br />Phenoxyethanoel. 97,5 naturlige ingredienser.</p>', 'Marseille sæbe - Oliven 500ml', '', '', '', 'marseille-saebe-oliven-500ml'),
(538, 'Livorno Luksus stol', '<p>Livorno Luksus fletstol i natur inkl. hynde. Skøn, charmeren-<br />de og ikke mindst hyggelig stol, der både benyttes som spise-<br />bordsstol, men også til mindre café sæt. </p>\r\n<p>Passer perfekt til Lacise loungesæt....!</p>\r\n<p>Fantastisk siddekomfort..!</p>', 'Livorno Luksus stol', '', '', '', 'livorno-luksus-stol'),
(539, 'Sofabord one in one', '<p>Enkelt og smukt sofabord i Recycleteak. Bordet findes i to stør-<br />relser, og ved køb af begge størrelser kan bordene skydes ind <br />over/under hinanden.</p>\r\n<p>Super lækkert - råt og rustikt..!</p>', 'Sofabord one in one', '', '', '', 'sofabord-one-in-one'),
(540, 'Sofabord Urban m/hjul', '<p>Rustikt sofabord i Recycle Teak med store rå hjul, så bordet <br />er nemt at flytte rundt med.</p>\r\n<p><br />Fås i to størrelser.</p>', 'Sofabord Urban m/hjul', '', '', '', 'sofabord-urban-m-hjul'),
(541, 'Spisebord Bangka Rustik', 'Luksus Recycle Teak bord L:250 cm B:110 cm H:76 cm til <br />både inde og ude.<br /><br />Fantastisk flot design!', 'Spisebord Bangka Rustik', '', '', '', 'spisebord-bangka-rustik'),
(542, 'Bar-/Cafebord, galvaniseret A2 Living', '<p>Bar-/Cafébord, anretterbord eller computerbord om man vil,<br /> med tilhørende galvaniserede barstole - alt i et enkelt, skandi-<br />navisk og minimalistisk design der passer til den moderne bolig-<br />indretning.</p>', 'Bar-/Cafebord, galvaniseret', '', '', '', 'bar-cafebord-galvaniseret'),
(784, 'Milano Stol', '<p>Super smuk fletstol i Luksus Polyrattan - inkl. hynde. Fantas-<br />tisk siddekomfort...! <br /><br /></p>', 'Milano Stol i White-wash', '', '', '', 'milano-stol-i-white-wash'),
(544, 'Zenia Luksus Stol', '<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Super elegant stol inkl. "Grey Wash" hynde - til den kræsne.<br />Stolen er flettet over et varmgalvaniseret samt pulverlakeret <br />stålstel.<span face="Verdana, Arial, Helvetica, sans-serif" size="2"> Stolen findes også i farven natur.</span></span></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Stolens mål: B58xD60xH83.<br /></span></span></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Vedligeholdelsesfri og kan stå ude hele året...!<br /></span></span></p>', 'Zenia Luksus Stol', '', '', '', 'zenia-luksus-stol'),
(545, 'Zenia Luksus Havebord', '<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Super elegant havebord til den kræsne familie ..! Havebordet <br />måler B90xL90xH73,5 cm og har en kratig glasbordplade. Bordet <br />er flettet over et varmgalvaniseret samt pulverlakeret stålstel. <br />Topkvalitet. Havebordet findes også i farven natur.<br /></span></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Vedligeholdelsesfrit og kan stå ude hele året...!<br /></span></span></p>', 'Zenia Luksus Havebord 90x90 cm', '', '', '', 'zenia-luksus-havebord-90x90-cm'),
(546, 'Zenia Luksus Havesæt i Natur', '<span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"></span></span>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2">Super elegant havesæt til den kræsne familie ..! Sættet består<br /> af bord L90xB90xH73 cm med glasbordplade samt 4 Luksus <br />polyrattan stole inkl. "Beige" hynder - siddekomfort helt i <br />top...! Havesættet er flettet over et varmgalvaniseret samt <br />pulverlakeret stålstel - kvaliteten er helt i top. Sættet findes <br />også i farven sort. Stolens mål: B58xD60xH83.</span></p>\r\n<p> </p>\r\n<span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2">Vedligeholdelsesfrit og kan stå ude hele året...!</span></span>', 'Zenia Luksus Havesæt i Natur', '', '', '', 'zenia-luksus-havesaet-i-natur'),
(547, 'Zenia Luksus Havebord', '<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Super elegant bord til den kræsne familie ..! Bordet måler <br />L180xB90xH73 cm og er med en glasbordplade. Havebordet <br />er flettet over et varmgalvaniseret samt pulverlakeret stålstel.<br />Topkvalitet. Bordet findes også i farven natur. <br /></span></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Vedligeholdelsesfrit og kan stå ude hele året...!<br /></span></span></p>', 'Zenia Luksus Havebord 180x90 cm', '', '', '', 'zenia-luksus-havebord-180x90-cm'),
(549, 'Zenia Luksus Stol', '<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Super elegant stol inkl. "Beige" hynde - til den kræsne.<br />Stolen er flettet over et varmgalvaniseret samt pulverlakeret <br />stålstel.<span face="Verdana, Arial, Helvetica, sans-serif" size="2"> Stolen findes også i farven sort.</span></span></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Stolens mål: B58xD60xH83.<br /></span></span></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">Vedligeholdelsesfri og kan stå ude hele året...!<br /></span></span></p>', 'Zenia Luksus Stol - natur', '', '', '', 'zenia-luksus-stol-natur'),
(548, 'Zenia Luksus Havesæt i Natur', '<span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"></span></span><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"></span></span></span>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2">Super elegant havesæt til den kræsne familie ..! Sættet består<br /> af bord L180xB90xH73 cm med glasbordplade samt 4 Luksus <br />polyrattan stole inkl. "Beige" hynder - siddekomfort helt i <br />top...! Havesættet er flettet over et varmgalvaniseret samt <br />pulverlakeret stålstel - kvaliteten er helt i top. Sættet findes <br />også i farven sort. </span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><br /></span></p>\r\n<span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2"><span style="font-family: verdana,geneva; font-size: 8pt;" face="Verdana, Arial, Helvetica, sans-serif" size="2">Vedligeholdelsesfrit og kan stå ude hele året...!</span></span></span>', 'Zenia Luksus Havesæt 180x90 cm', '', '', '', 'zenia-luksus-havesaet-180x90-cm'),
(731, 'Steel lammeskind - korthåret', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores New Zealandske lammeskind.<br /><br /></p>\r\n<p>Husk at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 100x60 cm<br /><span style="color: #333333;">Hårlængde: 5 cm<br /><span style="color: #333333;">Farve: Steel<br /></span></span></span>', 'Steel Lammeskind - korthåret', '', '', '', 'steel-lammeskind-kortharet'),
(550, 'Brisa lammeskind - langhåret', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores Islandske lammeskind.<br /><br /></p>\r\n<p>Husk at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 100-120 cm<br /><span style="color: #333333;">Hårlængde: 15-25 cm<br /><span style="color: #333333;">Farve: Brisa<br /></span></span></span>', 'Brisa lammeskind - langhåret', '', '', '', 'brisa-lammeskind-langharet'),
(551, 'Chocolate lammeskind - korthåret', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores New Zealandske lammeskind.<br /><br /></p>\r\n<p>Husk at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 100x60 cm<br /><span style="color: #333333;">Hårlængde: 5 cm<br /><span style="color: #333333;">Farve: Chocolate<br /></span></span></span>', 'Chocolate lammeskind - korthåret', '', '', '', 'chocolate-lammeskind-kortharet'),
(552, 'Tofarvet lammeskind - korthåret', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores New Zealandske lammeskind.<br /><br /></p>\r\n<p>Husk at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 100x60 cm<br /><span style="color: #333333;">Hårlængde: 5 cm<br /><span style="color: #333333;">Farve: Brunt<br /></span></span></span>', 'Tofarvet lammeskind - korthåret', '', '', '', 'tofarvet-lammeskind-kortharet'),
(553, 'Linen lammeskind - korthåret', '<p>Skindet er ultra lækkert og blødt og har utrolig mange <br />anvendelsesmuligheder, såvel ude som inde. Skab hygge<br />og varme med vores New Zealandske lammeskind.<br /><br /></p>\r\n<p>Husk at der ikke er to skind der er ens!<br /><br /></p>\r\n<span style="color: #333333;">Mål: Ca. 100x60 cm<br /><span style="color: #333333;">Hårlængde: 5 cm<br /><span style="color: #333333;">Farve: Linen<br /></span></span></span>', 'Linen Lammeskind - korthåret', '', '', '', 'linen-lammeskind-kortharet'),
(554, 'Esmaralda Loungesæt', '<p>har et meget autentisk naturligt lækkert look. Loungesæt-<br />tet er kreeret af 5,5 mm luksus polyratanflet spundet over <br />et galvaniseret og pulverlakeret stål stel.<br /><br /></p>\r\n<p>Sættet er inkl. beige polyester hynder - der kan nedenfor<br />vælges Off-white eller Grey-wash Olefin hynder for en mer-<br />pris.</p>', 'Esmaralda Loungesæt', '', '', '', 'esmaralda-loungesaet'),
(555, 'Winze Loungesæt', '<p><span class="hps">Ligesom <span class="hps">en luksus <span class="hps">yacht, der <span class="hps">er for anker<span class="hps"><span class="hps"> <span class="hps">- Winze lounge <span class="hps"><br />med <span class="hps">de særlige <span class="hps">former og <span class="hps">blå/hvid <span class="hps">marine <span class="hps">udtryk...!  <span class="hps"><br />Flettet <span class="hps">i 3 <span class="hps">mm runde <span class="hps">syntetisk <span class="hps">polyrattan <span class="hps">på <span class="hps">en aluminiums-<br />ramme.<br /><br /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>', 'Winze Loungesæt', '', '', '', 'winze-loungesaet');
INSERT INTO `i63il_virtuemart_products_da_dk` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(556, 'Fleur Loungesæt', '<p><span class="hps">Elegant <span class="hps">loungeserie der vil blive<span class="hps"> <span class="hps">omdrejningspunkt for <span class="hps">både <br />store og <span class="hps">mindre <span class="hps">selskaber. Fleur<span class="hps"><span class="hps"><span class="hps"> <span class="hps">består <span class="hps">af <span class="hps">fem <span class="hps">forskellige mo-<br />duler, som frit kan <span class="hps">kombineres efter<span class="hps"> <span class="hps">behov. Serien er inkl.<br />hynder, hvor der kan vælges i mellem beige eller sort.<br /><br /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n<p>Dette sæt er kreeret af 2,8 mm rund polyratan flet spundet <br />over et aluminiumsstel.  <br /><br /></p>\r\n<p><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps atn"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps">Som vist på billedet<br class="hps" /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>', 'Fleur Loungesæt', '', '', '', 'fleur-loungesaet'),
(557, 'Odessa Loungesæt', '<p><span style="font-family: verdana,geneva; font-size: 8pt;">En lækker loungeserie <span face="Verdana, Arial, Helvetica, sans-serif" size="2"><span face="Verdana, Arial, Helvetica, sans-serif" size="2">som kan kombineres og sammenstilles i det antal forskellige siddemoduler som passer til terrassens størrelse eller ens eget pladsbehov</span></span>. Sættet er <span face="Verdana, Arial, Helvetica, sans-serif" size="2">flettet over et robust, varmegalvaniseret og pulverlakeret aluminiumsstel med en 4,5 mm polyethylenefiber, der dels er utrolig holdbar, men også smudsafvisende</span>. Denne loungeserie fås i Grey-Wash eller sort.<br /><br /></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;"><a href="images/stories/lounge%20gra.jpg"><span style="color: #808000;"><strong>Se sættet i Grey-Wash her!</strong></span></a><a href="images/stories/odessa%20lounge.jpg"><span style="color: #808000;"><strong><br /></strong></span></a><br /></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;">1 Chaiselong, 2 Hjørner, 2 midtersektioner og 1 glasbord.</span><br /><br /></p>', 'Odessa Loungesæt', '', '', '', 'odessa-loungesaet'),
(558, 'Zoe Loungesæt', '<p>Zoe er en komplet havemøbelserie, der er til den helt lille <br />terrasse og også den helt store..! Her er mulighed for dels <br />at samle sit helt egen lounge i den størrelse der ønskes <br />dels og få dinningfurnitures og solvogn i samme design. <br />Hynden fås i natur eller sort.<br /><br /></p>\r\n<p><span style="color: #808000; font-size: 8pt;"><strong><a title="Zoe Loungesæt " href="images/stories/ninja_soffa.jpg"><span style="color: #808000;">For at se yderligere detaljer - klik her<br /><br /></span></a></strong></span></p>\r\n<p>Som vist på billedet.</p>', 'Zoe Loungesæt', '', '', '', 'zoe-loungesaet'),
(559, 'Magie Luksus sofasæt', '<p>med dejlige bløde linjer, superlækre hynder og et klassisk look.<br />Dette sæt er kreeret af 5,5 mm rund og 7 mm flad polyratan <br />flet spundet over et galvaniseret og pulverlakeret stål stel. <br /><br /></p>', 'Magie Luksus Loungesofasæt', '', '', '', 'magie-luksus-loungesofasaet'),
(561, 'Sanine Loungesæt', '<p>Super flot og indbydende Loungesæt der kan kombineres <br />efter behag. Hynderne - der er inkl. - er kreeret i olefin <br />således at de er vandafvisende. Absolut for den kræsne<br />køber..!<br /><br /></p>\r\n<p><span style="color: #808000;"><strong><a href="images/stories/sanine%20yd.jpg"><span style="color: #808000;">For at se yderligere detaljer - klik her</span></a></strong></span></p>', 'Sanine Loungesæt', '', '', '', 'sanine-loungesaet'),
(850, 'Zoe Luksus Stol u/armlæn', 'En dejlig polyrattan stol med en rigtig god siddekomfort - denne er inkl. beige hynde. <br /><br />Stolen er et produkt ud af mange i denne serie..!', 'Zoe Luksus Stol i natur og sort u/armlæn', '', '', '', 'zoe-luksus-stol-i-natur-og-sort-u-armlaen'),
(563, 'Sanine "Du & jeg"', '', 'Sanine "Du & jeg"', '', '', '', 'sanine-du-jeg'),
(564, 'Glorice Choco Terracotta Classic', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Denne krukke fås nu i en <br />kæmpe størrelse..!</p>', 'Glorice Choco Terracotta Classic', '', '', '', 'glorice-choco-terracotta-classic'),
(565, 'Diamond Loungesæt - Hvid Tex®', '<div class="body">\r\n<p><span style="font-size: 8pt;">Diamond Lounge er et helstøbt design, der tager sig fantastisk </span><span style="font-size: 8pt;">ud fra alle <br />vinkler. Et moderne udtryk kombineret med en kom</span><span style="font-size: 8pt;">fort man sjældent ser <br />på udendørs havemøbler. Hele denne ved</span><span style="font-size: 8pt;">ligeholdelsesfrie havemøbelserie <br />baserer sig på et nyudviklet </span><span style="font-size: 8pt;">materiale, Cane-line Tex®, som er et vejrbe-<br />standigt og lysægte </span><span style="font-size: 8pt;">materiale. Selv hynderne kan stå ude året rundt - stil-<br />les blot på </span><span style="font-size: 8pt;">højkant så regnen kan løbe af.<br />Diamond Lounge fås også i Brun <span style="font-size: 8pt;">Tex®, Grå <span style="font-size: 8pt;">Tex® samt flet, ligeledes med <br />Cane-line Tex® <span style="font-size: 8pt;">hynder. Design Foresom & Hiort-Lorenzen MDD.</span></span></span></span><span style="font-size: 10pt;"><strong><span style="color: #808000;"><a href="images/stories/se%20mere%20billede%20-%20diamond_lounge_white_penthouse_divine.jpg"><span style="color: #808000;"><br /><br /></span></a></span></strong></span></p>\r\n</div>\r\n<div class="body"><span style="font-size: 8pt;">Som vist på billedet: 3-pers. loungesofa, 2 loungestole samt Penthouse lounge</span><span style="font-size: 8pt;">bord 90x90 cm kreeret i hvidt aluminium/bordplade i hvid </span><span style="font-size: 8pt;">keramik</span>.<br />\r\n<p> </p>\r\n</div>', 'Diamond Loungesæt - Hvid Tex®', '', '', '', 'diamond-loungesaet-hvid-tex'),
(566, 'Diamond Loungestol - Hvid Tex®', '<div class="body">\r\n<p><span style="font-size: 8pt;">Diamond Lounge er et helstøbt design, der tager sig fantastisk <span style="font-size: 8pt;">ud fra alle <br />vinkler. Et moderne udtryk kombineret med en kom<span style="font-size: 8pt;">fort man sjældent ser <br />på udendørs havemøbler. Hele denne ved<span style="font-size: 8pt;">ligeholdelsesfrie havemøbelserie <br />baserer sig på et nyudviklet <span style="font-size: 8pt;">materiale, Cane-line Tex®, som er et vejrbe-<br />standigt og lysægte <span style="font-size: 8pt;">materiale. Selv hynderne kan stå ude året rundt - stil-<br />les blot på <span style="font-size: 8pt;">højkant så regnen kan løbe af.</span></span></span></span></span></span></span></p>\r\n<p><span style="font-size: 8pt;">Diamond Lounge fås også i Brun <span style="font-size: 8pt;">Tex®, Grå <span style="font-size: 8pt;">Tex® samt </span></span>flet, ligeledes med Cane-line Tex® <span style="font-size: 8pt;">hynder. Design Foresom & Hiort-Lorenzen MDD.</span></span></p>\r\n</div>', 'Diamond Loungestol - Hvid Tex®', '', '', '', 'diamond-loungestol-hvid-tex'),
(823, 'Diamond Loungesæt - Brun Tex®', '<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Diamond Lounge er et helstøbt design, der tager sig fantastisk <span style="font-size: 8pt;">ud fra alle vinkler. Et moderne udtryk kombineret med en kom<span style="font-size: 8pt;">fort man sjældent ser på udendørs havemøbler. Hele denne ved<span style="font-size: 8pt;">ligeholdelsesfrie havemøbelserie baserer sig på et nyudviklet <span style="font-size: 8pt;">materiale, Cane-line Tex®, som er et vejrbestandigt og lysægte <span style="font-size: 8pt;">materiale. Selv hynderne kan stå ude året rundt - stilles blot på <span style="font-size: 8pt;">højkant så regnen kan løbe af.<br /><br />Diamond Lounge fås også i Hvid <span style="font-size: 8pt;">Tex®, Grå <span style="font-size: 8pt;">Tex® samt flet, ligeledes med Cane-line Tex® <span style="font-size: 8pt;">hynder. Design Foresom & Hiort-Lorenzen MDD.<br /><br /></span></span></span></span></span></span></span></span></span></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">3-pers. loungesofa, 2 pers., 1 loungestol samt 1 fodskammel.</span></p>\r\n<p> </p>\r\n</div>\r\n<span style="font-size: 8pt;"><span style="font-size: 8pt;"><span style="font-size: 8pt;"></span></span></span>', 'Diamond Loungesæt - Brun Tex®', '', '', '', 'diamond-loungesaet-brun-tex'),
(567, 'Diamond 2-pers. sofa - Hvid Tex®', '<div class="body">\r\n<p><span style="font-size: 8pt;">Diamond Lounge er et helstøbt design, der tager sig fantastisk ud fra alle <br />vinkler. Et moderne udtryk kombineret med en komfort man sjældent ser <br />på udendørs havemøbler. Hele denne vedligeholdelsesfrie havemøbelserie <br />baserer sig på et nyudviklet materiale, Cane-line Tex®, som er et vejrbe-<br />standigt og lysægte materiale. Selv hynderne kan stå ude året rundt - stil-<br />les blot på højkant så regnen kan løbe af.</span></p>\r\n<p><span style="font-size: 8pt;">Diamond Lounge fås også i Brun Tex®, Grå Tex® samt flet, ligeledes med Cane-line Tex® hynder. Design Foresom & Hiort-Lorenzen MDD.</span><br /><br /><span style="font-size: 8pt;">Bredde: 150 cm, Højde: 63 cm, Dybde: 88 cm, Sædehøjde: 40 cm</span></p>\r\n<p> </p>\r\n<p> </p>\r\n</div>', 'Diamond 2-pers. sofa - Hvid Tex®', '', '', '', 'diamond-2-pers-sofa-hvid-tex'),
(568, 'Diamond 3-pers. sofa - Hvid Tex®', '<p><span style="font-size: 8pt;">Diamond Lounge er et helstøbt design, der tager sig fantastisk ud fra alle <br />vinkler. Et moderne udtryk kombineret med en komfort man sjældent ser <br />på udendørs havemøbler. Hele denne vedligeholdelsesfrie havemøbelserie <br />baserer sig på et nyudviklet materiale, Cane-line Tex®, som er et vejrbe-<br />standigt og lysægte materiale. Selv hynderne kan stå ude året rundt - stil-<br />les blot på højkant så regnen kan løbe af.</span></p>\r\n<p><span style="font-size: 8pt;">Diamond Lounge fås også i Brun Tex®, Grå Tex® samt flet, ligeledes med Cane-line Tex® hynder. Design Foresom & Hiort-Lorenzen MDD.<span style="font-size: 8pt;"><br /><br />Bredde: 209 cm, Højde: 63 cm, Dybde: 88 cm, Sædehøjde: 40 cm</span></span></p>', 'Diamond 3-pers. sofa - Hvid Tex®', '', '', '', 'diamond-3-pers-sofa-hvid-tex'),
(569, 'Diamond fodskammel - Hvid Tex®', '<p><span style="font-size: 8pt;">Diamond Lounge er et helstøbt design, der tager sig fantastisk ud fra alle <br />vinkler. Et moderne udtryk kombineret med en komfort man sjældent ser <br />på udendørs havemøbler. Hele denne vedligeholdelsesfrie havemøbelserie <br />baserer sig på et nyudviklet materiale, Cane-line Tex®, som er et vejrbe-<br />standigt og lysægte materiale. Selv hynderne kan stå ude året rundt - stil-<br />les blot på højkant så regnen kan løbe af.</span></p>\r\n<p><span style="font-size: 8pt;">Diamond Lounge fås også i Brun Tex®, Grå Tex® samt flet, ligeledes med Cane-line Tex® hynder. Design Foresom & Hiort-Lorenzen MDD.<span style="font-size: 8pt;"></span></span></p>', 'Diamond fodskammel - Hvid Tex®', '', '', '', 'diamond-fodskammel-hvid-tex'),
(570, 'Diamond stol i hvid - inkl. hynde', '<p><span style="font-size: 8pt;">Diamond havestolen er et nyt bud på en moderne stol til haven hvor det <br />innovative design kommer til udtryk i de smukke former. Diamond lounge <br />havemøbelserien er designet af to af dansk designs grand old men - <br />Johannes Foersom og Peter Hiort-Lorenzen. Hele den vedligeholdelsesfrie <br />havemøbelserie Diamond baserer sig på et nyudviklet materiale, Cane-line <br />Tex® som er et vejrbestandigt og lysægte materiale. Selv hynden kan stå <br />ude året rundt - stilles blot på højkant så regnen kan løbe af.<br />Bredde: 56 cm, Højde: 81 cm, Dybde: 61 cm, Sædehøjde: 46 cm.<br /></span></p>', 'Diamond stol i hvid - inkl. hynde', '', '', '', 'diamond-stol-i-hvid-inkl-hynde'),
(571, 'Diamond stol & Edge Bord', '<p><span style="font-size: 8pt;">Edge udtræksbord er et produkt af en lang og koordineret designproces, <br />hvor dygtige håndværkere og designerne Strand & Hvass har arbejdet tæt <br />sammen for at virkeliggøre dette markante bord. Havebordets stel er lavet <br />i rustfristål af meget høj kvalitet og kræver stor præcision i produktionen. <br />Bordet måler 210x100 cm og med tillægsplader i 330x100 cm.<br />Bredde 210 cm, Højde 74 cm, Dybde 100 cm<br /></span></p>\r\n<br />\r\n<p><span style="font-size: 8pt;">Diamond havestolen er et nyt bud på en moderne stol til haven hvor det <br />innovative design kommer til udtryk i de smukke former. Diamond lounge <br />havemøbelserien er designet af to af dansk designs grand old men - <br />Johannes Foersom og Peter Hiort-Lorenzen. Hele den vedligeholdelsesfrie <br />havemøbelserie Diamond baserer sig på et nyudviklet materiale, Cane-line <br />Tex® som er et vejrbestandigt og lysægte materiale. Selv hynden kan stå <br />ude året rundt - stilles blot på højkant så regnen kan løbe af. <br />Bredde 56 cm, Højde 81 cm, Dybde 61 cm, Sædehøjde 46 cm.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;"><strong><span style="color: #808000;"><a href="http://www.youtube.com/watch?v=y2Pu4Qe2lTU"><span style="color: #808000;">Se Edge bordet - Live</span></a></span></strong><br /></span></p>', 'Diamond Stol & Edge Bord', '', '', '', 'diamond-stol-edge-bord'),
(572, 'Diamond Stol & Share Bord', '<p><span style="font-size: 8pt;"></span><span style="font-size: 8pt; color: #808080;">Share havebordet fås med et understel i enten aluminium eller rustfrit <br />stål. Vælg mellem glasplade i hvid eller grå eller keramisk plade i hvid <br />eller grå. Muligheden for selv at vælge bordplade og de to forskellige stel <br />giver stor mulighed for at bordet får sit eget unikke og individuelle look.</span></p>\r\n<p><span style="font-size: 8pt; color: #808080;">Bredde: 210 cm, Højde: 69 cm, Dybde: 100 cm<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; color: #808080;">Diamond havestolen er et nyt bud på en moderne stol til haven hvor det <br />innovative design kommer til udtryk i de smukke former. Diamond lounge <br />havemøbelserien er designet af to af dansk designs grand old men - <br />Johannes Foersom og Peter Hiort-Lorenzen. Hele den vedligeholdelsesfrie <br />havemøbelserie Diamond baserer sig på et nyudviklet materiale, Cane-line <br />Tex® som er et vejrbestandigt og lysægte materiale. Selv hynden kan stå <br />ude året rundt - stilles blot på højkant så regnen kan løbe af. <br />Bredde: 56 cm, Højde: 81 cm, Dybde: 61 cm, Sædehøjde: 46 cm.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; color: #808080;">6 Diamond stole inkl. hynder samt Share bord i rustfrit stål med bordplade </span><br /><span style="font-size: 8pt; color: #808080;">kreeret af hvid keramik</span></p>', 'Diamond Stol & Share Bord', '', '', '', 'diamond-stol-share-bord'),
(574, 'Diamond Highback Loungesæt', '<p><span style="font-size: 8pt;">Et nyt medlem af den populære Diamond familie designet af Foresom & Hiort-Lorenzen. Highback lounge er rendyrket komfort ned til mindste detalje. Designerne måtte arbejde intenst med at skabe den rette komfort, uden at miste Diamond seriens specielle udtryk. Resultatet taler for sig selv. En markant lounge sofa og havestol med deres helt eget udtryk og med en lethed, man sjældent opnår med møbler af denne størrelse. Stolen fås også i farven grå.</span></p>\r\n<p><span style="font-size: 8pt;"><br />Highback Lounge Sofa og Lounge Stol inkl. hynder.<br /><span style="color: #808000;"><a title="Cane-line Highback Lounge" href="http://www.youtube.com/watch?v=KY_rB8dyohM"><span style="color: #808000;"><br /><strong>Se Highback Loungeserien - Live</strong></span></a></span><br /></span></p>', 'Diamond Highback Loungesæt', '', '', '', 'diamond-highback-loungesaet'),
(573, 'Diamond stol - Grafit flet inkl. hynde', '<p><span style="font-size: 8pt;">Diamond havestolen er et nyt bud på en moderne stol til haven hvor det <br />innovative design kommer til udtryk i de smukke former. Diamond lounge <br />havemøbelserien er designet af to af dansk designs grand old men - <br />Johannes Foersom og Peter Hiort-Lorenzen. Hele den vedligeholdelsesfrie <br />havemøbelserie Diamond baserer sig på et nyudviklet materiale, Cane-line <br />Tex® som er et vejrbestandigt og lysægte materiale. Selv hynden kan stå <br />ude året rundt - stilles blot på højkant så regnen kan løbe af.<br /><br />Bredde: 56 cm, Højde: 81 cm, Dybde: 61 cm, Sædehøjde: 46 cm.</span></p>', 'Diamond stol - Grafit flet inkl. hynde', '', '', '', 'diamond-stol-grafit-flet-inkl-hynde'),
(575, 'Diamond Highback Sofa', '<p><span style="font-size: 8pt;">Et nyt medlem af den populære Diamond familie designet af Foresom & Hiort-Lorenzen. Highback lounge er rendyrket komfort ned til mindste detalje. Designerne måtte arbejde intenst med at skabe den rette komfort, uden at miste Diamond seriens specielle udtryk. Resultatet taler for sig selv. En markant lounge sofa og havestol med deres helt eget udtryk og med en lethed, man sjældent opnår med møbler af denne størrelse. <br /></span></p>', 'Diamond Highback Sofa', '', '', '', 'diamond-highback-sofa'),
(576, 'Diamond Highback Loungestol', '<p><span style="font-size: 8pt;">Et nyt medlem af den populære Diamond familie designet af Foresom & Hiort-Lorenzen. Highback lounge er rendyrket komfort ned til mindste detalje. Designerne måtte arbejde intenst med at skabe den rette komfort, uden at miste Diamond seriens specielle udtryk. Resultatet taler for sig selv. En markant lounge sofa og havestol med deres helt eget udtryk og med en lethed, man sjældent opnår med møbler af denne størrelse. Stolen fås også i farven grå.</span></p>', 'Diamond Highback Loungestol', '', '', '', 'diamond-highback-loungestol'),
(577, 'Diamond Highback Loungestol Grå', '<p><span style="font-size: 8pt;">Et nyt medlem af den populære Diamond familie designet af Foresom & Hiort-Lorenzen. Highback lounge er rendyrket komfort ned til mindste detalje. Designerne måtte arbejde intenst med at skabe den rette komfort, uden at miste Diamond seriens specielle udtryk. Resultatet taler for sig selv. En markant lounge sofa og havestol med deres helt eget udtryk og med en lethed, man sjældent opnår med møbler af denne størrelse. Stolen fås også i hvid.</span></p>', 'Diamond Highback Loungestol Grå', '', '', '', 'diamond-highback-loungestol-gra'),
(578, 'Diamond Loungesæt i Grafit', '<p><span style="font-size: 8pt;">Diamond Loungesæt i flet forener på fornem vis designmæssig elegance og høj praktisk værdi. Designet er skabt af arkitekterne Foersom & Hiort-Lorenzen i samarbejde med Cane-line. Loungesættet er på alle måder vedligeholdelsesfri med sit unikke betræk i Cane-line Tex®. Et nyt materiale, der er yderst vejrbestandig. Hynderne er specielt designet således hynderne ikke behøver at tages indenfor, men blot stilles på høj kant, hvis der kommer en regnbyge. Alt i alt et moderne valg til haven eller den store tagterrasse.<br /><br />Sættet med 1 stk. Loungestol, 1 stk. fodskammel, 1 stk. 2-pers. Loungesofa og 1 stk. 3-pers. Loungesofa inkl. hynder.<br /><br /><strong><span style="color: #808000;"><a title="Cane-line Diamond flet" href="http://www.youtube.com/watch?v=z7znediwlR8"><span style="color: #808000;">Se Diamond Loungesæt Grafit - Live</span></a></span></strong><br /></span></p>', 'Diamond Loungesæt i Grafit', '', '', '', 'diamond-loungesaet-i-grafit'),
(579, '3-pers. Diamond Loungesofa i Grafit', '<p><span style="font-size: 8pt;">Diamond Lounge sofa i flet forener på fornem vis designmæssig elegance og høj praktisk værdi. Designet er skabt af arkitekterne Foersom & Hiort-Lorenzen i samarbejde med Cane-line. Sofaen er på alle måder vedligeholdelsesfri med sit unikke betræk i Cane-line Tex®. Et nyt materiale, der er yderst vejrbestandig. Hynderne er specielt designet således hynderne ikke behøver at tages indenfor, men blot stilles på høj kant, hvis der kommer en regnbyge. Alt i alt et moderne valg til haven eller den store tagterrasse.<br /><br />Bredde 209 cm, Højde 62 cm, Dybde 88 cm, Sædehøjde 40 cm<br /></span></p>', 'Diamond 3-pers. Loungesofa i Grafit', '', '', '', 'diamond-3-pers-loungesofa-i-grafit'),
(580, '2-pers. Diamond Loungesofa i Grafit', '<p><span style="font-size: 8pt;">Diamond Lounge sofa i flet forener på fornem vis designmæssig elegance og høj praktisk værdi. Designet er skabt af arkitekterne Foersom & Hiort-Lorenzen i samarbejde med Cane-line. Sofaen er på alle måder vedligeholdelsesfri med sit unikke betræk i Cane-line Tex®. Et nyt materiale, der er yderst vejrbestandig. Hynderne er specielt designet således hynderne ikke behøver at tages indenfor, men blot stilles på høj kant, hvis der kommer en regnbyge. Alt i alt et moderne valg til haven eller den store tagterrasse.<br /><br />Bredde 150 cm, Højde 62 cm, Dybde 88 cm, Sædehøjde 40 cm<br /></span></p>', 'Diamond 2-pers. Loungesofa i Grafit', '', '', '', 'diamond-2-pers-loungesofa-i-grafit'),
(581, 'Diamond fodskammel Grafit', '<p><span style="font-size: 8pt;"></span><span style="font-size: 8pt;">Den elegante og praktisk puf i Diamond serien er optimal i forbindelse med lounge stolen eller som en flot ekstra siddeplads. Tages hynden af, kan den ligeledes bruges som et lavt sofabord sammen med en Skyebakke. Diamond er designet til at kunne stå ude året rundt. Møblet er betrukket med Cane-line Tex® - et vejrbestandigt materiale med høj slidstyrke. Hynden er designet med speciel hurtigtørrende skum, så stilles hynden på høj kant, kan møblet bruges relativ kort tid efter en regnbyge. Design: Foersom & Hiort Lorenzen.</span><br /><br /></p>\r\n<p><span style="font-size: 8pt;">Bredde 70 cm, Højde 40 cm, Dybde 70 cm</span></p>', 'Diamond fodskammel Grafit', '', '', '', 'diamond-fodskammel-grafit'),
(582, 'Edge Bord i rustfrit stål og kompaktliminat', '<p><span style="font-size: 8pt;">Edge udtræksbord er et produkt af en lang og koordineret designproces, hvor dygtige håndværkere og designerne Strand+Hvass har arbejdet tæt sammen for at virkeliggøre dette markante bord. Havebordets stel er lavet i rustfristål af meget høj kvalitet og kræver stor præcision i produktionen.</span><br /><br /><span style="font-size: 8pt;">Bordene måler 160x100 cm og med tillægsplader i 220x100 cm eller</span><br /><span style="font-size: 8pt;">210x100 cm og med tillægsplader i 330x100 cm - fås i hvid og grå kompaktliminat.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;"><span style="color: #333300;"><strong><a rev="prev" title="Cane-line Edge" href="http://www.youtube.com/watch?v=jqtFYr0ep0c"><span style="color: #333300;">Se hvorledes Edge bordet fungerer </span></a></strong></span></span></p>', 'Edge Bord i rustfrit stål og kompaktlaminat', '', '', '', 'edge-bord-i-rustfrit-stal-og-kompaktlaminat'),
(583, 'On-the-move sidebord', '<p style="margin: 0cm 0cm 10pt;"><span style="font-size: 8pt;">Dette lette og elegante sidebord er resultatet af en spændende designproces med designerne Strand+Hvass, hvor målet var et super funktionelt lille bord, der byggede på principperne for et bakke bord, men samtidigt fornyede kategorien. Bakkebordet er udstyret med et håndtag, der gør det let at flytte fra sted til sted, i takt med at solen rykker sig på himlen.</span></p>\r\n<p style="margin: 0cm 0cm 10pt;"><span style="font-size: 8pt;">Vinder af Interior Innovation Award 2012.</span></p>\r\n<p style="margin: 0cm 0cm 10pt;"><span style="font-size: 8pt;">Turkis <span style="background-position: 0px 0px;" class="arrow"><span class="ddTitleText"><img src="http://www.cane-line.dk/%7E/media/Caneline/Images/VariantValues/FF/AQ.ashx?w=50&h=34&as=true&bc=white" align="absmiddle" /> Antracit <img src="http://www.cane-line.dk/%7E/media/Caneline/Images/VariantValues/FF/AG.ashx?w=50&h=34&as=true&bc=white" align="absmiddle" />Taupe <span class="ddTitleText"><img src="http://www.cane-line.dk/%7E/media/Caneline/Images/VariantValues/FF/AT.ashx?w=50&h=34&as=true&bc=white" align="absmiddle" />Hvid <span class="ddTitleText"><span class="ddTitleText"><img src="http://www.cane-line.dk/%7E/media/Caneline/Images/VariantValues/FF/AW.ashx?w=50&h=34&as=true&bc=white" align="absmiddle" /></span></span></span><br /></span></span></span></p>\r\n<p style="margin: 0cm 0cm 10pt;"><span style="font-size: 8pt;"><span style="background-position: 0px 0px;" class="arrow"><span class="ddTitleText"></span></span>Bredde 44 cm, højde 44 cm, dybde 44 cm<br /><br class="ddTitleText" /></span></p>\r\n<a title="Cane-line On-the-move" href="http://www.youtube.com/watch?v=IcCZPnCTkMI"><strong><span class="mceVisualAid mceVisualGuides"><span class="ddTitleText"><span class="ddTitleText"></span></span></span><span style="color: #808000;">Se on-the-move bordet - Live</span></strong></a>', 'On-the-move sidebord, small and large', '', '', '', 'on-the-move-sidebord-small-and-large'),
(584, 'Edge Havestol', '<div class="body"><span style="font-size: 8pt;">Den smarte Edge havestol er skabt efter en lang og æstetisk designprocess, hvor designerne STRAND+HVASS har fokuseret på funktionalitet og ypperlig komfort. Havestolen er konstrueret på en stærk aluminiumsramme som giver stolen høj stabilitet og samtidig et skarpt og moderne design udtryk. Edge havestolen kan stables, og passer derfor perfekt til steder hvor opmagasineringspladsen er begrænset</span></div>\r\n<div class="body">\r\n<p><span style="font-size: 8pt;">Stolen er flettet med Cane-lines nye "ROPE" fiber. Fiberen er let at rengøre og føles naturlig og behagelig at sidde på. Edge havestolen passer perfekt til Edge havebordet - begge er designet af den danske design duo STRAND+HVASS.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;"><strong><span style="color: #808000;"><a title="Cane-line" href="http://www.youtube.com/watch?v=jqtFYr0ep0c"><span style="color: #808000;">Se Edge bord og stol - Live </span></a></span></strong></span></p>\r\n</div>', 'Edge Havestol', '', '', '', 'edge-havestol'),
(586, 'Conic Loungesæt - Brun Tex®', '<p><span style="font-size: 8pt;"><span style="font-family: verdana,geneva; color: #808080;">Det innovative design bag Conic serien betyder, at disse moduler fungerer godt i mange forskellige omgivelser. Farven og det transparente look betyder, at modulsystemet både kan passe ind eller være med til at fremhæve stil og indretning. Conic er designet af den erfarne design duo Foresom & Hiort-Lorenzen, som har brugt mange timer på at udvikle konceptet. Conic leveres med mange små designelementer, som højner det samlede indtryk. Detaljerne på de vejrbestandige hynder understøtter det luksuriøse look, og den unikke ramme er et udtryk for håndværk på allerhøjeste niveau.</span><br /><br /><strong><span style="color: #808000;"><a title="Cane-line Conic" href="http://www.youtube.com/watch?v=13ef0Ow7WPA"><span style="color: #808000;">Se Loungesættet samt ideer til sammensætning af de forskellige moduler - Live</span></a></span></strong><br /> <br /><span style="font-family: verdana,geneva; color: #808080;">Sættet som vist: 1 stk. venstre 2-pers. sofa, 1 stk. midtermodul, 1 stk. højre 2-pers. sofa og 1 stk. Daybed</span><br /><br /></span></p>', 'Conic Loungesæt - Brun Tex®', '', '', '', 'conic-loungesaet-brun-tex'),
(591, 'Conic Loungestol - Brun Tex®', '<p><span style="font-size: 8pt;"></span><span style="font-size: 8pt;"></span></p>\r\n<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt;">Conic lounge stolen er resultatet af en lang designproces, hvor de Danske designere Foersom & Hiort-Lorenzen har brugt mange timer på at skabe det unikke look til serien. Der har været fokus på at skabe et harmonisk design med høj komfort.</span></p>\r\n<p><span style="font-size: 8pt;">Conic lounge stolen leveres med et sæde og ryg hyndesæt i det vejrbestandige og vedligeholdelsesfrie materiale Cane-line Tex. Lounge stolen kan stå alene eller kombineres med resten af havemøblerne i Conic lounge serien.</span></p>\r\n</div>\r\n</div>\r\n<p><br style="font-size: 8pt;" /><br /><span style="font-size: 8pt;">Bredde 84 cm, højde 81 cm, dybde 82 cm, sædehøjde 42 cm.</span></p>', 'Conic Loungestol - Brun Tex®', '', '', '', 'conic-loungestol-brun-tex'),
(587, 'Conic sofabord 75x75 cm - Taupe', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt;">Conic sofabordet kan anvendes alene eller som en elegant og praktisk måde at forbinde de forskellige moduler i Conic serien på. Det er meget simpelt at koble sofabordet sammen med de andre moduler i serien, og da det er fremstillet i aluminium er det samtidig let at flytte rundt på.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Sofabordet kan som alle andre havemøbler fra Cane-line stå ude hele året rundt. Vi anbefaler dog at tildække dine havemøbler med et møbelovertræk i vintersæsonen.</span></p>\r\n<p><span style="font-size: 8pt;">Conic sofabordet er designet af Foersom & Hiort-lorenzen</span></p>\r\n</div>\r\n</div>', 'Conic sofabord 75x75 cm - Taupe', '', '', '', 'conic-sofabord-75x75-cm-taupe'),
(588, 'Conic midtermodul - Brun Tex®', '<p><span style="font-size: 8pt;"></span><span style="font-size: 8pt;">Dette modul blev designet til at give udvidelsesmuligheder i kombination med de andre Conic moduler. Enkelt modulet leveres med det nye samlingssystem, som gør det nemt at klikke modulerne i Conic lounge havemøbelserien sammen. Modulet kan også bruges som en enkeltstående loungestol og dette giver derfor endnu flere muligheder, hvis du senere ønsker at sætte modulerne sammen på en anden måde.</span></p>\r\n<p> </p>\r\n<p><span style="font-size: 8pt;">Ligesom de andre moduler leveres enkeltmodulet med vejrbestandige hynder, så du kan nyde dine lounge havemøbler til fulde. Alle hynder er designet til udendørs brug og har et smart drænsystem som lader regnvand løbe væk. Drænet fungerer optimalt, når hynderne sættes lodret. Vandet drænes også når de er placeret normalt, men det vil tage længere tid at tørre.</span></p>\r\n<p> </p>\r\n<p>Conic serien er udviklet med stor omhu og øje for detaljen for at skabe optimal komfort. Puderne er resultatet af mange timers arbejde og mange prototyper, som alle er testet af designerne og Cane-lines design team.<br /><br />Bredde 80 cm, højde 74 cm, dybde 82 cm, sædehøjde 42 cm.</p>', 'Conic midtermodul - Brun Tex®', '', '', '', 'conic-midtermodul-brun-tex'),
(589, 'Conic 2-pers. modulsofa - Brun Tex®', '<p> </p>\r\n<div class="cmsContent">\r\n<div style="margin: 0cm 0cm 10pt;">\r\n<p style="margin: 0cm 0cm 10pt;"><span style="font-size: 8pt;">Dette to personers modul giver gode muligheder for at skabe det perfekte udendørs loungeområde. Det kan bruges som en enkeltstående chaiselong eller være en del af en større Conic lounge gruppe. Uanset hvordan du vælger at bruge din Conic sofa, er komforten optimal og designet med henblik på fleksibilitet.</span></p>\r\n<p style="margin: 0cm 0cm 10pt;"><span style="font-size: 8pt;">På grund af den lette aluminiumsramme kan modulet nemt flyttes rundt, og systemets fleksibilitet betyder, at du kan skabe en afslappende rede med dyb siddekomfort eller en klassisk lounge sofa.</span><br /><br /></p>\r\n<span style="font-size: 8pt;">Det innovative design bag Conic serien betyder, at disse moduler fungerer godt i mange forskellige omgivelser. Farven og det transparente look betyder, at modulsystemet både kan passe ind eller være med til at fremhæve stil og indretning. Conic er designet af den erfarne design duo Foresom & Hiort-Lorenzen, som har brugt mange timer på at udvikle konceptet. Conic leveres med mange små designelementer, som højner det samlede indtryk. Detaljerne på de vejrbestandige hynder understøtter det luksuriøse look, og den unikke ramme er et udtryk for håndværk på allerhøjeste niveau.</span><br /><br /><span style="font-size: 8pt;">Bredde 140 cm, Højde 74 cm, Dybde 82 cm, Sædehøjde 42 cm</span></div>\r\n</div>', 'Conic 2-pers. modulsofa - Brun Tex®', '', '', '', 'conic-2-pers-modulsofa-brun-tex'),
(590, 'Conic Daybed modul - Brun Tex®', '<p><span style="font-size: 8pt;"></span><span style="font-size: 8pt;">Dette modul blev designet til at give udvidelsesmuligheder i kombination med de andre Conic moduler. Enkelt modulet leveres med det nye samlingssystem, som gør det nemt at klikke modulerne i Conic lounge havemøbelserien sammen. Modulet kan også bruges som en enkeltstående loungestol og dette giver derfor endnu flere muligheder, hvis du senere ønsker at sætte modulerne sammen på en anden måde.</span></p>\r\n<p> </p>\r\n<p><span style="font-size: 8pt;">Ligesom de andre moduler leveres enkeltmodulet med vejrbestandige hynder, så du kan nyde dine lounge havemøbler til fulde. Alle hynder er designet til udendørs brug og har et smart drænsystem som lader regnvand løbe væk. Drænet fungerer optimalt, når hynderne sættes lodret. Vandet drænes også når de er placeret normalt, men det vil tage længere tid at tørre.</span></p>\r\n<p> </p>\r\n<p><span style="font-size: 8pt;">Conic serien er udviklet med stor omhu og øje for detaljen for at skabe optimal komfort. Puderne er resultatet af mange timers arbejde og mange prototyper, som alle er testet af designerne og Cane-lines design team.</span><br /><br /><span style="font-size: 8pt;">Bredde 120 cm, højde 74 cm, dybde 140 cm, sædehøjde 42 cm.</span></p>', 'Conic Daybed modul - Brun Tex®', '', '', '', 'conic-daybed-modul-brun-tex'),
(592, 'Time Out sofaborde', '<div class="body">\r\n<p><span style="font-size: 8pt;">Time-out sofabordet er designet af Strand+Hvass. Det selvsamme arkitekter, som stod bag vores On-the-move sideborde. Tanken med Time-out sofabordene var at skabe en serie af småborde, med et moderne design som kunne passe ind mange forskellige steder både for sig selv, men også sammen med mange typer af havemøbler.</span></p>\r\n<p><span style="font-size: 8pt;">Time-out kan både bruges i par eller som et enkeltstående sofabord. Hvis Time-out sofabordet anvendes udendørs hele året rundt, er det vigtigt, at regnvandet bliver fjernet en gang imellem, da det kan efterlade mærker i det lange løb.</span></p>\r\n<p><span style="font-size: 8pt;">Time-out fås i to størrelser og to farver:<br /><br />Lille sofabord: Bredde 71 cm, Højde 35 cm, Dybde 71 cm</span></p>\r\n<p><span style="font-size: 8pt;">Stort sofabord: Bredde 81 cm, Højde 43 cm, Dybde 81 cm </span></p>\r\n<p><span style="font-size: 8pt;">og i farverne hvid og taupe.<br /></span></p>\r\n<br />\r\n<p> </p>\r\n</div>', 'Time-Out sofaborde', '', '', '', 'time-out-sofaborde'),
(593, 'Rest Sunlounge - Hvid, brun eller grå Tex®', '<p><span style="font-size: 8pt; color: #808080; font-family: verdana,geneva;">Rest solvogn er Cane-lines bud på en ny solvogn i vedligeholdelsesfrie materialer og med en komfortabel hynde, der tørrer hurtigere end traditionelle hynder. Suppler med et praktisk Rest sidebord, der med en rund Skye serveringsbakke passer perfekt til livet på terrassen. Rest solvogne er vedligeholdelsesfri og har en ekstrem holdbarhed.</span></p>', 'Rest Sunlounge - Hvid, Brun eller Grå Tex®', '', '', '', 'rest-sunlounge-hvid-brun-eller-gra-tex'),
(594, 'Rest sidebord/fodskammel', '<p>Rest sidebord supplerer elegant de nye REST solvogne som sidebord. Sidebordet er designet således, at det også kan anvendes som puf eksempelvis i forbindelse med en lounge gruppe. Puffen er indvendigt beklædt med hurtigtørrende skum som giver god komfort og samtidig sikrer at sidebordet tåler at stå ude hele sæsonen.</p>', 'Rest sidebord/fodskammel', '', '', '', 'rest-sidebord-fodskammel'),
(595, 'Conic solseng m/gasfjeder - Brun Tex®', '<p>Havemøbelserien - Conic har fået et nyt medlem. Conic solvognen er skabt med øje for den mest optimale komfort. En gasfjeder og et håndtag på siden af solvognen sørger for, at du let kan ændre positionen. Den specielt fremstillede inderramme tillader at du opnår den ergonomisk bedste position. Conic leveres med en hynde og nakkehynde, der begge yder den mest optimale komfort. Conic solvognen egner sig godt til både private, såvel som f.eks. hoteller hvor høj kvalitet, elegant design og minimal vedligehold er påkrævet. Conic solvognen er designet af Foersom & Hiort-Lorenzen.</p>', 'Conic solseng m/gasfjeder - Brun Tex®', '', '', '', 'conic-solseng-m-gasfjeder-brun-tex'),
(596, 'Brighton Luksus stol - Natur og Sort', '<div class="body">\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;">Brighton havestolen er en af Cane-lines bestsellers og fås i farverne sort og natur. Stolen har med sin høje ryg og brede armlæn en høj komfort. Det klassiske design har gjort stolen til et populært valg til store spisegrupper. En indretning med 4-5 stole på hver side af bordet er elegant og indbydende - det perfekte arrangement til middagen med familie eller venner. Havemøbler i Brighton serien er produceret i vejrbestandige og vedligeholdelsesfrie materialer af højeste kvalitet.<br /><br />Specifikationer: Bredde 61 cm, Højde 92 cm, Dybde 67 cm, Sædehøjde 42 cm.<br /></span></p>\r\n</div>', 'Brighton Luksus stol - Sort', '', '', '', 'brighton-luksus-stol-sort'),
(597, 'Brighton hynder', '<p><span><strong>Brighton havehyndesæt fås i følgende farver og stoffer<br /><br />Sort:</strong> Havehynder i Dralon er fremstillet af 100 % gennemfarvet akrylfiber og er modstandsdygtig overfor UV stråling. Betrækket kan håndvaskes (må ikke fjernes fra hynden) skal tørres lodret.<strong><br /><br />Chocolade, hvid og taupe: </strong>Havehynder i Paratempotest er fremstillet i 100 % gennemfarvet Akrylfiber er teflonbehandlet og er modstandsdygtig overfor UV stråling.</span></p>', 'Brighton hynder', '', '', '', 'brighton-hynder'),
(665, 'Fleur Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>', 'Fleur Choco Terracotta Classic 2014', '', '', '', 'fleur-choco-terracotta-classic-2014'),
(598, 'Brighton Luksus stol - Natur - sort', '<div class="body">\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt;">Brighton havestolen er en af Cane-lines bestsellers og fås i farverne sort og natur. Stolen har med sin høje ryg og brede armlæn en høj komfort. Det klassiske design har gjort stolen til et populært valg til store spisegrupper. En indretning med 4-5 stole på hver side af bordet er elegant og indbydende - det perfekte arrangement til middagen med familie eller venner. Havemøbler i Brighton serien er produceret i vejrbestandige og vedligeholdelsesfrie materialer af højeste kvalitet.<br /><br />Specifikationer: Bredde 61 cm, Højde 92 cm, Dybde 67 cm, Sædehøjde 42 cm.<br /></span></p>\r\n</div>', 'Brighton Luksus stol - Natur', '', '', '', 'brighton-luksus-stol-natur'),
(599, 'Shape Loungesæt - Brun Tex®', '<div class="body">\r\n<p><span style="font-size: 8pt;">Shape er Cane-lines bud på tidløse og elegante modulære lounge havemøbler, der giver stor frihed til at skabe et komfortabelt omdrejningspunkt i haven eller i en moderne havestue. Lounge havemøblernes elegante brune farve giver et flot varmt element i indretningen og passer godt ind, uanset om indretningen primært er varme naturmaterialer eller mere kolde og elegante materialer som glas og stål.</span></p>\r\n<p><span style="font-size: 8pt;">Shape havemøblerne leveres inklusiv hynder fremstillede i coated polyester - vi kalder materialet for Cane-line Tex. Cane-line Tex er et yderst robust materiale som kombineret med hurtigtørrende skum og en særlig opbygning af dræn inde i hynden betyder, at du kan lade hynderne stå ude hele året rundt uden at skulle bekymre dig om jordslåethed eller mug. Skulle der falde en regnbyge, skal hynderne blot stilles på højkant - herefter vil de være anvendelige til brug igen efter kort tid.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Loungesættet som vist<br /></span></p>\r\n</div>', 'Shape Loungesæt - Brun Tex®', '', '', '', 'shape-loungesaet-brun-tex'),
(600, 'Patrice Terrazzo Krukke', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern. Fås i tre størrelser.<br /><br /></p>\r\n<p>Mål: H17 cm-Ø32 cm<strong><span></span></strong></p>', 'Patrice Terrazzo Krukker 2014', '', '', '', 'patrice-terrazzo-krukker-2014'),
(601, 'Patrice Terrazzo Krukke', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern. Fås i tre størrelser.<br /><br /></p>\r\n<p>Mål: H22 cm-Ø40 cm<br /><br /><strong><span style="color: #99cc00;">På lager ultimo februar..!</span></strong></p>', 'Patrice Terrazzo Krukker 2014', '', '', '', 'patrice-terrazzo-krukker-2014_53ce25dad4751'),
(664, 'Rosalie Choco Terracotta Classic', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>\r\n<p>Mål: H27-Ø53<br /><br /></p>', 'Rosalie Choco Terracotta Classic', '', '', '', 'rosalie-choco-terracotta-classic'),
(604, 'Patrice Terrazzo Krukker', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern. Fås i tre størrelser.<br /><br /></p>\r\n<p>Mål: H28 cm-Ø53 cm<br /><br /><strong><span style="color: #99cc00;"></span></strong></p>\r\n<p><strong><span style="color: #99cc00;">På lager ultimo februar..!</span></strong></p>', 'Patrice Terrazzo Krukker 2014', '', '', '', 'patrice-terrazzo-krukker-2014_53ce25dadbc83'),
