(609, 'Lance Terrazzo Krukker 2014', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern. Fås i tre størrelser.<br /><br /></p>\r\n<p>Mål: H42 cm-Ø50 cm<strong><span style="color: #99cc00;"></span></strong></p>\r\n<p><strong><span style="color: #99cc00;"><br />På lager ultimo februar..!</span></strong></p>', 'Lance Terrazzo Krukker 2014', '', '', '', 'lance-terrazzo-krukker-2014_53ce25dae5cad'),
