(659, 'Florence Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>', 'Florence Choco Terracotta Classic 2014', '', '', '', 'florence-choco-terracotta-classic-2014'),
(619, 'Berthe Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>\r\n<p>Mål: H22 cm-Ø26 cm<br /><br /></p>', 'Berthe Choco Terracotta Classic 2014 H22', '', '', '', 'berthe-choco-terracotta-classic-2014-h22'),
