(621, 'Berthe Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>\r\n<p>Mål: H45 cm-Ø53 cm<br /><br /></p>\r\n<p><strong><span style="color: #99cc00;">På lager ultimo februar 2014..!</span></strong></p>', 'Berthe Choco Terracotta Classic 2014', '', '', '', 'berthe-choco-terracotta-classic-2014'),
(860, 'Hyde sidehængt parasol, 3x3 m inkl. fod', '<p><span style="color: #000000; font-size: 8pt;">Den smukke Hyde sidehængte parasol forlænger de solfyldte sommerdage i haven eller på terrassen. Det er nemlig muligt at rotere parasollen 360 grader, så du altid er i skyggen. Parasollen kan ydermere vippes, så den også kan give skygge fra siden. Hyde er fremstillet af højkvalitets polyester, som yder en god beskyttelse mod solens stråler. </span></p>\r\n<p><span style="color: #000000; font-size: 8pt;">Hyde sidehængt parasollen er bygget op på et aluminiumsstel og fås i to farver antracite og taupe.</span></p>\r\n<p><span style="color: #000000; font-size: 8pt;">Parasolfoden er inkluderet i prisen.</span></p>', 'Hyde sidehængt parasol, 3x3 m inkl. fod', '', '', '', 'hyde-sidehaengt-parasol-3x3-m-inkl-fod'),
(624, 'Emma Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /><br /></p>', 'Emma Choco Terracotta Classic 1', '', '', '', 'emma-choco-terracotta-classic-1');
