(626, 'Emma Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>\r\n<p>Mål: H41 cm-Ø51 cm<br /><br /></p>\r\n<p><strong><span style="color: #99cc00;">På lager ultimo februar 2014..!</span></strong></p>', 'Emma Choco Terracotta Classic 3', '', '', '', 'emma-choco-terracotta-classic-3'),
(822, 'Chester Lounge sofa', '<p><span style="font-size: 8pt; font-family: verdana,geneva;">Chester 3 personers lounge sofa er håndflette i de vedligeholdelsfrie Cane-line fiber og er en af vores mest populære lounge sofaer i vores kollektion. En helt klassisk lounge sofa - designet i rene linjer. Chester er det helt rigtige valg, hvis man ønsker en flot helstøbt lounge sofa, der vil glæde øjet mange år fremover. Chester 3 personers sofa fås i natur og graphite.<br /><br />Mål: Bredde 197 cm-Højde 63 cm-Dybde 85 cm-Sædehøjde 30 cm.<br /></span></p>', 'Chester 3 pers. Loungesofa', '', '', '', 'chester-3-pers-loungesofa'),
(821, 'Chester Lounge stol', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Chester lounge stolen har meget moderne og skarpe design linjer. Chester lounge stolen er et godt valg til den elegante terrasse, den trendy balkon eller som en enkeltstående stol i et hjørne af udestuen. Chester serien består ud over lounge stolen også af en lounge sofa samt en flot fodskammel, der også kan anvendes som et lavt sofabord. Chester lounge stol fås i farverne natur og graphite.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Mål: Bredde 74 cm-Højde 63 cm-Dybde 85 cm-Sædehøjde 30 cm.</span></p>\r\n<p> </p>\r\n<p> </p>\r\n</div>\r\n</div>', 'Chester Lounge stol', '', '', '', 'chester-lounge-stol'),
(628, 'Marine Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>', 'Marine Choco Terracotta Classic 2014', '', '', '', 'marine-choco-terracotta-classic-2014'),
(629, 'Auguste Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>', 'Auguste Choco Terracotta Classic 2014', '', '', '', 'auguste-choco-terracotta-classic-2014'),
(630, 'Adrien Choco Terraccota Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>', 'Adrien Choco Terraccota Classic 2014', '', '', '', 'adrien-choco-terraccota-classic-2014'),
(674, 'Piero Tunesisk Krukke', '<p>Den ”hvide” krukke er fra Tunesien, hvor de har fremstillet<br /> krukker siden Romernes tid. Derfor er alle modellerne næsten <br />også ægte ”romerske efterkommere”. Leret er meget groft, <br />hvilket giver et flot rustikt præg og som også bevirker, at kruk-<br />ken hurtigt kommer af med vandet igen. Leret som krukken er <br />kreeret af tages fra saltsøerne (de udtørrede søer) i Tunesien. <br />Saltet bevirker, at der opstår den proces ved brændingen, at <br />overfladen bliver hvid og en smule støvet.<br /><br />Krukken er frostsikker ved rette behandling.</p>', 'Piero Tunesisk Krukke', '', '', '', 'piero-tunesisk-krukke'),
(631, 'Stor Jordbærkrukke', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<br /><br /></p>\r\n<p>Mål: H48-Ø50<strong><span style="color: #99cc00;"> </span></strong><br /><br /></p>', 'Stor Jordbærkrukke Romantic', '', '', '', 'stor-jordbaerkrukke-romantic'),
(632, 'Arnaud Let Beton Krukke', '<p>Vores let beton krukker består af cement, sand, sten og vand <br />og for at gøre den lettere, er der nu tilsat additiver samt synte-<br />tiske fibre, som gør betonkrukken lettere, men stadig med en <br />stor hårdhed.<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"> (Beton blev oprindeligt opfundet af romerne for <br />mere <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">end tu<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">sind år siden og anvendes, som bekendt, i dag <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">til <br />mange forskellige <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">formål.)<br /><br /></span></span></span></span></span></p>', 'Arnaud Let Beton Krukke 2014', '', '', '', 'arnaud-let-beton-krukke-2014'),
(862, 'Dwell parasol m/snoretræk, 2x2 m', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; color: #808080; font-family: verdana,geneva;">Vores nye 2x2 meter parasol med aluminiumsstand og polyester stof er det optimale valg for dem med begrænset plads. Dwell tilbyder høj holdbarhed og er let at åbne og lukke. Parasollen kommer i farverne antracit og taupe.</span></p>\r\n</div>\r\n</div>\r\n<div class="fb-like fb_iframe_widget"><span style="vertical-align: bottom; width: 164px; height: 20px;"><br /></span></div>', 'Dwell parasol m/snoretræk, 2x2 m', '', '', '', 'dwell-parasol-m-snoretraek-2x2-m'),
(633, 'Odette Choco Classic Terracotta 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>\r\n<p>Mål: H58 cm-Ø52 cm<br /><br /></p>', 'Odette Choco Classic Terracotta 2014', '', '', '', 'odette-choco-classic-terracotta-2014'),
(634, 'Armand Let Beton Krukke 2014', '<p>Vores let beton krukker består af cement, sand, sten og vand <br />og for at gøre den lettere, er der nu tilsat additiver samt synte-<br />tiske fibre, som gør betonkrukken lettere, men stadig med en <br />stor hårdhed.<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"> (Beton blev oprindeligt opfundet af romerne for <br />mere <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">end tu<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">sind år siden og anvendes, som bekendt, i dag <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">til <br />mange forskellige <span>formål.)</span></span></span></span></span></p>\r\n<p> </p>\r\n<span style="color: #99cc00;"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT'';"> </span></span></span></span></span></span>', 'Armand Let Beton Krukke 2014', '', '', '', 'armand-let-beton-krukke-2014'),
(863, 'Hamilton parasol m/tilt dia. 3 m', '<p><span style="font-size: 8pt; color: #808080;">amilton parasollen er bygget op på en aluminiums ramme og har en diameter på 3 meter. Hamilton udmærker sig ved at have en vippefunktion, således at parasollen kan indstilles efter, hvor på himmelen solen står. Dette gøres ved at dreje parasollens øverste del, mens man holder på parasollens stang.</span></p>\r\n<p><span style="font-size: 8pt; color: #808080;">En parasol i din have er med til at skabe god stemning og hygge. Derudover er den ideel til at beskytte mod solens stråler, så du kan sidde og slappe af i dine havemøbler.</span></p>\r\n<p><span style="font-size: 8pt; color: #808080;">Parasollen Hamilton fås i farverne hvid og sort.</span><br /><br /></p>\r\n<p><span style="font-size: 8pt; color: #808080;">Mål: B:300 cm - H:256 cm - D:300 cm.</span></p>', 'Hamilton parasol m/tilt dia. 3 m', '', '', '', 'hamilton-parasol-m-tilt-dia-3-m'),
(635, 'Colette Let Beton Krukke 2014', '<p>Vores let beton krukker består af cement, sand, sten og vand <br />og for at gøre den lettere, er der nu tilsat additiver samt synte-<br />tiske fibre, som gør betonkrukken lettere, men stadig med en <br />stor hårdhed.<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"> (Beton blev oprindeligt opfundet af romerne for <br />mere <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">end tu<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">sind år siden og anvendes, som bekendt, i dag <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">til <br />mange forskellige <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">formål.)<br /><br /></span></span></span></span></span></p>', 'Colette Let Beton Krukke 2014', '', '', '', 'colette-let-beton-krukke-2014'),
(861, 'Aberdeen parasol m/crank, dia. 3 m', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; color: #333333;">Aberdeen parasollen kan beskytte mod solens skarpe stråler, men den tilføjer også skønhed til din have eller terrasse. </span></p>\r\n<p><span style="font-size: 8pt; color: #333333;">Aberdeen parasollens ramme og stok er fremstillet i hårdttræ. Dugen har en diameter på 3 meter og er fremstillet i materialet Olifin. </span></p>\r\n<p><span style="font-size: 8pt; color: #333333;">Parasollen er udstyret med en krank, som er et simpelt hæve og sænkesystem. Parasollen er nem at slå op og i og fås i de klassiske farver hvid eller sort.</span><br /><br /></p>\r\n<p><span style="font-size: 8pt; color: #333333;">B:300 cm - H:274 cm - D:300 cm</span></p>\r\n</div>\r\n</div>', 'Aberdeen parasol m/crank, dia. 3 m', '', '', '', 'aberdeen-parasol-m-crank-dia-3-m'),
(637, 'Pascale Let Beton Krukke 2014', '<p>Vores let beton krukker består af cement, sand, sten og vand <br />og for at gøre den lettere, er der nu tilsat additiver samt synte-<br />tiske fibre, som gør betonkrukken lettere, men stadig med en <br />stor hårdhed.<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"> (Beton blev oprindeligt opfundet af romerne for <br />mere <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">end tu<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">sind år siden og anvendes, som bekendt, i dag <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">til <br />mange forskellige <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">formål.)<br /><br /></span></span></span></span></span></p>', 'Pascale Let Beton Krukke 2014', '', '', '', 'pascale-let-beton-krukke-2014'),
(636, 'Delphine Choco Terracotta Romantic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> </span></strong><br /><br /></p>', 'Delphine Choco Terracotta Romantic 2014', '', '', '', 'delphine-choco-terracotta-romantic-2014'),
(865, 'Parasolfod m/hjul, 34 kg', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Praktisk composite parasolfod med hjul gør det let at flytte din parasol rundt på terrassen alt efter, hvor solen står på himlen.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Passer til parasolstænger med en diameter på max 54 mm.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Vægt: 34 kg.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Mål: B51 cm - H43 cm - D51 cm<br /></span></p>\r\n</div>\r\n</div>', 'Cane-line Parasolfod m/hjul, 34 kg', '', '', '', 'cane-line-parasolfod-m-hjul-34-kg'),
(858, 'Sunrise Liggestol', '<p><span style="font-size: 8pt; font-family: verdana,geneva;">er en klassisk solstol med to funktioner. Du har mulighed for at vippe solstolen tilbage i en horisontal position, så du også kan anvende den som en solseng. Denne type solstol er kendt fra de tyske kurbade og passer perfekt til en afslappende stund med en god bog.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Sunrise solstole kan let stables i stakke af helt op til fem solstole. Solstolen er yderst populær på hoteller og kurbade, idet den er meget holdbar og kræver minimum af opbevaringsplads.</span><br /><br /><span style="font-size: 8pt; font-family: verdana,geneva;">Mål: B:156 cm H:97 cm D:75 cm SH:39 cm</span></p>\r\n<br class="mceVisualAid mceVisualGuides" /><br />\r\n<p> </p>', 'Sunrise Liggestol', '', '', '', 'sunrise-liggestol'),
(638, 'Edmond Choco Terracotta Romantic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> </span></strong><br /><br /></p>', 'Edmond Choco Terracotta Romantic 2014', '', '', '', 'edmond-choco-terracotta-romantic-2014'),
(639, 'Ariane Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>', 'Ariane Choco Terracotta Classic 2014', '', '', '', 'ariane-choco-terracotta-classic-2014'),
(640, 'Springvand - Black Soil', '<p>Ønsker man en rislen i haven - så er dette springvand <br />lige sagen...! <br /><br /></p>\r\n<p>Springvandet er kreeret i Black Soil en speciel lertype, <br />hvis kemiske sammensætning indeholder jern, hvilket <br />gør produkterne meget stærke. <br /><br /></p>\r\n<p><strong><span style="color: #99cc00;">På lager ultimo februar 2014.</span></strong></p>', 'Springvand - Black Soil', '', '', '', 'springvand-black-soil'),
(641, 'Claude Terrazzo Krukke 2014', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern i hjørnerne.<br /><br /></p>', 'Claude Terrazzo Krukke 2014', '', '', '', 'claude-terrazzo-krukke-2014'),
(642, 'Fabrice Terrazzo Krukke 2014', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern i hjørnerne.<br /><br /></p>', 'Fabrice Terrazzo Krukke 2014', '', '', '', 'fabrice-terrazzo-krukke-2014'),
(643, 'Sandrine Choco Terracotta Romantic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<br /><br /></p>', 'Sandrine Choco Terracotta Romantic 2014', '', '', '', 'sandrine-choco-terracotta-romantic-2014'),
(644, 'Clotilde Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>', 'Clotilde Choco Terracotta Classic 2014', '', '', '', 'clotilde-choco-terracotta-classic-2014'),
(645, 'Christelle Antique Terracotta 2014', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<br /><br /></p>', 'Christelle Antique Terracotta 2014', '', '', '', 'christelle-antique-terracotta-2014'),
(646, 'Ursula Choco Terracotta Classic', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>', 'Ursula Choco Terracotta Classic', '', '', '', 'ursula-choco-terracotta-classic'),
(647, 'Madelaine Antique Terracotta 2014', '<p>Vores smukke terracotta får vi nu produceret med en <br />rigtig fin antik overflade, således at krukkerne er født <br />med den smukke patina, som det ofte tager lang tid at <br />opnå. Vores krukker er frostsikre ved korrekt behandling.<br /><br /></p>\r\n<p>Mål: H57 cm - Ø39 cm.<br /><br /></p>', 'Madelaine Antique Terracotta 2014', '', '', '', 'madelaine-antique-terracotta-2014'),
(648, 'Choco Aberne', '<p>Choco Terracotta er æltet sammen af forskellige slags ler, <br />hvilket giver den smukke beige/jord farve. Leret graves ud <br />af det frodige Mekong delta, hvor der til stadighed aflejres <br />masser af ler fra deltaet. <br /><br /></p>\r\n<p><strong><span style="color: #99cc00;">På lager ultimo februar 2014..!<br /><br /></span></strong></p>\r\n<p><strong><span style="color: #99cc00;"></span></strong>Du kan vælge, hvilken abe du ønsker herunder.</p>', 'Choco Aberne', '', '', '', 'choco-aberne'),
(649, 'Blomsterkurven Romantic', '<p>Choco Terracotta krukker er æltet sammen af forskellige slags<br /> ler, hvilket giver den smukke beige/jord farve. Leret graves ud<br /> af det frodige Mekong delta, hvor der til stadighed aflejres mas-<br />ser af ler fra deltaet.<strong><span style="color: #99cc00;"> </span></strong><br /><br /></p>\r\n<p>Mål: H23-B33-D21<br /><br /></p>', 'Blomsterkurven Romantic', '', '', '', 'blomsterkurven-romantic'),
(650, 'Fuglebad i Terrazzo', '<p>Terrazzo er produceret med cement iblandet knust granit. <br />Fuglebadet er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. <br /><br /></p>\r\n<p><span style="color: #99cc00;"><strong>På lager ultimo februar 2014..!</strong></span></p>', 'Fuglebad i Terrazzo', '', '', '', 'fuglebad-i-terrazzo'),
(651, 'Chocho Elefant', '<p>Choco Terracotta er æltet sammen af forskellige slags ler, <br />hvilket giver den smukke beige/jord farve. Leret graves ud <br />af det frodige Mekong delta, hvor der til stadighed aflejres <br />masser af ler fra deltaet.<br /><br /></p>\r\n<p>Mål: H37-B32-D12 cm<br /><br /></p>\r\n<strong><span style="color: #99cc00;">På lager ultimo februar 2014..!</span></strong>', 'Chocho Elefant', '', '', '', 'chocho-elefant'),
(652, 'Micheline Choco Terracotta Classic 2014', '<p>Choco Terracotta krukker er æltet sammen af forskellige<br />slags ler, hvilket giver den smukke beige/jord farve. Leret<br />graves ud af det frodige Mekong delta, hvor der til stadighed <br />aflejres masser af ler fra deltaet. Vores krukker er frostsikre<br />ved korrekt behandling.<br /><br /></p>\r\n<p>Mål: H73-Ø70 cm<br /><br /></p>', 'Micheline Choco Terracotta Classic 2014', '', '', '', 'micheline-choco-terracotta-classic-2014'),
(864, 'Oban parasol m/snoretræk, 3x3 m', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; color: #808080;">Rammen til Oban parasollen er lavet i aluminium, hvilket gør den utrolig let at flytte rundt på trods af sin størrelse på 3 x 3 meter. Aluminiumskonstruktionen gør yderligere, at parasollen er robust og vejrbestandig. Det anbefales at lukke parasollen ned, hvis det blæser kraftigt.</span></p>\r\n<p><span style="font-size: 8pt; color: #808080;">En parasol i din have er med til at skabe god stemning og hygge. Derudover er den ideel til at beskytte mod solens stråler, så du kan sidde og slappe af i dine havemøbler.</span></p>\r\n<p><span style="font-size: 8pt; color: #808080;">Oban parasollen fås i farverne hvid og sort.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; color: #808080;">Mål: B:300 cm - H:282 cm - D:300 cm<br /></span></p>\r\n</div>\r\n</div>', 'Oban parasol m/snoretræk, 3x3 m', '', '', '', 'oban-parasol-m-snoretraek-3x3-m'),
(654, 'Springvand - Black Soil', '<p>Ønsker man en rislen i haven - så er dette springvand <br />lige sagen...! <br /><br /></p>\r\n<p>Springvandet er kreeret i Black Soil en speciel lertype, <br />hvis kemiske sammensætning indeholder jern, hvilket <br />gør produkterne meget stærke. <br /><br /></p>\r\n<p>Mål: H140-Ø85 cm<br /><br /></p>\r\n<p><strong><span style="color: #99cc00;">På lager ultimo februar 2014.</span></strong></p>', 'Stort Springvand i Black Soil', '', '', '', 'stort-springvand-i-black-soil'),
(656, 'Angeline Terrazzo Krukke 2014', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern. Fås i fire størrelser.<br /><br /></p>', 'Angeline Terrazzo Krukke 2014', '', '', '', 'angeline-terrazzo-krukke-2014'),
(657, 'Didier Let Beton Krukke 2014', '<p>Vores let beton krukker består af cement, sand, sten og vand <br />og for at gøre den lettere, er der nu tilsat additiver samt synte-<br />tiske fibre, som gør betonkrukken lettere, men stadig med en <br />stor hårdhed.<span style="font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"> (Beton blev oprindeligt opfundet af romerne for mere <span style="font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">end <br />tu<span style="font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">sind år siden og anvendes, som bekendt, i dag <span style="font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">til mange forskellige </span></span></span></span><span style="font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">formål.<br /><br /></span></span></span></span></span><span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"></span></span></span></span></span></p>\r\n<p> </p>\r\n<span style="color: #99cc00;"><strong><span style="font-size: 10pt; font-family: ''Bernhard Modern BT'';"><span style="font-size: 10pt; font-family: ''Bernhard Modern BT'';"><span style="font-s