(856, 'Presley Solvogn', '<p><span style="font-size: 11px;">Presley solvogn i sort er et klassisk havemøbel, som også fås i grafit, mokka og naturfarvet flet. Ryggen kan justeres i mange positioner, så man sidder godt, både når man hygger sig med en god bog eller blot nyder solen. Presley har hjul, så den er let at flytte rundt i haven. </span></p>', 'Presley Solvogn', '', '', '', 'presley-solvogn'),
(675, 'Allesandro Terrazzo Krukke', '<p>Terrazzo krukken er produceret med cement iblandet knust <br />granit. Krukken er vandslebet og til sidst poleret flere gange <br />for at få den smukke glatte overflade. Krukken er endvidere<br />forstærket med jern. Fås i tre størrelser.<br /><br /></p>', 'Allesandro Terrazzo Krukke', '', '', '', 'allesandro-terrazzo-krukke'),
(677, 'Roses Let Beton', '<p>Vores let beton krukker består af cement, sand, sten og vand <br />og for at gøre den lettere, er der nu tilsat additiver samt synte-<br />tiske fibre, som gør betonkrukken lettere, men stadig med en <br />stor hårdhed.<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"> (Beton blev oprindeligt opfundet af romerne for <br />mere <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">end tu<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">sind år siden og anvendes, som bekendt, i dag <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">til <br />mange forskellige <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">formål.)<br /><br /></span></span></span></span></span></p>', 'Roses Let Beton', '', '', '', 'roses-let-beton'),
(678, 'Elegance Let Beton', '<p>Vores let beton krukker består af cement, sand, sten og vand <br />og for at gøre den lettere, er der nu tilsat additiver samt synte-<br />tiske fibre, som gør betonkrukken lettere, men stadig med en <br />stor hårdhed.<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;"> (Beton blev oprindeligt opfundet af romerne for <br />mere <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">end tu<span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">sind år siden og anvendes, som bekendt, i dag <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">til <br />mange forskellige <span style="font-size: 10pt; font-family: ''Bernhard Modern BT''; color: black; font-style: italic;">formål.)<br /><br /></span></span></span></span></span></p>', 'Elegance Let Beton', '', '', '', 'elegance-let-beton'),
