(688, 'Traveller Hvid eller Brun Tex®', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt;">Traveller klapstolen markerer den tydelige trend mod fleksible og mere praktiske møbler, som ikke direkte dikterer et specifikt område, hvor det kan anvendes. Traveller klapstolen kan benyttes både inden- og udendørs. Traveller er bygget op omkring et aluminiumsstel, der let kan klappes sammen. Tag stolen på skulderen og medbring den i den nærmeste park eller på stranden. Klapstolen er designet af dansk designs mest agtede designere, Foersom & Hiort-Lorenzen. </span></p>\r\n<p><span style="font-size: 8pt;">Den udendørs klapstol fås i farverne hvid og taupe. <br /><br /></span></p>\r\n<p><span style="font-size: 8pt;"><span style="font-size: 10pt;"><strong><a href="http://www.youtube.com/watch?v=STMQVXjoylI"><span style="color: #333300;">Se Traveller her.</span></a></strong></span><br /></span></p>\r\n</div>\r\n</div>', 'Traveller Hvid eller Taupe Tex®', '', '', '', 'traveller-hvid-eller-taupe-tex'),
(689, 'Penthouse Sofabord', '<p><span style="font-size: 8pt;">Penthouse er et enkelt og smuk designet sofabord til dine lounge havemøbler. Penthouse er designet af den danske designduo Foersom & Hiort-Lorenzen, som også står bag flere af vores lounge havemøbler. Rammen fås i grå antracit eller hvid aluminium farve - og der kan vælges mellem 3 forskellige bordplader.</span></p>\r\n<p><span style="font-size: 8pt;">Sofabordet er vejrbestandigt og kan tåle at stå ude i alt slags vejr, men hvis du vil spare tid på forårsrengøringen, anbefalder vi at købe et beskyttende møbelovertræk.</span></p>', 'Penthouse Sofabord', '', '', '', 'penthouse-sofabord'),
(690, 'Plaid 100x50 cm i mocca eller sand', '<p><span style="font-size: 8pt;">• 100% Polypropylene</span><br /><span style="font-size: 8pt;"> • Modstandsdygtig overfor UV stråling</span><br /><span style="font-size: 8pt;"> • Plaiden kan vaskes ved 30º C </span><br /><span style="font-size: 8pt;"> • Velegnet til inden- og udendørs brug</span></p>', 'Plaid 100x50 cm i Mocca eller Sand', '', '', '', 'plaid-100x50-cm-i-mocca-eller-sand'),
(691, 'Lansing Havestol', '<p><span style="font-size: 8pt;">Lansing havestolen er bygget op omkring den klassiske kurvestol som var yderst populær blandt 50’erne og 60’ernes kurvemøbler. Stolen fås i farven Natur, og er håndflettet på et galvaniseret stålstel. Siddekomforten i Lansing stolen er sublim både med og uden hynder (Både sæde og ryg hynder kan tilkøbes separat i 4 forskellige farver). Lansing havestolen er blandt Cane-lines bestsellere. I Lansing serien findes også en chaiselounge, stort bordstel, lille bordstel og en lounge sofa.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Mål: Bredde 71 cm, Højde 84 cm, Dybde 65 cm, Sædehøjde 43 cm<br /></span></p>', 'Lansing Havestol', '', '', '', 'lansing-havestol'),
(692, 'Lansing Dinning i Natur', '<p><span style="font-size: 8pt;">Havemøblerne i Lansing serien består af en yderst komfortabel havestol med runde kurver og en romantisk 2-personers lounge sofa. Her sidder man godt og behageligt, både mens man spiser, samt når man bliver siddende ved bordet længe efter middagen er overstået.</span></p>\r\n<p><span style="font-size: 8pt;">Lansing serien består også af to forskellige bordunderstel som fås i forskellige farver (sort, mocca og natur). Understellene kan kombineres med en af Cane-lines mange forskellige bordplader - så du kan opnå den perfekte kombination af havemøbler og borde til din have eller terrasse.</span></p>\r\n<p><span style="font-size: 8pt;">Lansing serien er flettet med Cane-lines smukke, naturtro og slidstærke fiber på varmgalvaniseret stål stel. Både fibrens struktur og fletmetoden sikre spænstighed og optimal siddekomfort i havemøblerne.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Som vist på billedet inkl. hynder<br /></span></p>', 'Lansing Dinning i Natur', '', '', '', 'lansing-dinning-i-natur'),
(693, 'Lansing Sofa i Natur', '<p><span style="font-size: 8pt;">Lansing havestolen er bygget op omkring den klassiske kurvestol som var yderst populær blandt 50’erne og 60’ernes kurvemøbler. Stolen fås i farven Natur, og er håndflettet på et galvaniseret stålstel. Siddekomforten i Lansing stolen er sublim både med og uden hynder (Både sæde og ryg hynder kan tilkøbes separat i 4 forskellige farver). Lansing havestolen er blandt Cane-lines bestsellere. I Lansing serien findes også en chaiselounge, stort bordstel, lille bordstel og en lounge sofa.</span></p>', 'Lansing Sofa i Natur, Cane-line fiber', '', '', '', 'lansing-sofa-i-natur-cane-line-fiber'),
(694, 'Lansing Bord Ø120 cm eller 100x100 cm', '<p><span style="font-size: 8pt;">Lansing serien består også af to forskellige bordunderstel som fås i forskellige farver (sort, mocca og natur). Understellene kan kombineres med en af Cane-lines mange forskellige bordplader - så du kan opnå den perfekte kombination af havemøbler og borde til din have eller terrasse.</span></p>\r\n<p><span style="font-size: 8pt;">Lansing serien er flettet med Cane-lines smukke, naturtro og slidstærke fiber på varmgalvaniseret stål stel. Både fibrens struktur og fletmetoden sikre spænstighed og optimal siddekomfort i havemøblerne.</span></p>', 'Lansing Bord Ø120 cm eller 1,0x1,0 m', '', '', '', 'lansing-bord-o120-cm-eller-1-0x1-0-m'),
(695, 'Lansing Chaiselounge i Natur', '<p><span style="font-size: 8pt;">Lansing chaiselounge er håndflettet i vedligeholdelsesfrie natur flet fibre. Nyd sommeren på langs, i denne eksklusive chaiselounge fra Cane-line.</span></p>\r\n<p><span style="font-size: 8pt;">Chaiseloungen er håndflettet med Cane-lines gennemfarvede og slidstærke fibre i polyethylene - også kaldet polyrattan. Chaiseloungen er praktisk talt vedligeholdelsesfri, og kræver blot at blive vasket lidt med haveslangen før foråret for alvor sætter ind. Vi anbefaler dog, at chaiseloungen i vinterperioden, og i længere perioder uden brug tildækkes med et cover til havemøbler.</span></p>', 'Lansing Chaiselounge i Natur', '', '', '', 'lansing-chaiselounge-i-natur'),
(813, 'Brighton Hyndesæt', '', 'Brighton Hyndesæt', '', '', '', 'brighton-hyndesaet'),
(696, 'Marmorbord Ø60-Ø130 cm', '<p><span style="font-size: 8pt;">Marmorbordet er af højeste kvalitet og kreeret efter Romersk mosaikkunst og <br />selvfølgelig håndlavet efter gammel original teknik. <br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Marmorbordet er frostsikkert - vi anbefaler dog brug af et havemøbelcover.</span></p>', 'Marmorbord Olive Ø60-Ø130 cm', '', '', '', 'marmorbord-olive-o60-o130-cm'),
(697, 'Fer Angelique Smedejernsstol', '<p>Denne Luksus Smedejernsstol er kreeret efter alle kunstens regler:<br /><br /></p>\r\n<p>- Jernfosfatering, Oxsilan behandlet for bedre korrosionsbeskyttelse <br />  og farvevedhæftning <br />- Pulverlakering<br /><br /></p>\r\n<p>med andre ord - den kan holde til det danske vejr...!</p>', 'Fer Angelique Smedejernsstol', '', '', '', 'fer-angelique-smedejernsstol'),
(698, 'Fer Angelique Smedejernsstol u/armlæn', '<p>Denne Luksus Smedejernsstol er kreeret efter alle kunstens regler:<br /><br /></p>\r\n<p>- Jernfosfatering, Oxsilan behandlet for bedre korrosionsbeskyttelse <br />  og farvevedhæftning <br />- Pulverlakering<br /><br /></p>\r\n<p>med andre ord - den kan holde til det danske vejr...!</p>', 'Fer Angelique Smedejernsstol u/armlæn', '', '', '', 'fer-angelique-smedejernsstol-u-armlaen'),
