(712, 'Mallorca Vase', '<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">De ”Hvide” krukker er fra Tunesien, hvor de har fremstillet krukker siden Romernes tid. Derfor er alle modellerne næsten også ægte ”romerske efterkommere”. </span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;"> </span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">Leret der bruges til disse krukker tages fra saltsøerne (De udtørrede søer) i Tunesien. Saltet bevirker, at der opstår den proces ved brændingen, at overfladen bliver hvid og en smule støvet. Krukkerne får et flot og rustikt udtryk.</span></p>\r\n<p><span>Alle krukkerne er selvfølgelig hånddrejede og af lokalt ler og endvidere frostsikre ved rette behandling.</span></p>', 'Mallorca Vase', '', '', '', 'mallorca-vase'),
(857, 'Escape Solvogn', '<div class="cmsContent">\r\n<div class="body">\r\n<p>Escape solvogn er komfort, når det er bedst, uanset om du sidder og læser en god bog eller ligger og nyder solen.</p>\r\n<p>Escape solvogn blev oprindeligt  skabt til et hotelprojekt i Caribien af den unge danske industridesigner Rikke Frost, der kontaktede Cane-line med sin idé. Designet var så specielt, at Cane-line ganske enkelt var nødt til at gå videre med projektet.</p>\r\n<p>Med sine runde og organiske former passer Escape solvogn til den moderne indretning i uderummet.</p>\r\n</div>\r\n</div>\r\n<h2>Specifications</h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="label">Bredde</td>\r\n<td class="value">72 cm</td>\r\n</tr>\r\n<tr>\r\n<td class="label">Højde</td>\r\n<td class="value">103 cm</td>\r\n</tr>\r\n<tr>\r\n<td class="label">Dybde</td>\r\n<td class="value">217 cm</td>\r\n</tr>\r\n<tr>\r\n<td class="label">Sædehøjde</td>\r\n<td class="value">28 cm</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Escape Solvogn', '', '', '', 'escape-solvogn'),
(713, 'Filippo Krukke', '<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">De ”Hvide” krukker er fra Tunesien, hvor de har fremstillet krukker siden Romernes tid. Derfor er alle modellerne næsten også ægte ”romerske efterkommere”. </span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;"> </span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">Leret der bruges til disse krukker tages fra saltsøerne (De udtørrede søer) i Tunesien. Saltet bevirker, at der opstår den proces ved brændingen, at overfladen bliver hvid og en smule støvet. Krukkerne får et flot og rustikt udtryk.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">Alle krukkerne er selvfølgelig hånddrejede og af lokalt ler og endvidere frostsikre ved rette behandling.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">Mål: H40 cm<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;"><span style="color: #99cc00; font-size: 10pt;"><strong>På lager ultimo marts 2014..!</strong></span><br /></span></p>\r\n<br /><br />', 'Filippo Krukke', '', '', '', 'filippo-krukke'),
(714, 'Montepulciano Krukke med 4 potter', '<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">De røde krukker er fra Marokko, hvor de har lavet brugskrukker siden Franskmændene kom til landet for 150 år siden. Derfor er de marrokkanske lavet i en mere fransk stil – almen mediterran stil, og minder derfor også om de græske krukker. <br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">Vores krukker bliver lavet hos en pottemager lige uden for Marrakech, som vores leverandør har kendt i rigtigt mange år. <br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">Alle krukker er selvfølgelig hånddrejede og af lokalt ler. Endvidere er de frostsikre ved rette behandling.<br /><br /></span></p>\r\n<p><span style="font-size: 10pt;"><strong><span style="color: #000000;"><span style="color: #99cc00; font-family: arial black,avant garde;">På lager fra ultimo marts 2014..!</span></span></strong></span><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;"><br /></span></p>', 'Montepulciano Krukke med 4 potter', '', '', '', 'montepulciano-krukke-med-4-potter'),
