(721, 'Søjle Grave', '<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">De røde søjler er fra Marokko, hvor de har lavet brugskrukker siden Franskmændene kom til landet for 150 år siden. Derfor er de marrokkanske lavet i en mere fransk stil – almen mediterran stil, og minder derfor også om det græske. <br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">Vores krukker/søjler bliver lavet hos en pottemager lige uden for Marrakech, som vores leverandør har kendt i rigtigt mange år. <br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;">Søjlerne er frostsikre ved rette behandling.<br /><br /></span></p>\r\n<p><span style="font-size: 10pt;"><strong><span style="color: #000000;"><span style="color: #99cc00; font-family: arial black,avant garde;">På lager fra ultimo marts 2014..!</span></span></strong></span><span style="font-size: 8pt; font-family: verdana,geneva; color: #000000;"><br /></span></p>', 'Søjle Grave', '', '', '', 'sojle-grave'),
