(723, 'Hideaway Loveseat med tag i brun Tex®', '<div style="font-size: 8pt;"><br />\r\n<p><span style="font-size: 8pt;"></span>Cane-line er stolte af at kunne præsentere Hideaway lounge sofaen som en del af vores 2013 havemøbel kollektion. Hideaway lounge sofaen er designet af Cane-lines design team. Lounge sofaen fås i Cane-line Tex farven taupe. Hideaway lounge sofaen er ideel for dig, der søger et udendørs ”gemmested”. På grund af de lette materialer kan Hideaway nemt flyttes rundt i din have eller på din terrasse, så du kan fange solens stråler eller komme i ly for vinden.</p>\r\n<p><br />Hideaway lounge sofaen er et perfekt match til de smarte sideborde i On-the-move serien eller sammen med den modulære lounge sofa gruppe Shape.<br /><br /></p>\r\n<p><a href="http://www.youtube.com/watch?v=cTuC5i--HVo"><strong><span style="color: #003300;">Se videoen af Hideaway her.</span></strong></a></p>\r\n<p> </p>\r\n</div>', 'Hideaway Loveseat med tag i brun Tex®', '', '', '', 'hideaway-loveseat-med-tag-i-brun-tex'),
(724, 'Edge Highback Stol', '<div class="cmsContent">\r\n<div class="body">\r\n<div class="body">\r\n<p><span style="font-size: 8pt;">En meget behagelig lounge stol, der passer perfekt både indendørs såvel som udendørs. Loungestolens minimalistiske design gør den let at passe ind mange steder, uden at den overskygger den omgivende indretning. Den højryggede solstol er designet med både æstetik og funktionalitet i tankerne. Lounge stolen kan stables, og er derfor nem at opbevare når den ikke er i brug.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Edge højrygget lounge stol er designet af de Danske designere STRAND+HVASS <br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Du kan tilvælge en nakkehynde herunder.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;"><br /></span></p>\r\n</div>\r\n</div>\r\n</div>', 'Edge Highback Stol', '', '', '', 'edge-highback-stol'),
(725, 'Devine fodskammel', '<p><span style="font-size: 8pt;">Divine er Cane-lines nye bud på en udendørs fodskammel. Fodskamlen er hæklet i et meget holdbart og slidstærkt materiale. Fodskamlen kan både bruges udenfor i haven eller indendørs i din stue. Den smukke Divine er det ideelle møbel, der med sin elegante og simple udseende, kan lyse op i et hvert lounge miljø – inde som ude.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Divine fodskammel måler 55x55 cm og passer med sin bløde antracit farve perfekt til alle vores andre havemøbler og lounge grupper. Fodskamlen kan anvendes som et ekstra sæde til en gæst, et tiltrængt hvil, eller hvis du blot har brug for at lægge fødderne op.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Det anbefales at Divine fodskamlen opbevares inde eller overdækket af et møbel overtræk i løbet af efteråret og vinteren. Dette vil være medvirkende til at forlænge produktets levetid.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt;">Skulle det blive nødvendig kan du nem og simpelt fjerne betrækket og vaske det ved max 30 grader.</span></p>', 'Devine fodskammel', '', '', '', 'devine-fodskammel'),
(726, 'Cave Hængesofa', '<p style="margin: 0px 0px 12px; padding: 0px 10px 0px 0px; border: 0px none; font-style: inherit; font-variant: inherit; font-weight: inherit; font-size: inherit; vertical-align: baseline; color: #333333; font-family: helvetica,sans-serif; line-height: 18px;"><span style="font-size: 8pt;">Cave hængesofaen er en del af Cane-lines lounge kollektion for 2013.</span></p>\r\n<p style="margin: 0px 0px 12px; padding: 0px 10px 0px 0px; border: 0px none; font-style: inherit; font-variant: inherit; font-weight: inherit; font-size: inherit; vertical-align: baseline; color: #333333; font-family: helvetica,sans-serif; line-height: 18px;"><span style="font-size: 8pt;">Cave er inspireret af den klassiske hængesofa, der ses overalt i verden. Jesper K Thomsen har skabt og designet denne smukke og klassiske hængesofa, i et tidløst design.</span></p>\r\n<p style="margin: 0px 0px 12px; padding: 0px 10px 0px 0px; border: 0px none; font-style: inherit; font-variant: inherit; font-weight: inherit; font-size: inherit; vertical-align: baseline; color: #333333; font-family: helvetica,sans-serif; line-height: 18px;"><span style="font-size: 8pt;">Cave hængesofaen er lavet af vedligeholdelsesfri materialer og kan tåle at stå ude hele året. Vi anbefaler at placere Cave på stabilt underlag og et sted hvor der ikke er kraftig vind.</span></p>', 'Cave Hængesofa - Taupe', '', '', '', 'cave-haengesofa-taupe'),
