(769, 'Maxi Hyndeboks', '<p>Luksus Maxi hyndeboks findes i Sort, Natur og Grey-Wash.</p>\r\n<p><br />Hyndeboksen måler: H64 cm-B134 cm-D62 cm.</p>', 'Maxi Hyndeboks', '', '', '', 'maxi-hyndeboks'),
(770, 'Christel Luksus parasol Ø3,5 m', '<p><span class="hps">i aluminium - super lækker og nem at betjene..!<br /> Parasolen reguleres med et håndtag, således at du med <br />lethed kan hæve eller sænke parasollen. Hvis du ønsker <br />en anden retning på parasollen, træder du på en pedal<br />og drejer den til ønskede position. Parasollen fås i to far-<br />ver Beige eller Sort og <span class="hps">er vævet af et meget kraftigt ackryl-<br />væv.</span><br /><br /></span></p>\r\n<p><span class="hps">Parasol, fod og parasolcover medfølger.<br /></span></p>', 'Christel Hængeparasol Ø3,5 m', '', '', '', 'christel-haengeparasol-o3-5-m'),
(771, 'Piet Luksus Parasol m. tilt Ø3,5 m', '<p>Deluxe parasol på Ø3,5 m med tilt! 250g polyester dug, <br />48 mm to-delt stok, der er FSC godkendt. Endvidere <br />med læderforstærkninger og dobbelt hejsefunktion.<br /><br /></p>\r\n<p>Fås i farverne Natur, Taupe, Sort, Marine og Grå.<br /><br /></p>\r\n<p>Vi råder til en parasolfod på 50 kg.<br /><br /></p>\r\n<p><strong><span style="color: #808000;"><a href="images/stories/piet%20m.%20knk.jpg"><span style="color: #808000;">For yderligere detaljer se her.</span></a></span></strong></p>', 'Piet Luksus Parasol m. tilt Ø3,5 m (5 farver)', '', '', '', 'piet-luksus-parasol-m-tilt-o3-5-m-5-farver'),
(772, 'Charles 3x3 Luksus Parasol m. tilt', '<p>Deluxe parasol på 3x3 m med tilt! 250g polyester dug, <br />48 mm to-delt stok, der er FSC godkendt. Endvidere <br />med læderforstærkninger og dobbelt hejsefunktion. Fås <br />i farverne Natur, Taupe, Sort, Marine og Grå.<br /><br /></p>\r\n<p>Vi råder til en parasolfod på 50 kg.<br /><br /></p>\r\n<p><strong><span style="color: #808000;"><a href="images/stories/nrbillede%20como-charles.jpg"><span style="color: #808000;">For yderligere detaljer se her.</span></a></span></strong></p>\r\n<strong><span style="color: #808000;"><a href="images/stories/piet%20m.%20knk.jpg"><span style="color: #808000;"></span></a></span></strong>', 'Charles 3x3 m Luksus Parasol m. tilt (5 farver)', '', '', '', 'charles-3x3-m-luksus-parasol-m-tilt-5-farver'),
(773, 'Marguerite Parasol Ø3,0 m (5 farver)', '<p>Flot parasol på Ø3,0 m! 250g polyester dug, <br />48 mm to-delt stok, der er FSC godkendt. Endvidere <br />med læderforstærkninger og hejsefunktion.<br /><br /></p>\r\n<p>Fås i farverne Natur, Taupe, Sort, Marine og Grå.<br /><br /></p>\r\n<p>Vi råder til en parasolfod på 40 kg.<br /><br /></p>', 'Marguerite Parasol Ø3,0 m (5 farver)', '', '', '', 'marguerite-parasol-o3-0-m-5-farver'),
(774, 'Yves Parasol Ø2,5 m. tilt (5 farver)', '<p>Flot parasol på Ø2,5 m. tilt! 250g polyester dug, <br />38 mm to-delt stok, der er FSC godkendt. Endvidere <br />med læderforstærkninger og hejsefunktion.<br /><br /></p>\r\n<p>Fås i farverne Natur, Taupe, Sort, Marine og Grå.<br /><br /></p>\r\n<p>Vi råder til en parasolfod på 40 kg.<br /><br /></p>', 'Yves Parasol Ø2,5 m. tilt (5 farver)', '', '', '', 'yves-parasol-o2-5-m-tilt-5-farver'),
(775, 'Yasmina 4x4 m Luksus Parasol', '<p>Deluxe parasol på 4x4 m! 300g polyester dug med en vand-<br />afvisende overflade. Parasollen har en 78 mm stok samt para-<br />solbase med granit sten. Man kan dog vælge og bolte den fast. <br />Fås i farverne Natur/beige og Antracit/grå.<br /><br /><br /></p>\r\n<p><strong><span style="color: #808000;"><a href="images/stories/nrbillede%20como-charles.jpg"><span style="color: #808000;"><br /></span></a></span></strong></p>\r\n<strong><span style="color: #808000;"><a href="images/stories/piet%20m.%20knk.jpg"><span style="color: #808000;"></span></a></span></strong>', 'Yasmina 4x4 m Luksus Parasol', '', '', '', 'yasmina-4x4-m-luksus-parasol'),
(776, '"Så let som ingenting" Parasol 3x4 m', '<p>Aluminiumsparasol med en glasfiberkonstruktion og en stok <br />på 40 mm. Dugen er kreeret i en polyester på 250 g. <br /><br /></p>\r\n<p>Parasollen betjenes så nemt som ingenting, så lige meget hvor <br />lidt kræfter man har, vil man kunne åbne og lukke denne para-<br />sol.<br /><br /></p>\r\n<p>Parasollen findes også i størrelserne Ø3,3 og Ø3 m og i farver-<br />ne Antracit, Sort og Taupe.</p>', '"Så let som ingenting" Parasol 3x4 m', '', '', '', 'sa-let-som-ingenting-parasol-3x4-m'),
(777, '"Så let som ingenting" Parasol Ø3,3 m', '<p>Aluminiumsparasol med en glasfiberkonstruktion og en stok <br />på 38 mm. Dugen er kreeret i en polyester på 250 g. <br /><br /></p>\r\n<p>Parasollen betjenes så nemt som ingenting, så lige meget hvor <br />lidt kræfter man har, vil man kunne åbne og lukke denne para-<br />sol.<br /><br /></p>\r\n<p>Parasollen findes også i størrelserne 3x4 m  og Ø3 m og i farver-<br />ne Antracit, Sort og Taupe.</p>', '"Så let som ingenting" Parasol Ø3,3 m', '', '', '', 'sa-let-som-ingenting-parasol-o3-3-m'),
(778, '"Så let som ingenting" Parasol Ø3 m', '<p>Aluminiumsparasol med en glasfiberkonstruktion og en stok <br />på 38 mm. Dugen er kreeret i en polyester på 250 g. <br /><br /></p>\r\n<p>Parasollen betjenes så nemt som ingenting, så lige meget hvor <br />lidt kræfter man har, vil man kunne åbne og lukke denne para-<br />sol.<br /><br /></p>\r\n<p>Parasollen findes også i størrelserne 3x4 m  og Ø3,3 m og i farver-<br />ne Antracit, Sort og Taupe.</p>', '"Så let som ingenting" Parasol Ø3,0 m', '', '', '', 'sa-let-som-ingenting-parasol-o3-0-m'),
(779, 'Markise 4x3 m Sort eller Beige', '<p>Super lækker Markise på 4x3 m med stativ i pulverlakeret <br />stål. 250g spunacrylvæv der er vandafvisende. Taget kan <br />reguleres trinløst. Skruer og beslag er kreeret i rustfrit stål.<br /><br /></p>\r\n<p>Fås i farverne Sort og Beige.</p>', 'Markise 4x3 m Sort eller Beige', '', '', '', 'markise-4x3-m-sort-eller-beige'),
(797, 'Odessa Luksus solvogn', '<p><span style="font-family: verdana,geneva; font-size: 8pt;">Denne solvogn er en del ud af en lækker loungeserie som kan kombineres og sammenstilles i det antal forskellige siddemoduler som passer til terrassens størrelse eller ens eget pladsbehov. Serien er flettet over et robust, varmegalvaniseret og pulverlakeret aluminiumsstel med en 4,5 mm polyethylenefiber, der dels er utrolig holdbar, men også smudsafvisende.(Ekskl. hynde)<br /></span></p>', 'Odessa Luksus Sunlounge', '', '', '', 'odessa-luksus-sunlounge'),
(799, 'Odessa Loungehjørne', 'Hjørnets mål: H66-B88-D88 cm.', 'Odessa Loungehjørne', '', '', '', 'odessa-loungehjorne'),
(800, 'Odessa Midtersektion', 'Midtersektionens mål: H66-B76-D88 cm.', 'Odessa Midtersektion', '', '', '', 'odessa-midtersektion'),
(801, 'Odessa Loungehjørne - rundt', 'Hjørnets mål: H66-B94/46-D88 cm.', 'Odessa Loungehjørne - rundt', '', '', '', 'odessa-loungehjorne-rundt'),
(802, 'Odessa Chaiselong', '<p>Loungestolens mål: H66-B154-D88 cm.<br /><br /></p>\r\n<p>Du kan vælge højre eller venstre vendt herunder.</p>', 'Odessa Chaiselong', '', '', '', 'odessa-chaiselong'),
(803, 'Odessa Loungebord', 'Bordets mål: H44-B113-D58 cm.', 'Odessa Loungebord', '', '', '', 'odessa-loungebord'),
(806, 'Odessa Loungestol', 'Mål: H66-B86-D88 cm.', 'Odessa Loungestol', '', '', '', 'odessa-loungestol'),
(807, 'Zoe Loungestol', '<p>Loungestolen måler: H66 cm-D88 cm-B88 cm.</p>', 'Zoe Loungestol', '', '', '', 'zoe-loungestol'),
(810, 'Christophe Luksus Stol', '<p><span class="hps">Denne serie<span class="hps"> <span class="hps">er flettet <span class="hps">af <span class="hps">5 mm <span class="hps">syntetisk <span class="hps">polyrattan <span class="hps">i en varm <span class="hps"><br />brun <span class="hps">mixet <span class="hps">farve, der <span class="hps">giver udseende af <span class="hps">ægte bambus<span class="hps">. <span class="hps">Serien <br />omfatter <span class="hps">spisestol, bord<span class="hps"><span class="hps"> samt <span class="hps">en <span class="hps">komfortabel <span class="hps">øreklapstol <span class="hps">med <br />skammel <span class="hps">og <span class="hps">et <span class="hps">lille <span class="hps">sidebord. <br /><br /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n<p><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps"><span class="hps">Stolens mål: H89-B58-D49 cm.<br /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>', 'Christophe Luksus Stol', '', '', '', 'christophe-luksus-stol'),
(828, 'Diamond stol i brun - inkl. hynde', '<p><span style="font-size: 8pt;">Diamond havestolen er et nyt bud på en moderne stol til haven hvor det <br />innovative design kommer til udtryk i de smukke former. Diamond lounge <br />havemøbelserien er designet af to af dansk designs grand old men - <br />Johannes Foersom og Peter Hiort-Lorenzen. Hele den vedligeholdelsesfrie <br />havemøbelserie Diamond baserer sig på et nyudviklet materiale, Cane-line <br />Tex® som er et vejrbestandigt og lysægte materiale. Selv hynden kan stå <br />ude året rundt - stilles blot på højkant så regnen kan løbe af.<br /><br />Bredde: 56 cm, Højde: 81 cm, Dybde: 61 cm, Sædehøjde: 46 cm.<br /></span></p>', 'Diamond stol i brun - inkl. hynde', '', '', '', 'diamond-stol-i-brun-inkl-hynde'),
(824, 'Diamond 2-pers. Loungesofa i Brun Tex®', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Diamond 2 personers havesofa forener på fornem vis designmæssig elegance og høj praktisk værdi. Designet er skabt af arkitekterne Foersom & Hiort-Lorenzen i samarbejde med Cane-line. Sofaen er på alle måder vedligeholdelsesfri med sit unikke betræk i Cane-line Tex. Et materiale, der er yderst vejrbestandig. Hynderne er specielt designet, således at hynderne ikke behøver at tages indenfor, men blot stilles på højkant, hvis der kommer en regnbyge. Alt i alt et moderne valg til haven, altanen eller den store tagterrasse.</span><br /><br /></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">B150 cm-H63 cm-D88 cm-Sædehøjde 40 cm.</span></p>\r\n</div>\r\n</div>', 'Diamond 2-pers. Loungesofa i Brun Tex®', '', '', '', 'diamond-2-pers-loungesofa-i-brun-tex'),
(825, 'Diamond 2-pers. Loungesofa i Brun Tex®', '<div class="cmsContent">\r\n<div class="body">\r\n<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Diamond 3 personers lounge sofa tager sig fantastisk ud fra alle vinkler. Et moderne udtryk kombineret med en komfort man sjældent ser på udendørs lounge havemøbler. Lounge sofaen er betrukket med det vejrbestandige Cane-line Tex® materiale. Hynderne er designet således, at de hurtigt tørrer efter en regnbyge. Du behøver derfor ikke slæbe dine hynder ind, når skyerne trækker sammen på himlen.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Diamond 3 personers lounge sofa fås også i en flettet udgave ligeledes med Cane-line Tex® hynder.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Design Foresom & Hiort-Lorenzen.</span><br /><br /></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">B209 cm-H62 cm-D88 cm-Sædehøjde 40 cm.</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Diamond 3-pers. Loungesofa i Brun Tex®', '', '', '', 'diamond-3-pers-loungesofa-i-brun-tex'),
(826, 'Diamond Lounge stol i Brun Tex®', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Et moderne bud på en lounge stol til haver eller altaner i storbyen. Designet sikrer et markant udtryk med et tidløst præg og en høj komfort. Stolen er betrukket med Cane-line Tex, som er et materiale, der egner sig perfekt til udendørs brug. Diamond serien består udover lounge stolen også  af en fodskammel, 2 størrelser lounge sofaer, en highback lounge stol samt en spisebordsstol. Hynderne behøver man blot stille på højkant, hvis der kommer en regnbyge. Du slipper hermed for at slæbe hynderne frem og tilbage i løbet af sommeren.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Design Foersom & Hiort-Lorenzen.</span><br /><br /></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">B70 cm- H62 cm-D88 cm-Sædehøjde 40 cm.</span></p>\r\n</div>\r\n</div>', 'Diamond Lounge stol i Brun Tex®', '', '', '', 'diamond-lounge-stol-i-brun-tex'),
(827, 'Diamond Fodskammel i Brun Tex®', '<div class="cmsContent">\r\n<div class="body">\r\n<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Den elegante og praktiske fodskammel i Diamond serien er optimal i kombination med lounge stolen eller som en flot ekstra siddeplads til din lounge gruppe. Uden hynde på fodskamlen kan den også bruges som et lavt sofabord sammen med en Club bakke.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Diamond er designet til at kunne stå ude året rundt. Møblet er betrukket med Cane-line Tex, et vejrbestandigt materiale med høj slidstyrke. Hynden er designet med speciel hurtigtørrende skum, så stilles hynden på højkant, kan møblet bruges relativ kort tid efter en regnbyge.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Design: Foersom & Hiort Lorenzen.</span></p>\r\n</div>\r\n</div>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">B70 cm- H40 cm-D70.<br /></span></p>\r\n</div>\r\n</div>', 'Diamond Fodskammel i Brun Tex®', '', '', '', 'diamond-fodskammel-i-brun-tex'),
(829, 'Diamond stol i grå - inkl. hynde', '<p><span style="font-size: 8pt;">Diamond havestolen er et nyt bud på en moderne stol til haven hvor det <br />innovative design kommer til udtryk i de smukke former. Diamond lounge <br />havemøbelserien er designet af to af dansk designs grand old men - <br />Johannes Foersom og Peter Hiort-Lorenzen. Hele den vedligeholdelsesfrie <br />havemøbelserie Diamond baserer sig på et nyudviklet materiale, Cane-line <br />Tex® som er et vejrbestandigt og lysægte materiale. Selv hynden kan stå <br />ude året rundt - stilles blot på højkant så regnen kan løbe af.<br />Bredde: 56 cm, Højde: 81 cm, Dybde: 61 cm, Sædehøjde: 46 cm.<br /></span></p>', 'Diamond stol i Grå - inkl. hynde', '', '', '', 'diamond-stol-i-gra-inkl-hynde'),
(830, 'Chester Taburet', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Chester lounge stolen har meget moderne og skarpe design linjer. Chester lounge stolen er et godt valg til den elegante terrasse, den trendy balkon eller som en enkeltstående stol i et hjørne af udestuen. Chester serien består ud over lounge stolen også af en lounge sofa samt en flot fodskammel, der også kan anvendes som et lavt sofabord. Chester lounge stol fås i farverne natur og graphite.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;">Mål: Bredde 74 cm-Højde 63 cm-Dybde 85 cm-Sædehøjde 30 cm.</span></p>\r\n<p> </p>\r\n<p> </p>\r\n</div>\r\n</div>', 'Chester Taburet', '', '', '', 'chester-taburet'),
(831, 'Breeze Stabelstol', '<div class="cmsContent">\r\n<div class="body">\r\n<p style="margin: 0cm 0cm 10pt;"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Den populære havemøbelserie Breeze har fået et nyt medlem, en stabelbar version af den smukke Breeze havestol. Den nye Breeze stabelstol har som resten af serien en høj komfort. Da stolen kan stables, vil den ikke optage meget opbevaringsplads i f.eks. vinterhalvåret. Vi anbefaler at tildække møblerne med et møbelovertræk.</span></p>\r\n<p style="margin: 0cm 0cm 10pt;"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Den stabelbare havestol er designet af de danske designere Strand+Hvass. Stolen er fremstillet i Cane-line fiber og er vejrbestandig og vedligeholdelsesfri. Vi anbefaler dog almindelig rengøring for at bevare stolen flot og elegant.</span><br /> </p>\r\n<p style="margin: 0cm 0cm 10pt;"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Mål: B60 cm-H83 cm-D62 cm-Sædehøjde 45 cm.</span></p>\r\n</div>\r\n</div>', 'Breeze Stabelstol m/armlæn', '', '', '', 'breeze-stabelstol-m-armlaen'),
(833, 'Breeze Lounge stol', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Den elegante og indbydende Breeze lounge stol forener på fornem vis et enkelt udtryk med høj komfort. Stolens udtryk er skabt af det flotte og transparente fletværk kombineret med lounge stolens moderne ben. Lounge havestolen er designet i vejrbestandige materialer af de danske designere Strand+Hvass.</span><br /><br /></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Mål: B87 cm-H73 cm-D72 cm-Sædehøjde 38 cm.</span></p>\r\n</div>\r\n</div>', 'Breeze Lounge stol', '', '', '', 'breeze-lounge-stol'),
(835, 'Luksus Hængesofa', '<p class="mcevisualaid"><span style="font-family: verdana,geneva; font-size: 8pt;" class="hps">Luksus hængekøje med plads til hele familien - fire komfortable sæder og variable sædehøjde. Ryglænet kan foldes ned så der er mulighed for, at tage en behagelig lur i den rummelige seng. Himlen er lavet af<span class="mceitemhidden"> <span class="hps">FSC-certificeret fyrretræ og taget er PVC-behandlet og modstår vand. Gardinerne kan trækkes for, således at der kan blive læ. Både loft og gardiner samt hynder  inkluderet. </span></span></span></p>\r\n<p><span style="font-size: 8pt;"><br />L219 cm-D130 cm-H158.</span></p>', 'Luksus Hængesofa', '', '', '', 'luksus-haengesofa'),
(837, 'Celine bord - i Teak', '<p>Dette er til familien, der ikke går på kompromis med pladsen<br />om bordet...!<br /><br /></p>\r\n<p>Bordet der måler 220x100x74 er kreeret i sandblæst Teak og <br />står helt flot, råt og unikt ..! </p>', 'Celine bord - i Teak', '', '', '', 'celine-bord-i-teak'),
(838, 'Carmen Dækstol i Teak', 'Lækker dækstol i White Wash Teak - med en super sidde- og<br /> liggekomfort. Dækstolen har indstillelig ryg.', 'Carmen Dækstol i Teak', '', '', '', 'carmen-daekstol-i-teak'),
(839, 'Carmen Solvogn i Teak', 'Lækker Solvogn i White Wash Teak. Solvognen er sandblæst <br />og dette giver en dejlig og rustik finish.<br /><br />Solvognen har endvidere indstillelig ryg- og fodende, således <br />at man får en super komfort.<br /><br />\r\n<p>Målene er: L190 cm-B60 cm-H35cm.</p>', 'Carmen Solvogn i Teak', '', '', '', 'carmen-solvogn-i-teak'),
(840, 'Mira Luksus hynder', '<p>Smukke hynder, der får en til at sidde lidt bedre. Hynderne er<br />lavet af skum og fiber og måler L103 cm-B50 cm-H4 cm.<br /><br /></p>\r\n<p>Hynderne fås i 4 farver.</p>', 'Mira Luksus hynder', '', '', '', 'mira-luksus-hynder'),
(841, 'Nice Dækstolshynder', '<p>L118/74 cm-B50 cm-H6 cm<br /> 60% bomuld og 40% polyester.<br /><br /></p>\r\n<p>Nedenfor kan du vælge mellem 3 farver.</p>', 'Nice Dækstolshynder', '', '', '', 'nice-daekstolshynder'),
(842, 'Nice solvognshynde', '<p>L117/73 cm-B60 cm-H6 cm<br /> 60% bomuld og 40% polyester.<br /><br /></p>\r\n<p>Nedenfor kan du vælge mellem 4 farver.</p>', 'Nice Solvognshynde', '', '', '', 'nice-solvognshynde'),
(843, 'Amalienborg Luksus Havesæt', '<p>Super lækkert og klassisk havesæt bestående af to stole, en bænk og et bord. Sættet er kreeret af mahogni og efterfølgende højglanslakeret i hvid highgloss. Amalienborg sættet er storebroderen til Rosenborg sættet og er en del mere rustikt bygget.<br /><br />Bordets mål: L165xB80xH75 cm.<span style="font-family: verdana,geneva;"> <br /><br /></span></p>', 'Amalienborg Luksus Havesæt', '', '', '', 'amalienborg-luksus-havesaet'),
(845, 'Stockholm 2-pers. bænk', '<p><span style="font-size: 8pt; font-family: verdana,geneva;">Super fin og gammeldags bænk i sortlakeret aluminium. Sæde </span><br /><span style="font-size: 8pt; font-family: verdana,geneva;">og ryg er kreeret i Java lakeret FSC godkendt fyrretræ.</span><br /><span style="font-size: 8pt; font-family: verdana,geneva;"> </span><br /> Bænkens mål: L150 cm-D60.<br /><span style="font-size: 8pt; font-family: verdana,geneva;"> </span><span style="font-size: 8pt; font-family: verdana,geneva;"></span></p>', 'Stockholm 3-pers. bænk', '', '', '', 'stockholm-3-pers-baenk'),
(844, 'Hyndesæt til Amalienborg og Rosenborg sættet', 'Dette lækre hyndesæt i Natur/taupe består af 5 ryghynder, 2 sædehynder samt 1 bænkhynde.', 'Hyndesæt til Amalienborg og Rosenborg sættet', '', '', '', 'hyndesaet-til-amalienborg-og-rosenborg-saettet');
INSERT INTO `i63il_virtuemart_products_da_dk` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(846, 'København 2-pers. bænk', '<p><span style="font-size: 8pt; font-family: verdana,geneva;">Super fin og gammeldags bænk i sortlakeret aluminium. Sæde <br /><span style="font-size: 8pt; font-family: verdana,geneva;">og ryg er kreeret i Java lakeret FSC godkendt fyrretræ.<br /><span style="font-size: 8pt; font-family: verdana,geneva;"> <br /> Bænkens mål: L130 cm-D60.<br /><br /></span></span></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;"><span style="font-size: 8pt; font-family: verdana,geneva;"><span style="font-size: 8pt; font-family: verdana,geneva;"><strong><span style="color: #99cc00;">Først på lager medio juni!</span></strong><br /></span></span></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva;"><span style="font-size: 8pt; font-family: verdana,geneva;"><span style="font-size: 8pt; font-family: verdana,geneva;"></span></span></span></p>', 'København 2-pers. bænk', '', '', '', 'kobenhavn-2-pers-baenk'),
(848, 'Zoe Positionsstol i Natur og Sort', 'Lækker positionsstol i luksus polyrattan fås i natur og sort - og er inkl. hynde. Positionsstolen er en ud af mange i denne havemøbelserie..!', 'Zoe Positionsstol i Natur og Sort', '', '', '', 'zoe-positionsstol-i-natur-og-sort'),
(849, 'Santino Luksus Positionsstol', 'Super Lækker polyrattan positionsstol - der er kreeret i det fineste polyrattan hertil en beige hynde. Denne stol er en del af en havemøbelserie..!', 'Santino Luksus Positionsstol', '', '', '', 'santino-luksus-positionsstol'),
(851, 'Santino Relax Stol', '<p>En dejlig polyrattan Relax stol inkl. beige hynde, der bare ind-<br />byder til og sidde ned. <br /><br />Stolens mål: B58 cm-H85 cm-SH43 cm.<br /><br /></p>\r\n<p><br /><strong><span style="color: #808000;"><a href="images/stories/stol%20mrk.jpg"><span style="color: #808000;">Se stol i Brown Wash</span></a></span></strong></p>', 'Santino Relax Stol i White Wash', '', '', '', 'santino-relax-stol-i-white-wash'),
(852, 'Santino Relax Stol i Brown Wash', '<p>En dejlig polyrattan Relax stol inkl. beige hynde, der bare ind-<br />byder til og sidde ned. Stolen findes også i White Wash.<br /><br />Stolens mål: B58 cm-H85 cm-SH43 cm.<br /><br /></p>', 'Santino Relax Stol i Brown Wash', '', '', '', 'santino-relax-stol-i-brown-wash'),
(853, 'Du & Jeg', '<p>Det romantiske møbel for to..!</p>\r\n<p>Denne klassiker er kreeret i hvidlakeret FSC godkendt fyrretræ og er med høj ryg, som er indstillelig i 3 positioner. Endvidere er den nem og ligetil og flytte rundt med...!<br /><br /></p>\r\n<p><strong><span style="color: #808000;"><a href="images/stories/hvid.jpg"><span style="color: #808000;">Duoen findes også i Java - den kan ses her!</span></a></span></strong></p>', 'Du & Jeg', '', '', '', 'du-jeg'),
(854, 'Chill-Out sofabord m/to bordpladehøjder', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Chill-out sofabordet er med sin justerbare højde en sand revolution. Bordet kan anvendes som lavt sofabord til en god kop kaffe. Nemt og enkelt kan det opjusteres til en komfortabel spise- eller arbejdshøjde. Sofabordet er fremstillet i aluminium og har smukke æstetiske designlinjer.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Chill-out sofabordet er designet af de danske designere Strand+Hvass.</span></p>\r\n<p><br /><span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;">Mål: B104,1 cm-H40 cm-D90 cm.<br /><br /></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;"><span style="color: #808000;"><a href="images/stories/chill-out.jpg"><span style="color: #808000;"><strong>Se detaljer her!</strong></span></a></span><br /></span></p>\r\n</div>\r\n</div>', 'Chill-Out sofabord m/to bordpladehøjder', '', '', '', 'chill-out-sofabord-m-to-bordpladehojder'),
(855, 'Liberty Dining Chair', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;">Flot højrygget spisestol med suveræn komfort til haven. Liberty er trods sin størrelse en meget let spisestol og kan derfor let flyttes rundt i haven eller på terrassen.<br /><br /></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;">Hynderne til havestolen er lavet af det vejrbestandige materiale <span style="color: #808080;">Cane-line Tex, </span>hvis egenskaber gør, at hynden tørrer hurtigt. I hynden er indsyet et drænsystem, som gør, at vandet løber hurtigt igennem hynden. Ønskes en endnu hurtigere tørring kan havehynden stilles på højkant i havestolen.<br /><br /></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;">Liberty havestolen fås i farverne grå og brun og er inklusiv en sædehynde. <br /><br /></span></p>\r\n<p><span style="font-family: verdana,geneva; font-size: 8pt; color: #808080;">Mål: B59 cm-H91 cm-D63 cm-SH47 cm.<br /></span></p>\r\n</div>\r\n</div>', 'Liberty Dining Chair', '', '', '', 'liberty-dining-chair'),
(866, 'Cane-line Parasolfod m/hjul, 47 kg', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Denne praktiske skifer parasolfod med hjul gør det let at flytte din parasol rundt på terrassen alt efter, hvor solen står på himlen.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Passer til parasolstænger med en diameter på max 54 mm.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Vejer 47 kg.<br /><br /></span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Mål: B51 cm - H:38 cm - D51 cm<br /></span></p>\r\n</div>\r\n</div>', 'Cane-line Parasolfod m/hjul, 47 kg', '', '', '', 'cane-line-parasolfod-m-hjul-47-kg'),
(867, 'Core havestol m/u armlæn', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="color: #808080; font-size: 8pt; font-family: verdana,geneva;">Core havestolen kan beskrives med kun to ord - enkelthed og komfort.</span></p>\r\n<p><span style="color: #808080; font-size: 8pt; font-family: verdana,geneva;">Under sædet på Core havestolen er der placeret et ekstra dræn, som sikrer en optimal dræningsproces efter et regnskyl. Sædet på stolen tørrer herved hurtigere, og du kan benytte stolen kort tid efter en sommerbyge.</span></p>\r\n<p><span style="color: #808080; font-size: 8pt; font-family: verdana,geneva;">Benyttes Core havestolen ikke i en kortere periode, kan du med fordel vippe stolen op mod bordkanten, således at regnvand nemmere løber af.</span></p>\r\n<p><span style="color: #808080; font-size: 8pt; font-family: verdana,geneva;">Den enkelte havestol fås i farverne grå og brun. Stolen af designet af den danske designduo Foersom & Hiort-Lorenzen. <strong><em> </em></strong></span></p>\r\n</div>\r\n</div>', 'Core havestol m/u armlæn', '', '', '', 'core-havestol-m-u-armlaen'),
(868, 'Mirage stol inkl. hynde', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Den stabelbare havestol Mirage er resultatet af et langt udviklingsforløb, hvor designerne Foresom & Hiort-Loreanzen har arbejdet med stolens detaljer og funktionalitet. </span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Havestolens elegante og kompakte ydre giver ikke indtryk af, at den kan stables, men stolens design gør det faktisk muligt at stable op til fire stole i én stak. Siddekomforten er optimal og er opnået ved et præcist opspændt betræk, som har flotte stikninger og samlinger, der markerer havestolens flader. </span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Mirage stolen er yderst velegnet som spisestol men er også et glimrende bud på en afslapnings stol, der med et lille sidebord passer perfekt til den lille krog i haven eller på terrassen. <br /><br /></span></p>\r\n</div>\r\n</div>\r\n<h2><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Specifications</span></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Bredde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 62 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Højde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 78 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Dybde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 60 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Sædehøjde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 47 cm</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>', 'Mirage stol inkl. hynde', '', '', '', 'mirage-stol-inkl-hynde'),
(869, 'Avenue cafébordunderstel', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Avenue cafébordstel fås i rustfrit stål og kan kombineres med forskellige størrelser bordplader i materialerne skifer, glas eller kompaktlaminat.</span></p>\r\n</div>\r\n</div>\r\n<h2><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Specifications</span></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Bredde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 45 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Højde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 72 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Dybde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 45 cm</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>', 'Avenue cafébordunderstel', '', '', '', 'avenue-cafebordunderstel'),
(870, 'Axminster pavillion', '<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Axminster havepavillonen fungerer som en fantastisk udvidelse af dit hus, hvor du får et ekstra opholdsrum udenfor. Du kan trække ind i skyggen på varme sommerdage eller sidde længe over middagen på en sommeraften uden at blive generet af aftenduggen, og du kan gå i læ for en kølig sommervind – pavillonen opfylder mange behov.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Axminister havepavillonen kan monteres på alle overflader. Vi anbefaler, at man anvender vores ankersystem, der giver ekstra stabilitet mod blæst. Alle materialer anvendt i Axminster havepavillonen kan tåle at stå ude hele året, men vi anbefaler, at man tager tag og sider ind om vinteren.</span></p>\r\n<p> </p>\r\n<h2><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Specifications</span></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Bredde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 426 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Højde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 287 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Dybde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 300 cm</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'Axminster pavillion', '', '', '', 'axminster-pavillion'),
(871, 'Rest dobbelt solvogn inkl. hynde', '<p><span style="font-size: 8pt; color: #808080; font-family: verdana,geneva;"></span></p>\r\n<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Denne smukke og elegante dobbelte Rest solvogn er en rigtig flyder med plads til to. Med den rigelig plads indbyder den helt automatisk til et samlingspunkt for hele familien. Solvognen er fremstillet i vedligeholdelsesfrie materialer med komfortable hynder i Cane-line TEX. Hynderne tørrer hurtigere end traditionelle hynder.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Suppler med et praktisk Rest sidebord, der med en rund Club serveringsbakke passer perfekt til livet på terrassen.</span></p>\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Designet af team Cane-line.</span></p>\r\n</div>\r\n</div>\r\n<p><span style="font-size: 8pt; color: #808080; font-family: verdana,geneva;"></span></p>\r\n<h2><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Specifications</span></h2>\r\n<p><span style="font-size: 8pt; color: #808080; font-family: verdana,geneva;"></span></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Bredde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 136 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Højde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 82 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Dybde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 197 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Sædehøjde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 34 cm</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style="font-size: 8pt; color: #808080; font-family: verdana,geneva;"></span></p>', 'Rest dobbelt solvogn inkl. hynde', '', '', '', 'rest-dobbelt-solvogn-inkl-hynde'),
(872, 'Savannah daybed modul, venstre', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">De danske designere Johannes Foersom & Peter Hiort-Lorenzen designede Savannah serien i 2008. Et par år senere udviklede de to nye, fritstående og luksuriøse solvogne til at komplimentere Savannah serien. Solvognene kan kombineres, så de bliver til én stor "flyder" til to personer, bred og indbydende. Savannah solvognene kan også bruges enkeltstående til solbadning eller til ren afslapning. Til hver solvogn følger en aftagelig solskærm, som sørger for skygge til ansigtet, når solen bager ned.</span></p>\r\n</div>\r\n</div>\r\n<h2><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Specifications</span></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Bredde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 235 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Højde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 153 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Dybde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 98 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Sædehøjde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 23 cm</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>', 'Savannah daybed modul, venstre', '', '', '', 'savannah-daybed-modul-venstre'),
(873, 'Savannah daybed modul, venstre', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">De danske designere Johannes Foersom & Peter Hiort-Lorenzen designede Savannah serien i 2008. Et par år senere udviklede de to nye, fritstående og luksuriøse solvogne til at komplimentere Savannah serien. Solvognene kan kombineres, så de bliver til én stor "flyder" til to personer, bred og indbydende. Savannah solvognene kan også bruges enkeltstående til solbadning eller til ren afslapning. Til hver solvogn følger en aftagelig solskærm, som sørger for skygge til ansigtet, når solen bager ned.</span></p>\r\n</div>\r\n</div>\r\n<h2><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Specifications</span></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Bredde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 235 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Højde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 153 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Dybde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 98 cm</span></td>\r\n</tr>\r\n<tr>\r\n<td class="label"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Sædehøjde</span></td>\r\n<td class="value"><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;"> 23 cm</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>', 'Savannah daybed modul, Højre', '', '', '', 'savannah-daybed-modul-hojre'),
(874, '', '<div class="cmsContent">\r\n<div class="body">\r\n<p><span style="font-size: 8pt; font-family: verdana,geneva; color: #808080;">Savannah serien blev lanceret i 2008 som vores bud på en meget voluminøs loungesofa med elegante og bløde designkurver. Dette sofamodul i Savannah serien kan både indgår i en klassisk hjørnesofa eller danne en flot 3 personers loungesofa. Mulighederne er utallige og uanset hvilken løsning der måtte vælges vil komfort og designudtryk være i en klasse for sig. Johannes Foersom & Peter Hiort-Lorenzen.</span></p>\r\n</div>\r\n</div>', 'Savannah loungesæt', '', '', '', 'savannah-loungesaet'),
